INSERT INTO `tblprojek` VALUES ('10000000', '10000000', '42039901', 'KEDAH/BPKA', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bangunan Raflesia ILKKM Untuk Dijadikan Kompleks Kesihatan Daerah Kulim Serta Kerja-kerja Berkaitan (Fasa 2)', 'Kerja-kerja ubah suai asrama untuk dijadikan\npejabat. \n1. Unit Pasukan Sekolah / Unit Kenderaan akan ditempatkan dibangunan raflesia\n2.Ketua-ketua unit akan dipusatkan  setempat  di bangunan  raflesia dengan manaik taraf bilik-bilik asrama\n3.Ruang pembasuhan akan dinaik taraf diadikan surau lelaki dan perempuan\n4. Tandas sedia ada di tingkat bawah dan 1 akan dinaik taraf  kepada tandas lelaki ,perempuan dan OKU\n5. Mewujudkan tempat letak kenderaan di bahagian belakang bangunan raflesia bagi kegunaan kakitangan dan pengunjung\n6.Penyelenggaraan sistem kumbahan dan lain-lain bagi memastikan sistem bangunan berfungsi dengan baik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000001', '10000001', '42039901', 'KEDAH/BPP', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Menaik Taraf Dan Pembaikan Blok Bourganvilla, Blok Alamanda, Blok Orkid Dan Blok Jasmine Pusat Untuk Dijadikan Tempat Penyimpanan Rekod Perubatan Wilayah Utara (Perlis,Kedah, Pulau Pinang, Perak)', 'Kerja-kerja ubah suai/ naik taraf blok termasuk sistem pendawaian dengan kelengkapan. Pemasangan pintu tahan api dan pembaikan gerigi tingkap keselamatan sedia ada dan rawatan makhluk perosak', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '750000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000002', '10000002', '42049901', 'PKD Seberang Perai Tengah  dan Jabatan Kesihatan Negeri Pulau Pinang', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Pembaikan Keretakan Dan Menaik Taraf Bangunan Vektor Pejabat Kesihatan Daerah Seberang Perai Tengah Serta Lain-lain Kerja Berkaitan', '1. Kerja - kerja pembaikan dinding yang retak.\n2. Kerja - kerja untuk retaining wall dan kerja infra yang berkaitan. \n3. Pembaikan sistem bekalan air dan kumbahan serta kerja-kerja lain yang berkaitan.\n4. Mengecat dinding yang telah lusuh.\n5. Kerja - kerja pendawaian semula sistem bekalan elekrik dan lain - lain kerja berkaitan.  ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000003', '10000003', '42049901', 'PKD Seberang Perai Tengah  dan Jabatan Kesihatan Negeri Pulau Pinang', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Pembaikan Menaiktaraf Sistem Perpaipan Dan Sistem Kumbahan Serta Lain-lain Kerja Berkaitan Di Bangunan Pejabat Kesihatan Daerah Seberang Perai Tengah, Pulau Pinang', '1. Kerja - kerja menaiktaraf sistem perpaipan / sistem ratikulasi dan lain - lain kerja berkaitan.\n2. Kerja - Kerja menaiktaraf dan pembaikan sistem kumbahan serta lain - lain kerja berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000004', '10000004', '42059901', 'KLINIK DAIF', '1001', '42', '00600', '117', '1001', 'MAC', '2024', 'PERAK', 'Kerja Pembaikan Naik Taraf Bangunan Dan Infrastruktur Serta Kerja-kerja Lain Yang Berkaitan Di Klinik Desa Lambor Kanan, Daerah Perak Tengah', 'Projek Klinik Daif Tahun 2023 Yang Tidak Dapat Membuat Pembayaran Pada Tahun 2023', 'Minit Ceraian Bil. 4/2024 : Kelulusan TKSU (K)Dato\' Sri Norazman Ayob rujukan fail KKM.400-4/2/31 Jld. 9 (16) bertarikh 23.03.2024', '54735.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000005', '10000005', '42059901', 'PEJABAT KESIHATAN DAERAH KINTA', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Pembaikan Dan Naik Taraf Bangunan PKD Kinta, Perak ', '1. Menaiktaraf ruang dengan penambahan struktur bangunan bagi ruang kerja Unit Aset/Stor dan Unit Perolehan. Anggaran harga: RM180,000.00\n2. Kerja-kerja pembaikan bilik mesyuarat dan bilik gerakan (penukaran bumbung jenis asbestos, penggantian syiling, pembaikan tandas dan ruang bekerja bagi bilik gerakan). Anggaran harga: RM40,000.00                                                                                                                                                3. Pembaikan dan naiktaraf keseluruhan tandas yang terdapat di pejabat. Anggaran harga: RM20,000.00                                                                                         \n4. Penggantian sistem perpaipan termasuk tangki air yang telah uzur dan tidak pernah diselenggara dan tukar. Anggaran harga: RM10,000.00\n5. Pendawaian semula talian telefon termasuk PABX. Anggaran harga: RM10,000.00                                                                                                                           6. Mengecat dan mengganti pagar dikeseluruhan bangunan pejabat yang telah lama dan uzur. Anggaran harga: RM50,000.00\n7. Pendawaian semula sistem elektrik bangunan utama PKD Kinta. Anggaran harga: RM80,000.00\n8. Kerja-kerja menurap semula kawasan meletak kenderaan kakitangan dan pelawat dengan kerja-kerja premix termasuk kerja-kerja road marking sediada dan parking tambahan. Anggaran harga: RM50,000.00\n9. Kerja-kerja tambahan ruang bangunan Bilik Pemandu termasuk ruang solat. Anggaran harga: RM50,000.00\n10. Kerja-kerja tambahan ruang bangunan Unit Kejuruteraan/Pembangunan. Anggaran harga: RM80,000.00\n11. Lain-lain pembaikan am yang berkaitan. Anggaran harga: RM30,000.00', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '600000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
