INSERT INTO `tblprojek` VALUES ('10000010', '10000010', '42069901', 'PEJABAT KESIHATAN DAERAH', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Dan Pembaikan Am Serta  Lain-lain Yang Berkaitan Di Pejabat Kesihatan Daerah Hulu Selangor', '1. Mengganti struktur dan kemasan bumbung termasuk penggantian siling\n2. Pembaikan dan penggantian atap genting\n3. Naiktaraf sistem pendawaian elektrik dan mekanikal\n4. Pembaikan dan penggantian struktur tangki dan tangki simpanan air termasuk sistem perpaipan dalaman\n5. Naiktaraf stor integrasi \n6. Mengecat bangunan \n7. Naiktaraf dan pembaikan pakir kenderaan jabatan \n8. Pembaikan am termasuk waterproofing \n9. Kerja-kerja Lain berkaitan ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '600000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
