INSERT INTO `tblprojek` VALUES ('10000030', '10000030', '42099901', 'PEJABAT KESIHATAN DAERAH JOHOR BAHARU', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Menaik Taraf Bilik Mesyuarat Utama Serta Pembaikan Bumbung di Blok C, Pejabat Kesihatan Daerah Johor Bahru', '1. Kerja-kerja membuka keseluruhan bumbung asal jenis genting\n2.Kerja-kerja membuka kerangka kayu sediada\n3.Kerja-kerja pemasangan rangka baru jenis metal\n4.Kerja-kerja pemasangan bumbung jenis metaldeck\n5.Kerja-kerja mengubahsuai dalaman blik mesyuarat\n6.Kerja-kerja pembaikan dinding yang rosak\n7.Kerja-kerja pembaikan lantai bilik mesyuarat.\n8.Kerja-kerja pendawaian baru  ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000031', '10000031', '42099901', 'JKN/PKD', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Pembaikan Dan Naik Taraf Pejabat Kesihatan Daerah Kulai Dan Lain-lain Pembaikan Berkaitan', '1. Naiktaraf sistem penyaman udara di dalam bangunan PKD yang tidak mencukupi\n2. Penambahan sistem pendawaian yang masih berkurangan\n3. Penambahan ruang/bilik untuk pegawai-pegawai kanan PKD Kulai\n4. Lain-lain kerja berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000032', '10000032', '42099901', 'JKN/PKD', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Pembaikan Bumbung Bocor Serta Lain-lain Berkaitan Di Bangunan Utama Dan Stor Unit Uip Pejabat Kesihatan Daerah Mersing ', '1. Penggantian perabung baru yang lebar bagi mengelakkan kebocoran bumbung berulang pada waktu hujan                                                                                                                                                                                                                                      2. Penambahan 1 unit tandas staf perempuan\n3. Penggantian penghawa dingin bermasalah\n4. Penggantian dan pemindahan piping hose reel ke tepi bangunan\n5. Penggantian sistem audio bilik mesyuarat utama', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
