INSERT INTO `tblprojek` VALUES ('10000036', '10000036', '42109901', null, '1007', '42', '00600', '117', '1001', 'MAC', '2024', 'PAHANG', 'Kerja-kerja Pembaikan Rumah Pam (Bekalan Air Bersih Dan Pencegahan Kebakaran) Di Klinik Kesihatan Sri Jaya, Maran, Pahang Akibat Bencana Banjir Serta Lain-lain Kerja Berkaitan', 'Bencana banjir yang berlaku pada 07 Januari 2024 telah mengakibatkan keseluruhan Rumah Pam Klinik Kesihatan Sri Jaya di bawah Pejabat Kesihatan Daerah Maran, Pahang mengalami kerosakan. Ini telah menyebabkan sistem pam air bersih dan pam pencegah kebakaran, papan suis elektrik dan lain-lain mengalami kerosakan yang teruk. Tambahan pula, berlaku gangguan bekalan air bersih kerana sistem pam rosak dan tangki air rosak akibat banjir.\n\nAntara skop kerja yang terlibat adalah seperti yang berikut:\n\ni. Kerja-kerja pembaikan struktur bangunan dan pembaikan kerja awam yang berkaitan;\nii. Kerja-kerja mekanikal dan elektrik; dan\niii. Kerja-kerja pembaikan STP (sistem loji kumbahan).\n', 'KELULUSAN TKSU DATO\' SRI NORAZMAN AYOB BERTARIKH 29.02.2024. BIL. 2/2024 Rujukan Fail : KKM.400-4/2/31 JLD.9 (7)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
