INSERT INTO `tblprojek` VALUES ('10000050', '10000050', '42159901', null, '1007', '42', '00600', '117', '1001', 'MAC', '2024', 'SARAWAK', 'Kerja-kerja Pembaikan Dan Menaik Taraf Di Pejabat Kesihatan Daerah Bau, Sarawak', 'Justifikasi permohonan adalah seperti yang berikut:\n\ni. struktur kayu/separa kayu yang usang /mengalami kerosakan teruk;\nii. sistem kejuruteraan tidak berfungsi dengan baik dan mengganggu operasi pejabat; dan\niii. risiko keselamatan dan membahayakan petugas kesihatan (keretakan bangunan dan kebakaran).\n\nSkop kerja projek ini adalah kerja bangunan, kerja penggantian pendawaian yang telah uzur, kerja luaran, pengujian dan pertauliahan serta kerja-kerja pembaikan lain yang berkaitan.\n', 'KELULUSAN TKSU DATO\' SRI NORAZMAN AYOB BERTARIKH 29.02.2024. BIL. 2/2024 Rujukan Fail : KKM.400-4/2/31 JLD.9 (7)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000051', '10000051', '42010601', null, '1002', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'BPKJ', 'Kerja-kerja Menaik Taraf Sistem Pendawaian Elektrik Dan Sistem Pencegahan Kebakaran Untuk Stor Integrasi, Papan Suis Utama Blok Poliklinik Dan Kerja-kerja Lain Yang Berkaitan Di Hospital Taiping, Perak', 'Kerja-kerja yang perlu dijalankan di dalam kontrak ini meliputi pembinaan dan penyiapan seperti di bawah:\n1. Merombak pendawaian elektrik dan kelengkapan elektrik serta aksesori berkaitan.\n2. Pendawaian elektrik baru, Sistem Pendingin Hawa, Generator Set dan aksesori di kawasan yang ditetapkan di dalam kontrak.\n3. Pemasangan Pendawaian Voltan Rendah dan Papan Suis.\n4. Pemasangan Hose Reel dan Sistem Pencegah Kebakaran.\n5. Kerja Dalaman Bangunan dan Pemasangan Struktur Bangunan.\n6. Pemasangan dan membekal Penjana Tunggu Sedia sementara bagi membekal kuasa elektrik sementara.\n7. Pengujian dan Pentauliahan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '1300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
