INSERT INTO `tblprojek` VALUES ('10000053', '10000053', '42010901', null, '1002', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'BPKJ', 'Kerja-kerja Meroboh Dan Membina Semula Kuarters Yang Uzur Di Klinik Kesihatan Pensiangan, Sabah', '1 Kerja Meroboh Bangunan Sedia Ada\n\n2 Merebentuk & Membina Semula Kuarter 8-Unit\n i. 1- Blok (4-Unit) Kuarters Type 1\n ii. 1- Blok (4-Unit) Kuarters Type 2\n\n3 Kerja-kerja Infrastruktur\n i. Pembersihan Tapak & Penyediaan Tapak Bina\n ii. Sistem Parit Perimeter\n iii. Paip Kumbahan dan Tangki Septik\n iv. Paip Air Retikulasi\n v. Landskap\n\n4 Kerja-kerja Mekanikal & Elektrikal\na) Kerja-kerja Mekanikal\n  i. Pemasangan Paip Air Dalaman\n  ii. Sistem Pembentungan Dalaman & Sistem Kumbahan\nb) Kerja-kerja Elektrikal\n  i. Pemasangan Elektrik Voltan Rendah\n ii. Pemasangan Lampu Luaran\niii. Sistem Pencegahan Kilat', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
