INSERT INTO `tblprojek` VALUES ('10000057', '10000057', '42010901', 'BDHA', '1007', '42', '00600', '117', '1001', 'MAC', '2024', 'BPKJ', 'Kerja-kerja Ubah Suai Ruang Pejabat World Health Organisation Global Service Centre (WHO GSC) Di Prima 7 & 8, Cyberjaya, Selangor ', 'Kerajaan Malaysia telah menandatangani perjanjian tuan rumah bersama Pertubuhan Kesihatan Sedunia (WHO) yang mana Kerajaan Malaysia bertanggungjawab melaksanakan kerja-kerja ubah suai ruang pejabat WHO GSC di Prima 7&8, Cyberjaya, Selangor dengan anggaran kos keseluruhan sebanyak RM2,671,000.00.\n\nAntara skop kerja yang terlibat adalah seperti yang berikut:\ni. Naik taraf pantri dan tandas, pendawaian litar akhir serta kerja-kerja berkaitan;\nii. Pembekalan dan pemasangan motion sensor, instant water heater dan kerja-kerja yang berkaitan;\niii. Pembekalan dan pemasangan sistem penyaman udara dan kerja-kerja yang berkaitan;\niv. Pembekalan dan pemasangan uninterruptable power supply (UPS) dan kerja-kerja yang berkaitan;\nv. Pembekalan dan pemasangan high definition CCTV, sistem siar raya (PA system) dan kerja-kerja yang berkaitan;\nvi. Pembekalan dan pemasangan luggage screening machine dan kerja-kerja yang berkaitan; dan\nvii. Pembekalan dan pemasangan kemasan lantai (karpet) dan kerja-kerja yang berkaitan.\n', 'KELULUSAN TKSU DATO\' SRI NORAZMAN AYOB BERTARIKH 29.02.2024. BIL. 2/2024 Rujukan Fail : KKM.400-4/2/31 JLD.9 (7)', '2671000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000058', '10000058', '42010601', 'RADICARE (M) SDN. BHD.', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'BPL', 'Kerja-kerja Penambahbaikan Sistem Pencegahan Kebakaran (cO) Serta Kerja-kerja Yang Berkaitan Di ILKKM Sungai Buloh.', 'Kerja-kerja melibatkan membuka tong lama dan meletakkan tong lama ke tempat yang bersesuaian termasuk aksesori yang diperlukan serta kerja-kerja membekal dan memasang tong cO 45kg yang baru termasuk hos dan aksesori yang diperlukan untuk memastikan sistem berfungsi dengan baik.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '140000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000059', '10000059', '42010601', 'CSFB', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'BPL', 'Kerja-kerja Naik Taraf, Ubah Suai Dan Selenggara Sistem Perpaipan Serta Kerja-kerja Yang Berkaitan Di ILKKM Alor Setar (Pembantu Perubatan)', '- Kerja-kerja penyambungan semula (bypass) paip yang bocor bawah tanah                                                         - Penggantian paip lama kepada paip baru', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000060', '10000060', '42010601', 'CSFB', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'BPL', 'Kerja Membaik Pulih Kerosakan Bangunan Dan Masalah Bocor Serta Lain-lain Kerja Berkaitan Di ILKKM Batu Pahat (Kejururawatan)', 'Kerja membaiki masalah bocor di parkir Pengarah\nMembuka yang rosak, membekal dan memasang semula bumbung polycarbonat\nMembekal dan memasang awning metal deck di blok - blok sekitar ILKKM\nMembaiki gutter yang telah rosak di blok Akademik dan Asrama\nMembuka yang rosak akibat tempias air hujan, membekal dan memasang pintu baru.\nMengenalpasti dan membaiki masalah retak bangunan yang mengakibatkan kemasukan air dalam bilik pelatih dan pejabat', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000061', '10000061', '42010601', 'ILKKM SUNGAI BULOH', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'BPL', 'Kerja-kerja Membaik Pulih Bumbung Lapan (8) Blok Asrama Pelatih ILKKM Sungai Buloh', 'Kerja-kerja awam melibatkan membaikpulih/penggantian bumbung, siling, perabung dan papan manis yang telah pecah dan patah.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '495000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000062', '10000062', '42180201', 'PTJ', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PPK & ILKKM', 'Kerja-kerja Baik Pulih & Naik Taraf Bangunan Daif (Fasiliti Klinik & Institusi KKM) Di PPKK & ILKKM (Pergigian) (Fasa 1)', '1. Membaik pulih struktur dinding bangunan yang usang termasuk kerja-kerja mengecat dinding bahagian luar & dalam.\n2. Mengganti struktur siling dan papan siling  (jenis particle board (4\'x8\')) kepada gypsum board di Blok C (di koridor)\n3. Mengganti lantai tiles yang pecah di Unit Promosi Pergigian berkeluasan 1,225 kaki persegi.\n4. Mengganti 4 unit pintu kayu sedia ada yang usang (di koridor) kepada jenis kaca lengkap dengan bingkai aluminium bersaiz (6\' x 7\')\n5. Membaiki railing di pintu pagar masuk utama sepanjang 35\' termasuk pembaikan 8 unit roda pagar.\n6. Mengganti papan tanda nama institusi daripada \"Pusat Pergigian Kanak-Kanak & Kolej Latihan Pergigian Malaysia\" kepada \"PUSAT PERGIGIAN KANAK-KANAK & INSTITUT LATIHAN KEMENTERIAN KESIHATAN MALAYSIA (PERGIGIAN)\" selaras dengan pindaan nama institusi sejak 2018. ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000063', '10000063', '42180201', 'CSFB', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PPK & ILKKM', 'Kerja-kerja Menaik Taraf Sistem Pencegahan Kebakaran (Di Bangunan Induk Dan Tambahan) PPKK & ILKKM (Pergigian) (Fasa 4)', '1. Membekal dan mengganti Gaseous Fire Suppresion System sedia ada jenis CO2 kepada jenis FM200 di 4 unit bilik-bilik elektrik utama institusi (bilik switchgear, bilik transformer, bilik MSB dan bilik generator set).\n2. Memecah lantai dan jalan, membekal dan mengganti saluran perpaipan utama sprinkler system sedia ada kepada jenis cement line.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '505000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000064', '10000064', '42180201', 'PTJ', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PPK & ILKKM', 'Kerja-kerja Naik Taraf Sistem Perpaipan Air Bersih Dan Sanitari Di Aras 2, Blok B & C Bangunan Induk, PPKK & ILKKM (Pergigian)  (Fasa 3) ', 'Membekal dan mengganti perpaipan air bersih dan sanitari sedia ada di Blok B & C Bangunan Induk Aras 2 termasuk penggantian kelengkapan (pili) di lokasi berikut:\n1. 2 unit tandas\n2. Bilik penilaian dan kualiti\n3. Makmal besar\n4. Makmal krom/seramik/kobalt', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000065', null, '42230201', 'NIH', '1002', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'NIH', 'Kerja-kerja Menaik Taraf Dan Retrofit Sistem Penyaman Udara Sedia Ada Dengan Komponen Heater/ Dehumidifier Tambahan Di Makmal-makmal Institut Kesihatan Negara (NIH), Setia Alam Selangor', 'Kerja-kerja menaik taraf sistem penyaman udara sediada dengan retrofit komponen heater/ dehumidifier tambahan di makmal-makmal yang menempatkan peralatan biomedikal bernilai tinggi yang memerlukan keadaan suhu dan kelembapan yang tetap agar dapat beroperasi dengan baik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '120000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000066', '10000066', '42300101', 'CSFB', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'NIH', 'Pemulihan Paip Hose Reel Atas Tanah Menggantikan Yang Di Bawah Tanah', 'Kerja melibatkan pemotongan paip hose reel sedia ada dan pemasangan paip baru di atas tanah', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000067', '10000067', '42300101', 'NIH', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'NIH', 'Pembinaan Tandas Dalam Pejabat Pengarah Instititut Penyelidikan Tingkahlaku Kesihatan, IPTK @ NIH', 'Kerja melibatkan pemecahan dinding dan lantai untuk membuat ruang tandas serta kerja-kerja perpaipan air, pendawaian, pemasangan lampu, pintu, tingkap dan sistem exhaust. Kerja-kerja pemasangan jubin lantai dan dinding, cermin, sinki dan tandas jenis duduk', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '60000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000068', '10000068', '42300101', 'NIH', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'NIH', 'Pembaikan Bumbung Dan Siling Bangunan Insektarium Unit Entomologi Serta Lain-lain Kerja Berkaitan Di Institut Penyelidikan Perubatan, IMR Jalan Pahang', 'Kerja-kerja pembaikan bumbung dan penggantian siling', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000069', '10000069', '42290101', 'IKN/PTJ1', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'IKN', 'Kerja-kerja Ubah Suai Dan Naik Taraf Pejabat Jabatan Paliatif Dan Nursing Home Serta Kerja-kerja Berkaitan Di Institut Kanser Negara', 'Ubah suai dan naik taraf Pejabat Jabatan Paliatif dan lain-lain kerja berkaitan\n1. Kerja meluaskan kawasan umum di Jabatan Paliatif.\n- Kerja memecah dinding.\n- Kerja penggantian Lantai Vynil\n- Kerja penyediaan power point dan network point.\n- Kerja Pemasangan  FCU di ruang kerja bagi menampung pertambahan pengguna.\n- Kerja penyambungan bekalan kuasa bagi FCU.\n- Kerja ubahsuai ducting\n2. Pembekalan perabot pejabat \n3. Lain-lain kerja-kerja berkaitan\n\nMengubah suai ruang home nursing unit untuk dijadikan klinik pesakit luar Paliatif serta ruang kerja penyediaan ubat untuk unit Community Palliative Care dan kerja-kerja berkaitan \n1. Kerja meluaskan kawasan umum di Jabatan Paliatif.\n- Kerja memecah dinding.\n- Kerja membina dinding baru\n- Kerja penggantian Lantai Vynil\n- Kerja penyediaan power point dan network point.\n- Kerja ubahsuai ducting\n2. Pembekalan perabot pejabat \n3. Lain-lain kerja-kerja berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '850000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000070', '10000070', '42250101', 'PUSAT DARAH NEGARA', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PDN', 'Kerja-kerja Naik Taraf Ruang Pendermaan Darah Dan Lain-lain Kerja Berkaitan Di Pusat Darah Negara', '1) Kerja-kerja naiktaraf fasiliti di ruang pendermaan darah.\n2) Kerja-kerja penambahbaikan dinding dan pemasangan papan tanda di ruang pendermaan darah dan sekitarnya.\n3) Kerja-kerja penggantian perabot dan curtain blind kepada jenis yang boleh dilap - keperluan GMP.\n4) Kerja-kerja pemasangan sistem audio-visual dan sistem nombor giliran penderma (queue management system).', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000071', '10000071', '42250101', 'PUSAT DARAH NEGARA', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PDN', 'Kerja-kerja Naik Taraf Laluan Blok Fraksinasi Dan Lain-lain Kerja Berkaitan Di Pusat Darah Negara', '1) Kerja memecah lantai laluan sedia ada untuk mendapatkan kecerunan yang sesuai.\n2) Kerja membina struktur konkrit tambahan bersambung dengan laluan sedia ada.\n3) Kerja membina cement rendering dengan kecerunan yang bersesuaian termasuk finishing dengan pebble wash.\n4) Kerja membina tembok parapet batu bata termasuk pemegang besi mengikut kesesuaian tapak dan kecerunan berkaitan pada kawasan tambahan laluan.\n5) Kerja membuat concealed pipe pada longkang grating sedia ada dan bersambung dengan drain sump baru dan surface scupper drain sepanjang extended ramp wall\n6) Membekal dan memasang penutup longkang di sepanjang laluan kiri dan kanan Blok Fraksinasi.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000072', '10000072', '42250101', 'PUSAT DARAH NEGARA', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PDN', 'Kerja-kerja Naik Taraf Ruang Auditorium Dan Bilik Mesyuarat Serta Lain-lain Kerja Berkaitan Di Pusat Darah Negara', '1) Kerja-kerja naiktaraf lantai auditorium dan bilik mesyuarat\n2) Kerja-kerja naiktaraf conference system dan sistem audio-visual di bilik mesyuarat utama', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000073', '10000073', '42011002', 'Program Kesihatan Pergigian', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PGM GG', 'Projek Memasang, Mengkonfigurasi Dan Menguji Sistem TPC-OHCIS Di 23 Klinik Pergigian (KP) KKM Di Negeri Johor, Selangor Dan WP Kuala Lumpur', '1. Site Readiness - Software and Network Policy Update\n2. Konfigurasi PDSA - Data Centre - installation of TPC-OHCIS Software, services, configuration, setup masterdata\n3. Instalasi, konfigurasi, dan pengujian TPC-OHCIS di Klinik Pergigian mengikut Zon \na. Instalasi, konfigurasi dan pengujian FA\nb. Instalasi, Konfigurasi dan pengujian PC\nc. Instalasi, Konfigurasi dan pengujian Laptop (Outreach)\nd. Instalasi, Konfigurasi dan pengujian QMS (SET)\ne. Pengujian Simulasi Aplikasi TPC-OHCIS & UAT Klinik\nf. Latihan Pengguna\n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '902113.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000074', '10000074', '42011002', 'Program Kesihatan Pergigian', '1007', '42', '00600', '117', '1001', 'MAC', '2024', 'PGM GG', 'Kerja-kerja Ubah Suai Bilik Pegawai Kepada Bilik Makmal Forensik Digital Pergigian Di Aras 5, Blok E10, Program Kesihatan Pergigian', 'Antara skop kerja yang terlibat adalah seperti yang berikut:\n\ni. kerja-kerja permulaan antaranya merangkumi penyediaan polisi insurans, cadangan lukisan pembinaan berdasarkan pelan lakaran, kerja-kerja pembersihan tapak, perlindungan kawasan kerja, pengujian dan pentauliahan bagi sistem mekanikal, elektrikal, telefon dan ICT, 3 set as built drawing hardcopy dan softcopy bagi layout dan schematic drawing untuk kerja-kerja elektrikal;\n\nii. kerja-kerja ubah suai dan naik taraf antaranya merangkumi penyediaan ruang ubah suai, keja membina dinding sekat baharu, kerja mengecat, membekal dan memasang pintu, kemasan siling, kemasan lantai, tinted warna gelap dan rintangan haba pada cermin tingkap, mematikan engsel tingkap, membekal dan memasang built-in furniture; \n\niii. kerja-kerja sistem elektrikal antaranya merangkumi pendawaian baharu dari DB sedia ada ke DB baharu, mengalih dan memasang semula CCTV, membekal dan memasang lampu LED jenis downlight, membekal dan memasang mata soket alir keluar kuasa 13A, mata penyaman udara sehingga 2 kuasa kuda lampu tanda keluar, membekal dan memasang UPS sekurang-kurangnya 1kVA, membekal dan memasang mata rangkaian data daripada patch panel ke faceplate; dan\n\niv. kerja-kerja mekanikal antaranya merangkumi pemasangan wall mounted air cooled split unit, automatic fire suppression system dan termination of existing sprinkler.\n', 'KELULUSAN TKSU DATO\' SRI NORAZMAN AYOB BERTARIKH 13.03.2024. BIL. 3/2024 Rujukan Fail : KKM.400-4/2/31 JLD.9 (8)', '141500.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000075', '10000075', '42010806', 'MKAK', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'MKAK', 'Kerja-kerja Naik Taraf Sistem Perlindungan Kilat Di Plant Room, Blok A Dan Stor Mudah Terbakar', 'Kerja memasang perangkapt kilat dan pembumian di Bilik HT, blik LV, Bilik Chiller , Blok A dan stor mudah terbakar', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000076', '10000076', '42010806', 'MKAK', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'MKAK', 'Kerja-kerja Penggantian Bumbung Jenis Polycarbonate Di Bangunan Blok A,MKAK', '1.Kerja membuka dan membuang bumbung sedia.                                                           2.Kerja mengecat keseluruhan kerangka.                                         3.Kerja membekal dan memasang  5mm solid polycarbonate termasuk roof trimming pada bahagian sambungan dan kerja-kerja lain yang berkaitan.                                                            a)sayap kiri -228 sqft                                           b)sayap kanan 228sqft                                           c) koridor blok A-224sqft.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '30000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000077', '10000077', '42010806', 'MKAK', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'MKAK', 'Kerja-kerja Ubah Suai Bilik Laporan di MKAK', '1.Kerja membuka dinding jenis partiton sedia ada dan memasang dinidng baru jenis cement board termasuk kerja-kerja mengecat.                  \n2.Kerja pendawaian bagi lampu,split unit dan acces card.                                                 \n3.kerja membekal dan memasang split unit.                                                       4.Kerja membaik pulih siling dan lantai vinyl.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '34000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000078', '10000078', '42230201', 'NPRA', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'NPRA', 'Kerja-kerja Pengubahsuaian Untuk Pengasingan Ruang Pejabat Pegawai Farmasi/Penolong Pegawai Farmasi Keluar Dari Kawasan Makmal Blok F,H Dan I Serta Menaik Taraf Ruang Pejabat Di Blok B Dan C Serta Ruang Gunasama Termasuk Kerja-kerja Lain Berkaitan\n\n', '1.Kerja-kerja menanggal dan memecahkan ruang pejabat lama serta kerja pelupusan berkaitan\n2. kerja-kerja pembaikan permukaan lantai dan permukaan dinding\n3. Kerja-kerja penyediaan fasiliti elektrikal, networking dan telefon\n4. kerja-kerja penyediaan ruang kerja bagi anggota Farmasi dan Pen. Pegawai Farmasi\n5. kerja-kerja pengujian dan pentaulihan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '990000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000079', '10000079', '42029901', 'Pengurusan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerjakerja Naik Taraf Auditorium Dr. Syed Mahmood Jabatan Kesihatan Negeri Perlis Serta Kerja-kerja Lain Yang Berkaitan\n(16 Minggu)', 'KERJA-KERJA KEJURUTERAAN\n1. Kerja membekal dan memasang skrin projektor bersaiz 5.2m tinggi x 9m lebar\n2. Kerja menanggal skrin yang lama dan memasang skrin baru\n\nKERJA-KERJA SISTEM AUDIO\n3. Kerja membekal dan memasang speker dan mixer untuk bilik kawalan auditorium\n\nKERJA-KERJA LAIN\n4. Kerja pemasangan dan pengujian sistem', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '70000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000080', '10000080', '42029901', 'Perubatan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Menaik Taraf Dan Pengubahsuaian Blok Bangunan Unit Perolehan & Aset Dan Fisioterapi Kepada Pusat Kecemerlangan Perkhidmatan Fisioterapi Serta Lain-lain Kerja Berkaitan, Hospital Tuanku Fauziah, Perlis\n(20 Minggu)', 'Mengubahsuai dalaman blok bangunan Unit Perolehan & Aset serta Unit Fisioterapi sedia ada ke sepenuhnya sebagai Pusat Kecemerlangan Perkhidmatan Fisioterapi.\n\nKerja-Kerja Sivil & Arkitektur:\n- Kerja-Kerja memecah dinding bata, tandas sediada, menanggal kelengkapan kebersihan, perpaipan serta kelengkapan yang berkaitan bagi penyediaan ruang gimnasium.\n- Kerja-kerja membekal dan memasang dinding sesekat serta kelengkapan dan mengikat bata bagi penyediaan bilik penilaian pesakit, bilik-bilik rawatan dan lain-lain.\n- Membina dan menyiapkan sebuah tandas OKU baru serta kerja berkaitan.\n- Kerja-kerja ubahsuai tandas cangkung kepada jenis duduk serta kelengkapan.\n- Membekal dan memasang pintu serta kelengkapan untuk bilik-bilik baru.\n- Membekal dan memasang kaunter pendaftaran serta kelengkapan.\n- Memecah lantai sediada, penyediaan lantai bagi memasang vinyl di ruang gymnasium\n- Membekal dan memasang curtain meditrack serta kelengkapan.\n- Kerja-kerja penggantian bumbung asbestos sediada kepada jenis Metal Deck PU Foam serta kerja-kerja berkaitan.\n- Kerja-kerja pengindahan lanskap bertemakan \'therapeutic garden\' serta kerja-kerja berkaitan (kawasan berbumbung luar)\n\nKerja-Kerja Mekanikal:\n- Kerja-kerja membekal dan memasang kipas ekzos serta kerja-kerja berkaitan.\n- Kerja-kerja membekal dan memasang alat hawa dingin pelbagai kapasiti serta kerja-kerja berkaitan.\n\nKerja-Kerja Elektrikal:\n- Kerja-kerja membekal dan memasang kipas, soket dan kerja-kerja berkaitan.\n- Kerja-kerja membekal dan memasang sistem QMS, cctv, sistem siaraya, rangkaian ict, talian telefon serta kelengkapan berkaitan.\n- Kerja-kerja menanggal, mengubah dan memasang semula alarm panel, server rack, distribution board, alat hawa dingin, rangkaian ict, talian telefon serta semua kelengkapan berkaitan.\n\nKerja-Kerja Lain:\n- Membekal dan memasang kelengkapan perabot, kerusi, meja, signage serta kelengkapan berkaitan.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000081', '10000081', '42029901', 'Perubatan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-Kerja Menaik Taraf Ruang Menunggu Klinik Pakar Serta Lain-lain Kerja Berkaitan, Hospital Tuanku Fauziah, Perlis\n(12 Minggu)', 'Menaiktaraf kawasan ruang menunggu Klinik Pakar supaya bertutup serta pemasangan sistem pendingin udara.\n\nKerja-Kerja Sivil & Arkitektur:\n- Membekal dan memasang cement fiber board sebagai dinding untuk menutup kawasan ruang menunggu tersebut lengkap dengan pintu, tingkap.\n- Membekal dan memasang lantai lepekan simen dan bercat epoxy.\n\nKerja-Kerja Mekanikal:\n- Membekal dan memasang pendingin udara jenis split unit.\n- Membekal dan memasang kipas ekzos untuk pengudaraan.\n\nKerja-Kerja Elektrikal:\n- Membekal dan memasang tambahan lampu.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '70000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 23:08:22');
INSERT INTO `tblprojek` VALUES ('10000082', '10000082', '42029901', 'Perubatan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Membina Parkir Berbumbung Ambulans Di Jabatan Kecemasan, Serta Lain-lain Kerja Berkaitan Hospital Tuanku Fauziah, Perlis\n(4 Minggu)', '1.Kerja-kerja tapak asas (footing) untuk tiang serta lain-lain kerja berkaitan.\n2. Kerja memasang tiang besi dan memasang kerangka jenis mild steel serta kerja-kerja memasang bumbung jenis PU foam metal termasuk lain-lain kerja berkaitan.\n3. Kerja-kerja premix.\n4. Kerja-kerja pendawaian elektrik serta lampu serta lain-lain kerja berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '30000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000083', '10000083', '42029901', 'Perubatan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Menaik Taraf Dan Menambahbaik Pengudaraan Wad Kelas Ketiga C1 Serta Lain-lain Kerja Berkaitan, Hospital Tuanku Fauziah, Perlis\n(12 Minggu)', 'Menambahbaik Pengudaraan Wad C1.\n\nKerja-Kerja Mekanikal:\n- Membekal dan memasang sistem evaporative cooler wall mounted lengkap dengan sistem perpaipan air.\n- Membekal dan memasang kipas-kipas pelawas secara bukaan dinding.\n- Membekal dan memasang floor standing dehumidifier.\n\nKerja-Kerja Elektrikal:\n- Kerja-kerja pendawaian untuk sistem evaporative cooler, split unit dan soket untuk portable floor standing dehumidifier.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000084', '10000084', '42029901', 'Perubatan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Naik Taraf Stor Lama HDU Sebagai Stor Jabatan Kecemasan Dan Pejabat KPJH\n(5 Minggu)', '1. Kerja-kerja membina dinding di antara stor.\n2. Kerja-kerja menebuk dinding sedia ada untuk pemasangan pintu keluar dan tingkap.\n3. Kerja meratakan lantai.\n4. Kerja-kerja menutup ruang longkang di dalam bilik sedia ada.\n5. Pemasangan exhaust fan.\n6. Kerja Pengalihan lampu dan kipas.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '25000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000085', '10000085', '42029901', 'Perubatan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Naik Taraf Di Bilik Server Aras 3 Blok B Serta Lain-lain Kerja Berkaitan, Hospital Tuanku Fauziah \n(12 minggu)', '1. Kerja-kerja pemasangan dua unit Penghawa Dingin Jenis FCU berkapasiti 2hp dan 7 hp dan lain-lain kerja berkaitan\n2. Kerja-kerja penyambungan signal panel pencegah kebakaran ke bilik kawalan utama\n2. Kerja-kerja pemasangan CCTV', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '112000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000086', '10000086', '42029901', 'Perubatan/Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja MenaikTaraf Dan Mengubahsuai Stor Sedia Ada Kepada Pejabat Dan Stor Unit Perolehan & Aset, Unit Kejuruteraan Serta Lain-lain Kerja Berkaitan, Hospital Tuanku Fauziah, Perlis\n(20 minggu)', 'Menaiktaraf dan mengubahsuai Stor sedia . Komponen bangunan dibahagi kepada beberapa ruang pejabat, stor dan bilik pejabat.\n\nKerja-Kerja Sivil & Arkitektur:\n- Mengubahsuai dalaman bangunan dengan partition fiber cement board untuk mewujudkan ruang-ruang untuk pejabat dan stor.\n- Membekal dan memasang siling baru dengan ketinggian sesuai bagi pejabat dan stor.\n- Mengalihkan roller shutter ke ruang penerimaan stor.\n- Membekal dan memasang perabot (loose dan built-in)\n\nKerja-Kerja Mekanikal:\n- Membekal dan memasang sistem pencegah kebakaran lengkap dengan Fire Alarm Panel (smoke, heat, breakglass), sistem pendingin udara, kipas, pengudaraan & ventilasi, pemadam kebakaran dan lain-lain.\n\nKerja-Kerja Elektrikal:\n- Membekal dan memasang pendawaian soket alur keluar, lampu siling, lampu kecemasan, lampu egress, point telefon dan internet, network switch, pintu magnetic, siar raya dan lain-lain. \n\n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '343000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000087', '10000087', '42029901', 'Pergigian/ Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Naik Taraf Ruang Kosong Aras 1 Klinik Kesihatan Jejawi Untuk Dijadikan Klinik Pergigian Serta Kerja Lain Berkaitan\n(24 Minggu)', '1. Kerja-kerja pembahagi dinding menggunakan cement board serta kerja lain berkaitan\n2. Kerja-kerja pendawaian elektrik dan Distribution Board (DB), soket serta kerja lain berkaitan\n3. Kerja-kerja naiktaraf perpaipan air dalaman untuk bilik steril dan surgeri\n4. Kerja-kerja awam lain seperti pintu, pecah dinding dan kerja lain berkaitan.\n5. Kerja-kerja paip buangan ke mainhole dari bilik surgeri serta kerja lain berkaitan.\n6. Kerja-kerja mekanikal (pendingin hawa) dan kerja lain berkaitan\n7. Kerja-kerja membuka, mengangkut dan memasang kerusi pergigian dan kerja lain berkaitan\n8. Kerja-kerja membekal dan memasang bench top dan kabinet gantung dalam bilik rawatan dan bilik pensterilan serta keraj lain berkaitan ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000088', '10000088', '42029901', 'Kesihatan Awam/ Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Naik Taraf Sistem Kejuruteraan, Infrastruktur Serta Lain-lain Kerja Berkaitan Di Klinik Kesihatan Beseri\n(14 Minggu)\n', '1) Kerja-kerja naik taraf permukaan tanah sedia ada kepada road chipping dan diperkuatkan dengan crusher run sebagai road base\n\n2) Kerja-kerja resurface permukaan jalan sedia ada menggunakan asphaltic concrete 14 untuk melancarkan permukaan jalan yang akan digunakan sebagai laluan utama pesakit dan staff\n\n3) Kerja-kerja pelebaran pintu pagar masuk sedia ada dan membuat laluan khas keluar klinik\n\n4) Kerja-kerja membuka pintu pagar untuk laluan pejalan kaki \n\n5) Kerja-kerja memasang perabot jalan seperti island kerb, papan tanda jalan dan penanda jalan\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000089', '10000089', '42029901', 'Kesihatan Awam/ Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Naik Taraf Bangunan Klinik OSCA Dan Stor Klinik Serta Kerja Lain Berkaitan Di Klinik Kesihatan Kuala Perlis\n(16 Minggu)', '1) Kerja-kerja menanggal  struktur  bumbung sediaada dan menggantikan semula struktur  bumbung jenis besi serta penggantian  bumbung metal deck\n2) Kerja -kerja melaraskan semula dinding,serta membina semula rasuk bumbung\n3)  Kerja -kerja pemasangan siling jenis gantung dan siling lekap di luar bangunan\n4) Kerja -kerja pembaikan jubin lantai\n5) Kerja -kerja kemasan cat serta kerja lain berkaitan \n6) Kerja -kerja penggantian tandas dari tandas cangkung ke duduk serta kerja lain berkaitan\n7) Kerja -kerja perpaipan semula dari meter ke bangunan klinik serta perpaipan dalaman klinik\n8) Kerja -kerja pembaikan semula kawasan berpunca kemasukan jentera ke tapak\n9) Kerja-kerja pendawaian semula elektrik, pemasangan kelengkapan mekanikal dan pendawaian talian internet serta talian telefon', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000090', '10000090', '42029901', 'Kesihatan Awam/ Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Naik Taraf Pendawaian Elektrik Serta Lain Kerja Berkaitan Di Klinik Kesihatan Kg. Gial\n(8 Minggu)', '1) kerja -kerja mengenalpasti kabel outgoing yang bermasalah\n2) Pendawaian semula elektrik di bahagian Pesakit Luar', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000091', '10000091', '42029901', 'Kesihatan Awam/ Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Kerja-kerja Naik Taraf Bangunan Dan Infrastruktur Klinik Kesihatan Jejawi Serta Lain-lain Kerja Berkaitan\n(16 Minggu)', '1) Kerja-kerja naik taraf permukaan jalan sedia ada kepada asphaltic concrete (flexible pavement) untuk dijadikan tempat meletak kenderaan \n2) Kerja-kerja naik taraf sistem perparitan klinik \n3) Kerja-kerja naik taraf pagar kawasan menggunakan galvanized chain link dan menebas pokok-pokok yang merosakkan pagar klinik\n4) Kerja-kerja naik taraf pintu pagar klinik dengan melebarkan keluasan pintu dari saiz satu kenderaan kepada saiz dua kenderaan\n5) Naik taraf dua (2) unit kuarters bahagian atas kepada ruang pentadbiran dan stor klinik.\n6) Kerja-kerja pengubahsuaian dalaman dua (2) unit kuarters bahagian atas.\n7) Kerja-kerja sistem elektrikal, mekanikal dan ict\n8) Kerja-kerja membina pondok pengawal ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000092', '10000092', '42029901', 'Kesihatan Awam/ Baharu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERLIS', 'Naik Taraf Dan Ubah Suai Klinik Desa Pauh Bagi Menjadikan Pusat Pengoperasian Perkhidmatan Unit BAKAS Dan KMAM Negeri Perlis\n(20 minggu)', '1) Kerja-kerja naik taraf struktur bangunan sedia ada kepada jenis konkrit tetulang.\n2) Kerja-kerja naik taraf struktur bumbung sedia ada kepada light weight roof trusses dan atap bumbung.\n3) Kerja-kerja pengubahsuaian dalamanan yang melibatkan penambahan kepada ruang menunggu, bilik rawatan, bilik penyusuan, bilik demo, stor bahan, stor sisa klinikal dan bilik elektrik.\n4) Kerja-kerja naik taraf tandas kepada tandas jenis duduk.\n5) Kerja-kerja naik taraf infrastruktur klinik yang melibatkan sistem perparitan, sistem kumbahan, pagar kawasan, jalan dan tempat meletak kenderaan.\n6) Kerja-kerja naik taraf sistem pendawaian satu fasa kepada tiga fasa\ndan penambahan soket mengikut keperluan semasa klinik.\n7) Kerja-kerja naik taraf sistem mekanikal termasuk pendingin hawa di ruang menunggu dan bilik rawatan.\n8) Kerja-kerja naik taraf sistem teknologi maklumat dan capaian rangkaian (internet) mengikut keperluan klinik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000093', '10000093', '42039901', 'Perubatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Membina Bangunan Tambahan \"Short Stay Unit\" Di Jabatan Kecemasan Di Hospital Kulim Serta Kerja-kerja Berkaitan ', '1. Penambahan ruang rawatan utama dengan 20 katil rawatan \n2. Penambahan 1 bilik OSSC termasuk tandas mengikut spesifikasi\n3. Penambahan 1 bilik POCT mengikut spesifikasi\n4. Pembinaan tandas pesakit\n5. Penambahan 1 bilik utility kotor \n6. Ruang laluan akses keluar', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '650000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000094', '10000094', '42039901', 'Kesihatan Awam ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Klinik Desa Pengkalan Tok Putih Kepada Klinik Kesihatan Jenis 6 Serta Kerja-kerja Berkaitan ', 'Kerja-kerja tambahan bangunan untuk ruangan OPD, kecemasan, tandas, farmasi dan makmal, kerja-kerja elektrik dan mekanikal, kerja-kerja menurap jalan, kerja-kerja membekal dan memasang pagar jejaring serta lain-lain kerja berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000095', '10000095', '42039901', 'Farmasi', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bumbung Serta Pendawaian Semula Di Unit Farmasi, Klinik Kesihatan Kuala Ketil Serta Kerja-kerja Berkaitan ', '1. Menanggal keseluruhan bumbung termasuk kerangka bangunan farmasi sedia ada dan penggantian bumbung baru.\n2. Menanggal keseluruhan siling dan penggantian siling baru.\n3.  Pendawaian semula sistem elektrik bangunan farmasi termasuk talian internet dan telefon\n4. Penggantian alat penyaman udara yang berusia lebih 10 tahun\n5. Mengecat dinding luar dan dalam. (Disarankan cat semula kerana melibatkan kerja membuka bumbung)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000096', '10000096', '42039901', 'Kesihatan Awam ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-Kerja Naik Taraf Bangunan Unit Keselamatan Dan Kualiti Makanan, Pejabat Kesihatan Daerah Kubang Pasu Serta Kerja-kerja Berkaitan', '1.Kerja-kerja awalan\n2.Kerja-kerja menanggalkan keseluruhan bumbung termasuk kerangka bangunan sedia ada dan penggantian bumbung baru\n3.Kerja-kerja menanggalkan siling sedia ada dan penggantian siling baru\n4.Kerja-kerja pendawaian semula elektrik bangunan termasik talian telefon dan internet.\n5.Kerja-kerja arkitek termasuk mengecat kerana berusia lebih 10 tahun. (Disarankan untuk mengecat semula kerana melibatkan kerja membuka bumbung).\n6.Rawatan anai-anai\n7.Kerja-kerja sistem perparitan\n8.Kerja-kerja luar jangka', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000097', '10000097', '42039901', 'Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Membina Kabin Tambahan Untuk Makmal Di Klinik Pergigian Ayer Hitam Serta Kerja-kerja Berkaitan', 'Kerja-kerja pembinaan termasuk\n1. Kerja-kerja awam\n2. Kerja-Kerja pintu dan tingkap\n3. Kerja-kerja mengecat\n4.Kerja-kerja kabinet dan sinki\n5. Kerja-kerja elektrik dan mekanikal (LAN dan telefon)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000098', '10000098', '42039901', 'Perubatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Unit Kecemasan Dan Trauma Dan Lain-lain Kerja Berkaitan Di Hospital Jitra', 'Menaiktaraf Unit Kecemasan dan Trauma di Hospital Jitra Dan lain-lain kerja berkaitan \n1.Kerja-kerja Awalan                                                        \nKerja-kerja mengubah medical air, vacum dan manhole ke kawasan yang telah ditetapkan mengikut layout baru yang dipersetujui lengkap bersama perpaipan.                                                       \n2.Kerja-kerja membersihkan kawasan pembinaan  termasuk meroboh, merata, mengetuk dinding sediada dan melevel lantai ke aras yang telah dipersetujui.                                              \n3.Kerja-kerja pembinaan asas jenis pad footing atau setara  bagi menerima struktur bangunan tambahan.                                                                 \n4. Pembinaan struktur bangunan lantai, rasuk bawah tiang.                                                                                     \n5. Pembinaan dinding bata lengkap dengan plastering.                                                    \n6. pembinaan rasuk Bumbung lengkap bersama kerangka bumbung jenis metal  lengkap  dengan roof tile dan papan cantik serta siling.                                              \n7. Kerja-kerja pintu,tingkap dan grill lengkap dengan aksesori yang bersesuaian\n8. kerja-kerja pendawaian elektrik dan mekanikal lengkap dengan fiting termasuk soket, suis, isolator, lampu, kipas dan penghawa dingin.                                            \n9.  Kerja-kerja perpaipan paip sanitari dan paip air bersih  lengkap dengan fitting.Termasuk membuat manhole baru bagi tandas                                                            \n10. Perpaipan gas perubatan lengkap dengan bed head panel bagi kegunaan pesakit                                                         \n11. Kerja-kerja mengecat, memasang kabinet tetap, dan railing screen.  \n12.Kerja-kerja pembinaan kaunter triage    ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000099', '10000099', '42039901', 'Kesihatan Awam ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Klinik Desa Sungai Limau, Baling Kepada Klinik Kesihatan Jenis 7 Serta Kerja-kerja Berkaitan', 'Naik taraf Klinik Desa Sungai Limau ini meliputi : \n1. Penambahan ruang untuk wujudkan Unit Kecemasan. \n2. Penambahan ruang untuk wujudkan Ruang Menunggu Farmasi \n3. Ubah suai kuarters untuk dijadikan Perkhidmatan Klinik Ibu Anak \n4. Kerja-kerja tambahan pendawaian elektrikal dan sistem perpaipan untuk ruang-ruang tambahan. \n5. Ubahsuai dalaman klinik sedia ada untuk dijadikan Unit Pesakit Luar, Unit Farmasi dan Unit Makmal. \n6. Kerja-kerja penambakan tanah dan kerja berkaitan untuk pembesaran tapak meletak kenderaan pesakit dan staf. \n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000100', '10000100', '42039901', 'Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bangunan Pusat Promosi Kesihatan Pergigian Komuniti Kota Setar Serta Kerja-kerja Berkaitan  ', 'Pendawaian elektrikal di keseluruhan bangunan.\nKerja-kerja menaik taraf  bangunan mengikut fungsi bilik.\n1. Ruang Kospen\n2. Pejabat Pentadbiran\n3. Pantri\n4. Bilik Server\n5. Bilik Latihan\n6. Bilik Simpanan Domestik\n7. Bilik Simpanan Bahan Promosi\n8. Bilik Exhibit CKAP\n9. Bilik Kaunseling\n10. Bilik Studio\n11. Bilik Digital\n12. Bilik Plak Pergigian\n13. Bilik Pendidikan Kesihatan Pergigian (PKP) \n14. Bilik Surgeri\n15. Bilik Kanak-kanak\n16. Galeri Pameran Kesihatan Pergigian\n17. Bilik Mesyuarat', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000101', '10000101', '42039901', 'Perubatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bilik Bersalin Di Hospital Baling Serta Kerja-kerja Berkaitan', '1. Tambahan binaan bangunan serta kerja renovasi ruang bagi menyediakan 7 bilik bersalin, 4 katil PAC, 1 ruang kaunter jururawat dan 1 bilik resusitasi bayi\n2. Pemasangan panel Gas Oksigen dan Vacuum bagi bilik bersalin (3 panel) dan PAC (1 panel)\n3. Pemasangan 1 panel Gas Oksigen , Vacuum dan Medical Air di bilik resusitasi bayi\n4. Pemasangan paip dan saliran disetiap bilik\n5. Pemasangan dinding dan pintu di antara laluan Wad O&g, dewan Bersalin dan PAC\n6. Kerja-kerja pendawaian elektrik, pemasangan aircond dan sambungan internet\n7. Laluan bersimen dari Unit Kecemasan dan Trauma ke Wad O&G\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000102', null, '42039901', 'Kesihatan Awam', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bangunan Raflesia ILKKM Untuk Dijadikan Kompleks Kesihatan Daerah Kulim Serta Kerja-kerja Berkaitan (Fasa 2)', 'Kerja-kerja ubah suai asrama untuk dijadikan\npejabat. \n1. Unit Pasukan Sekolah / Unit Kenderaan akan ditempatkan dibangunan raflesia\n2.Ketua-ketua unit akan dipusatkan  setempat  di bangunan  raflesia dengan menaik taraf bilik-bilik asrama\n3.Ruang pembasuhan akan dinaik taraf diadikan surau lelaki dan perempuan\n4. Tandas sedia ada di tingkat bawah dan 1 akan dinaik taraf  kepada tandas lelaki ,perempuan dan OKU\n5. Mewujudkan tempat letak kenderaan di bahagian belakang bangunan raflesia bagi kegunaan kakitangan dan pengunjung\n6.Penyelenggaraan sistem kumbahan dan lain-lain bagi memastikan sistem bangunan berfungsi dengan baik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000103', '10000103', '42039901', 'Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bangunan Klinik Pergigian Kulim Dan Pejabat Kesihatan Pergigian Kulim Serta Kerja-kerja Berkaitan', '1. Kerja-kerja membaiki dan mengganti bumbung dan kekuda kayu yang retak, reput dan rosak serta lain-lain kerja berkaitan mengikut arahan pegawai penjaga di belakang pejabat.\n2. Kerja-kerja elektrikal untuk Fasa 2 untuk bangunan baru PKPD Kulim dan penambahan kerja elektrikal untuk 3 bilik rawatan dan 1 bilik steril\n3. Membuat parkir depan pejabat bagi staff dan kerja-kerja berkaitan.\n4. Pembinaan laluan jalan kaki berbumbung  ke Pejabat dari KP Kulim dan kerja-kerja berkaitan.\n5. Naik Taraf ruang pejabat lama kepada bilik rawatan sebanyak 3 buah dan bilik steril untuk kegunaan pakar dan membina stor untuk kegunaan 2 kepakaran\n6.Kerja-kerja membekal kelengkapan perabot untuk Bilik Mesyuarat PKPD Kulim/Bandar Bahru yang baru bagi penggunaan bilik tersebut', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000104', '10000104', '42039901', 'Perubatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Wad Hospital Pendang Serta Kerja-kerja Berkaitan ', 'Kerja naik taraf tingkap wad lelaki, wad perempuan,  O&G, dan wad pediatrik .', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000105', '10000105', '42039901', 'Kesihatan Awam', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bangunan Di Klinik Kesihatan Napoh Serta Kerja-kerja Berkaitan ', '1.Kerja-kerja penambahan baru Ruang Jabatan Pesakit Luar  (OPD) dan Ruang Kecemasan termasuk kerja-kerja awalan penyediaan tapak.\n2.Kerja-kerja awam melibatkan bumbung dan siling baru.\n3.Kerja-kerja pendawaian elektrik baru bangunan termasuk talian telefon dan internet.\n4.Kerja-kerja mekanikal bagi pemasangan alat penghawa dingin baru di ruang baru.\n5.Kerja-kerja sistem pembentungan tangki najis bagi tandas baru.\n6.Rawatan anai-anai\n7.Kerja-kerja sistem perparitan baru\n8.Penyediaan ruang baru bagi Sudut ILI\n9.Rawatan anai-anai                                                                                                                                                                                                                                                                                                                                                           \n10.Kerja-kerja luar jangka                                                                                                                                                                                       ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000106', '10000106', '42039901', 'Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Ubah Suai Di Bilik Pensterilan, Unit Pakar Periodontik, Klinik Pakar Pergigian Kota Setar Serta Kerja Berkaitan', '1.Kerja kerja meroboh semua countertop dan kabinet bawah sedia ada serta jubin dinding di bilik pensterilan \n2.Kerja kerja membina countertop yang baru dengan kabinet berpintu di bahagian bawah  dengan dua singki  (double -sink) jenis seamless (Gred Perubatan)\n3.Kerja-kerja membekal dan memasang lapisan atas countertop  (Granite / Quartzzite) serta skirting dan kaki kabinet \n4.Kerja-kerja membekal dan memasang jubin dinding\n5. Kerja-kerja membinan dinding pemisah beserta pintu gelongsor (sliding) bagi mengasingkan ruang kotor dan bersih serta tingkap serahan peralatan \n6. Kerja kerja membina kabinet build-in 4 pintu dan bertingkat (pintu kaca separuh) bagi penyimpanan peralatan yang steril. \n5. Kerja kerja pendawaian semula dan pemasangan soket yang boleh menampung mesin autoklaf (15 Amp) serta soket tambahan yang lain \n6. Kerja memasang kabinet gantung 4 pintu di dalam bilik rawatan (bilik rawatan 7,8,9 dan 10)\n7. Kerja kerja mengecat semula dinding di bilik pensterilan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000107', '10000107', '42039901', 'Perubatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Ruang Untuk Dijadikan Klinik FNAC Dan Pusat Pengambilan Darah Klinik MOPD Di Hospital Sultanah Bahiyah Serta Kerja-kerja Berkaitan ', '1. Penambahan ruang bagi pendaftaran, order specimen dan pengambilan darah\n2. Penambahan ruang menunggu\n3. Pemasangan dinding bagi menghadang di bahagian tepi bangunan\n4. Membuat lapisan lantai untuk pemasangan vinyl\n5. Membuat pemasangan DB baru, wiring dan pendingin hawa\n6. Membuat pemasangan sistem perpaipan baru dan singki\n7. Pembinaan bilik rawatan bagi pengambilan specimen FNAC', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000108', '10000108', '42039901', 'Kesihatan Awam ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bangunan Unit Vektor Di Teroi Serta Kerja-kerja Berkaitan', '1.Menaik taraf dinding pejabat dari kayu ke struktur bata.\n2.Menggantikan kekuda bumbung dan bumbung kepada jenis besi (C Channel) dan Metal Deck.\n3.Menggantikan tingkap \n4.Kerja-kerja longkang \n5.Papan tanda\n6.Pendingin hawa\n ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000109', '10000109', '42039901', 'Kesihatan Awam ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Membina Kabin Dan Naik Taraf Bangunan Kuaters Dan Pejabat Vektor Untuk Dijadikan Pejabat Inspektorat Berpusat Dan Pejabat Pintu Masuk Antarabangsa (PMA) Langkawi Serta Kerja-kerja Berkaitan', '1. Meratakan tanah (cut & fill) dan membuang pokok serta kerja-\nkerja berkaitan. Rawatan anai-anai pada tapak baru dan\nbangunan sediada.\n2. Membekal dan memasang kabin serta mengubahsai ruangan\nbilik/partition bagi pembinaan ruang pejabat unit-unit terlibat\ntermasuk, ikatan bata pada dinding terlibat, memasang pintu,\ntingkap dan grill.\n3. Pembinaan struktur bumbung dan bumbung jenis metaldeck\nbagi kawasan terlibat\n4. Kerja-kerja perpaipan menggunakan paip jenis HDPE,\npemasangan sinki, tandas dan tangki air berpusat.\n5. Mengecat keseluruhan kawasan bangunan\n6. Pendawaian semula soket dan sistem elektrikal yang terjejas\nterutama pada bangunan sediada dan naiktaraf pendawaian\nbaru pada kawasan baru.\n7. Membuat penyusunan semula aliran rain gutter down pipe di\nbahagian bumbung kawasan terjejas.\n8. Kerja-kerja pemindahan dan pemasangan semula kesemua\npenghawa dingin.\n9. Kerja-kerja pemindahan dan pemasangan semula workstation\ndan perabot-perabot terlibat.\n10. Pembinaan tangki septic berkapasiti 10PE dan kerja-kerja\nberkaitan\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000110', '10000110', '42039901', 'Farmasi ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KEDAH', 'Kerja-kerja Naik Taraf Bangunan Untuk Dijadikan Farmasi Serta Kerja-kerja Berkaitan Di Hospital Sik ', '1. Ubah suai farmasi pesakit dalam untuk dijadikan bilik kaunseling\n2. Penambahan ruang untuk mewujudkan ruang farmasi kecemasan yang tertutup, ruang substor farmasi dan  farmasi pesakit dalam (44\'x50\')\n3. Penambahan bangunan untuk stor ubat, Farmasi Logistik (33\'x30\')\n4. Kerja -kerja elektrikal dan mekanikal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000111', '10000111', '42049901', 'Makmal Keselamatan Dan Kualiti Makanan Pulau Pinang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Makmal Mikrobiologi Dan Lain-lain Kerja Berkaitan Di MKKM, Negeri Pulau Pinang', '1. Menukar bench sedia ada yang telah rosak dan berkarat.  \nTermasuk kerja-kerja piping gas, elektrik dan air dibench terlibat.\n2. Menukar dinding gypsum board yang telah rosak kepada cement board\n3. Menukar grill tingkap sedia ada dibahagian dalam kepada grill dibahagian luar bangunan termasuk menggantikan 2 unit cermin  tingkap yang pecah\n4. Menukar siling gypsum kepada jenis PVC\n5. Membesarkan 2 unit pintu sedia ada', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '292500.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000112', '10000112', '42049901', 'Pejabat Kesihatan Pergigian Daerah Timur Laut', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja Pembaikan Paip Dan Kerja-kerja Berkaitan Di Klinik Pergigian Dan Klinik Kesihatan Sungai Dua, Daerah Timur Laut, Negeri Pulau Pinang', '\n1. Kerja pembaikan paip yang bocor di atas siling dan penyambungan paip jenis poly ke sinki bilik staff.                                                                     \n2. Kerja membuka dan menggantikan Gypsum Plaster board siling yang rosak di Klinik Pergigian dan Klinik Kesihatan\n3. Kerja pembaikan semula dinding yang rosak akibat kebocoran air.                        \n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '4500.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000113', '10000113', '42049901', 'Pejabat Kesihatan Daerah Seberang Perai Tenga', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Pembaikan Sistem Kumbahan Di Klinik Kesihatan Berapit Serta Lain-lain Kerja Berkaitan Di Negeri Pulau Pinang', '1. Menjalankan kerja - kerja memeriksa sistem mekanikal dan elektrik\n2. Kerja - kerja memeriksa raw sewage pump termasuk mengangkat, \nmembersih dari kotoran dan objek yang tersangkut pada komponen / impeller, serta pendawaian yang berkaitan.\n3.memeriksa struktur fizikal loji dan memastikanpersekitaran bersih termasuk pemotongan rumput.\n4. Menjalankan kerja penyelenggaraan keseluruhan paip pembentung termasuk saluran paip buangan pada bangunan klinik dan lurang serta memastikan sentiasa bebas dari tersumbat termasuk peralatan dan kelengkapan yang berkaitan.\n5.Menjalankan kerja - kerja penyelenggaraan dan pembersihan rain gutter termasuk melawas keseluruhan downpipe di klinik.\n6. Menukar keseluruhan penutup STP yang telah reput.\n7. membuat pemasangan pam yang telah rosak.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000114', '10000114', '42049901', 'Hospital Bukit Mertajam', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Gas Perubatan (Oksigen) Dan Wall Suction Di Wad 5 Dan Lain-lain Kerja Berkaitan Di Hospital Bukit Mertajam, Negeri Pulau Pinang', '1. Menaiktaraf saluran paip supaya oksigen dan wall suction\nboleh berfungsi untuk setiap katil.\n2. Ubah suai bilik rawatan agar lebih kemas dan teratur\n3. Kerja-kerja penggantian siling ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000115', '10000115', '42049901', 'Pejabat Kesihatan Pergigian Daerah Seberang Perai Selatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Kuarters Hospital Sungai Bakap Ke Klinik Pergigian Sungai Bakap Dan Lain-lain Kerja Berkaitan Di Negeri Pulau Pinang', '1. Kerja-kerja awalan\n2. Kerja-kerja ubahsuai di dalam kuarters untuk dijadikan klinik pergigian.\n3. Kerja-kerja Perpaipan dan pendawaian\n4. Kerja-kerja pemagaran semula dan membuat jalan.\n5. Kerja-kerja pemindahan kerusi pergigian dan barang-barang yang lain dari Klinik Pergigian Hosp Sg bakap ke Klinik Pergigian Sungai Bakap.\n6. lain-lain kerja berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '850000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000116', '10000116', '42049901', 'Pejabat Kesihatan Daerah Seberang Perai Utara', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Naik Taraf Tandas Klinik Dan Membaiki Bumbung Serta Lain-lain Kerja Yang Berkaitan Di Klinik Kesihatan Sungai Dua, Daerah Seberang Perai Utara, Negeri Pulau Pinang', '1.Kerja-Kerja Pembaikan Pintu Beserta Frame.\n2.Kerja-Kerja Meninggikan Lantai Tandas\n3.Kerja-Kerja Menukar Jenis Tandas\n4. Kerja-Kerja Memasang Jubin Lantai Baru.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000117', '10000117', '42049901', 'Hospital Kepala Batas', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Soket Tambahan Bagi Semua Unit Serta Lain-lain Kerja Berkaitan Di Hospital Kepala Batas, Negeri Pulau Pinang', 'Penambahan soket di semua ke unit secara berperingkat.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000118', '10000118', '42049901', 'Pejabat Kesihatan Daerah Barat Daya', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Dan Membaik Pulih Bangunan Dan Infrastuktur Di Unit Bakas Pejabat Kesihatan Daerah Barat Daya, Negeri Pulau Pinang', '1. Kerja-kerja menukarganti bumbung dan siling serta lain kerja yang berkaitan.\n2. Menggantikan pendawaian elektrik yang sedia ada yang telah melebihi 10 tahun.\n3.Menaiktaraf dan membaikpulih tandas dan sistem kumbahan sedia ada.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000119', '10000119', '42049901', 'Hospital Seberang Jaya', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Lantai Vinyl Di Tandas Wad 9 Dan Wad Bersalin Serta Kerja-kerja Lain Yang Berkaitan Di Hospital Seberang Jaya, Negeri Pulau Pinang', '\n\nKerja-kerja ubah suai termasuk skop memecah  dinding, baik pulih lantai dan sistem water proofing serta penggantian aksesori keperluan peralatan tandas seperti toilet bowl,sinki dan shower.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000120', '10000120', '42049901', 'Hospital Sungai Bakap', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Naik Taraf Unit Haemodialisis Dijadikan Pusat Nefrologi Seberang Perai Selatan Dan Lain-lain Kerja Berkaitan Di Hospital Sungai Bakap', '1. Meroboh dan menanggal keluar dinding sedia ada dan membaiki semula permukaan sedia ada\n2. Mengecat luar/dalamKerja  kerja memasang penghawa dingin dan kerja  kerja berkaitan\n3. Mengubahsuai DB Essential dan normal sedia ad ( Penambahan Sub DB ,MCCB dan MCB baru\n4. Kerja pendawaian control panel aircond, telefon, kipas dan kerja- kerja lain yang berkaitan.\n5. Lain  lain kerja berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000121', '10000121', '42049901', 'Hospital Pulau Pinang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Naik Taraf Bilik Daftar Masuk (BDM) Serta Lain-lain Kerja Berkaitan Di Hospital Pulau Pinang, Negeri Pulau Pinang', '1. Mengubah suai susun atur BDM dan laluan ke Jabatan Kecemasan;\n2. Meroboh ruang kaunter sedia ada;\n3. Membina ruang kaunter baharu:\n4. Membina laluan keluar baharu dan membekal kaunter baharu;\n5. Melakukan kerja-kerja pendawaian semula lampu, soket, ICT, access door system.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000122', '10000122', '42049901', 'Pejabat Kesihatan Daerah Timur Laut', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Farmasi Serta Lain-lain Kerja Berkaitan Di Klinik Kesihatan Air Itam, Negeri Pulau Pinang', '1. Kerja-kerja pengubahsuaian menaiktaraf ruang operasi farmasi klinik dan unit metahdone.\n2. Kerja-kerja pengubahsuaian menaiktaraf ruang pemeriksaan saringan OPD Klinik\n3. Kerja-kerja menaiktaraf dan pengubahsuaian  sistem perpaipan / sistem ratikulasi serta lain-lain kerja berkaitan\n4. Kerja-kerja Menaiktaraf Pendawaian Elektrik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '650000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000123', '10000123', '42049901', 'Pejabat Kesihatan Daerah Seberang Perai Selatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Pembaikan Septic Tank Bagi Kawasan Klinik Desa Tasek Dan Lain-lain Kerja Berkaitan di Negeri Pulau Pinang', '1. Kerja-kerja menaik taraf kapasiti septic tank.\n2. Kerja-kerja pendawaian baharu ke Rumah Pam STP.\n3. Kerja-kerja menaik taraf pam kumbahan di Rumah Pam STP.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000124', '10000124', '42049901', 'Pejabat Kesihatan Daerah Barat Daya', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Pembaikan Pendawaian Elektrik Dan Kalibrasi Panel MSB Serta Lain-lain Kerja Yang Berkaitan Di Unit Kawalan Penyakit Bawaan Vektor Bayan Lepas, Negeri Pulau Pinang', '1. Pembaikan pendawaian elektrik dan kalibrasi panel MSB', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000125', '10000125', '42049901', 'Hospital Pulau Pinang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Naik Taraf Dan Ubah Suai Bilik Acute Pain Service (APS) Kepada Bilik Suture Serta Lain-Lain Kerja Berkaitan Di Hospital Pulau Pinang, Negeri Pulau Pinang', '1. Kerja-kerja penanggalan/ pecah dinding/ barangan yang tidak diperlukan;\n2. Kerja-kerja pecah dinding & pintu rintangan api;\n3. Kerja-kerja pemasangan kabinet built in- full height & kick step;\n4. Kerja - kerja mengecat;\n5. Kerja-kerja pemasangan soket alur keluar;\n6. Kerja-kerja pemasangan pendingin hawa & temperature monitor.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000126', '10000126', '42049901', 'Pejabat Kesihatan Daerah Seberang Perai Selatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Menaik Taraf Membina Ruang Untuk Stor Farmasi Di Klinik Kesihatan Valdor Dan Lan-lain Kerja Berkaitan di Negeri Pulau Pinang', '1. Kerja-kerja pembersihan tapak .     \n2. Kerja-kerja penyediaan tapak.  \n3. Kerja-kerja pendawaian elektrik.\n4. Kerja-kerja pemasangan aircond.\n5. Kerja-kerja talian perhubungan (Internet/ ict/ telefon)\n6. Kerja-kerja mengecat .', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000127', '10000127', '42049901', 'Cawangan Senggara Fasiliti Bangunan (JKNPP)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PULAU PINANG', 'Kerja-kerja Naik Taraf Bumbung Tingkat Atas Dan Kerja-kerja Lain Berkaitan Di Pejabat Kesihatan Daerah Seberang Perai Selatan, Negeri Pulau Pinang', '1. Kerja-kerja awam \n                                                  \na) Kerja-kerja menukar kerangka bumbung dan penutup bumbung baru                                                                      \nb) Kerja-kerja menukar siling baru\n\n2. Kerja-kerja elektrik                                                   \na) Pendawaian semula elektrik\n\n3. Kerja-kerja mekanikal                                                        \na) Kerja-kerja menukar semua unit penghawa dingin yang baru  \n                                                                                                                        \n4.  Kerja-kerja talian Telefon                                        \na) Kerja-kerja sistem perhubungan talian telefon\n                                                                                            \n5. Kerja-kerja talian Internet ICT                                                                 \na) Kerja-kerja sistem perhubungan talian internet ICT \n   \n6) Kerja-kerja mengecat bangunan PKDSPS', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '1153000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000128', '10000128', '42059901', 'Hospital/ JKN ', '1002', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Naik Taraf Ruang Menunggu Pelawat/Pesakit Berserta Naik Taraf Kaunter Hasil Dan Lain-lain Kerja Berkaitan Di Hospital Teluk Intan', 'Kerja-Kerja Naiktaraf Ruang Menunggu Pelawat/Pesakit Berserta Naiktaraf Kaunter Hasil Dan Lain-Lain Kerja Berkaitan Di Hospital Teluk Intan', null, '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000129', '10000129', '42059901', 'JKN', '1002', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja Naik Taraf Dan Ubah Suai Wad Materniti Lama Kepada Wad Onkologi, Hospital Raja Permaisuri Bainun, Ipoh Perak', '1.Mengubahsuai 2 ruangan tandas sedia ada bagi memuatkan sebuah ruangan khas bagi pesakit lelaki dan sebuah lagi ruangan khas bagi pesakit perempuan.  \n 2.Menambah komponan-komponan elektrikal bagi mencukupi keperluan fasiliti merangkumi punca mata kuasa, mata kipas, mata lampu bagi 20 katil pesakit yang akan dimuatkan disamping pemasangan bekalan rangkaian internet.                                                      3.Menambah bilangan terminal unit bagi gas perubatan merangkumi 20 unit gas oksigen dan 4 unit gas termampal termasuk aksesori berkaitan.', null, '280000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000130', '10000130', '42059901', 'Hospital Taiping', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Menaik Taraf Sistem Bekalan Gas Perubatan Jabatan Kecemasan & Trauma, Hospital Taiping', '1. Sambungan sistem perpaipan gas perubatan dari sistem sedia ada di Blok A.\n2. Naiktaraf sistem Bedhead Panel untuk sistem gas perubatan baru.\n3. Kerja-kerja elektrikal yang berkaitan.\n4. Lain-lain kerja yang berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000131', '10000131', '42059901', 'CSFB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Menaik Taraf (Wad 6B) Dua Kubikel Perempuan Menjadi Neuro Acute Kubikel Dengan Jumlah Katil Sebanyak 11 Katil.\n(6B @ HDW) Di Hospital Raja Permaisuri Bainun, Ipoh', '1.Memasang oksigen port di dinding untuk kegunaan  ventilator dan oksigen biasa untuk pesakit di wad.\n2.Memasang vacuum  di dinding  untuk suction pesakit.\n3.Memasang plug untuk kegunaan peralatan elektrik seperti monitor, syringe  pump, DVT pump dan sebagainya.\n4.Memasang 8 unit aircond (split unit) di dalam Neuro HDW.\n5.Memasang port talian telefon baru dan internet.\n6.Memasang attached cabinet untuk menyimpan  peralatan-peralatan di wad Neuro HDW.\n7.Memasang sinki untuk kegunaan staf agar mengamalkan hand hygiene setiap masa  dan  untuk  kegunaan  membasuh  peralatan  seperti  set  feeding, collar set,set-set steril dan sebagainya.                           ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '475000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000132', '10000132', '42059901', 'Sebutharga', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', ' Naik Taraf Klinik Pakar Kepada Unit X-Ray Utama, Hospital Batu Gajah', '1. Membuka dinding, siling, kemasan lantai, pintu, tingkap dan lain-lain  sediada yang terlibat bagi ruang yang hendak digunakan.\n2. Membina laluan berbumbung dari Klinik Pakar ke Bangunan Kecemasan untuk laluan pesakit.\n3. Membina kaunter baharu untuk unit hasil dan pendaftaran.\n4. Membina dinding pembahagi ruang Bilik X-Ray, changing Room, Tandas, Kaunter dan lain-lain (Bilik X-Ray Barium Plaster).\n5. Membina struktur Besi untuk penyokong Mesin X-Ray.\n6. memindahkan Mesin X-Ray sediada di Unit X-Ray Wad 2 ke Bilik X-Ray Baharu.\n7. Mengasingkan bekalan elektrik dan pepasangan untuk Bilik X-Ray Baharu.\n8. Menyediakan bekalan elektrik untuk Mesin X-Ray Baharu.\n9. Memasang penghawa dingin jenis Split Unit untuk Bilik X-Ray Baharu dan Kaunter Hasil/Pendaftaran', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000133', '10000133', '42059901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Pembaikan Dan Naik Taraf Bangunan Pentadbiran Pejabat Kesihatan Daerah Batang Padang, Perak', '1. Kerja-kerja menggantikan keseluruhan bumbung bangunan dengan bumbung jenis metal deck (anggaran 800 meter persegi).\n 2. Menggantikan papan siling 4\'x2\' yang baru dan siling wire baru.\n3. Membaiki dinding dan tiang retak serta kesan mendapan tanah\n4. Kerja-kerja penggantian longkang dan apron yang rosak.\n5. Kerja-kerja pencucian bumbung rata serta kerja-kerja melepa lapisan kalis air jenis cementitious 3mm termasuk merender lantai pada permukaan akhir 2 inci.                                                                     \n6. Kerja penggantian palong dan saluran air hujan.                                                            \n7. Kerja-kerja memecahkan lantai sedia ada dan membuat lantai baru.\n 8. Kerja-kerja penggantian kemasan lantai yang rosak dengan jenis jubin yang sama atau seakan dengannya.\n 9. Membuat saluran keluar air buangan sinki yang betul.\n10. Kerja-kerja mengecat bangunan.\n11. Kerja-kerja mengecat semula pintu yang terjejas.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '496000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000134', '10000134', '42059901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Pembaikan Dan Naik Taraf Bangunan Pentadbiran Pejabat Kesihatan Daerah Kuala Kangsar, Perak', '1. Membuat pendawaian semula keseluruhan bangunan termasuk bilik mesyuarat PKD K. Kangsar. \n2. Kerja-kerja pembaikan bilik mesyuarat dan bilik gerakkan (penukaran bumbung jenis asbestos, penggantian syiling, pembaikan tandas dan ruang bekerja bagi bilik gerakan.)\n 3. Pembaikkan keseluruhan tandas yang terdapat di keseluruhan bangunan.\n 4. Penggantian sistem perpaipan termasuk tangki air yang telah uzur dan tidak pernah diselenggara dan tukar.\n 5. Pendawaian semula talian telefon termasuk PABX.\n 6. Mengecat semula keseluruhan bangunan yang telah lama dan uzur.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '490000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000135', '10000135', '42059901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Pembaikan Dan Naik Taraf Bangunan Pentadbiran Pejabat Kesihatan Daerah Bagan Datuk, Perak.', '1.Kerja- kerja pembaikan dan naiktaraf pendawaian elektrik.\n2.Kerja ubahsuai dan pembaikan yang melibatkan kerja sivil untuk dijadikan bangunan pejabat(partition,work station,Bilik Mesyuarat,Kaunter dan lain-lain yang berkitan.\n3.Kerja - kerja mekanikal termasuk sistem pendingin hawa dan penggera kebakaran.\n4.Kerja - kerja pendawaian bagi keperluan ICT', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '489000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000136', '10000136', '42059901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja NaikTaraf Makmal Standard Makanan Kepada Makmal Bioteknologi Makanan Serta Lain-lain Kerja Yang Berkaitan Di MKAI, Negeri Perak.', '1. Kerja memecahkan lantai konkrit sedia ada bagi membina lantai baharu dengan kemasan jenis epoxy.\n2. Kerja ubah suai dan naik taraf ruang kerja makmal mengikut susun atur baharu yang melibatkan pintu, dinding, tingkap, mengecat dan kerja lain yang berkaitan.\n3. Kerja penggantian siling.\n4. Kerja elektrikal bagi penambahan soket dan lampu.\n5. Kerja mekanikal bagi penambahan ducting dan diffuser bagi penghawa dingin.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '60000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000137', '10000137', '42059901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Kerja Naik Taraf Dan Pembaikan Ruang Kerja Klinik Kesihatan Kamunting, Daerah Larut Matang Dan Selama Serta Kerja Pembaikan Am Lain Yang Berkaitan.', '1.  Naik taraf dan ubahsuai ruang kerja Unit Farmasi.                                      \n2.  Naik taraf dan ubah suai ruang kerja di Bilik Pegawai Perubatan.\n3.  Kerja melibatkan sistem elektrik dan mekanikal.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '95000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000138', '10000138', '42059901', 'CSFB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Kerja- kerja Naik Taraf  Bangunan Klinik Pergigian Bota Kiri Dan Lain- lain Kerja Yang Berkaitan.', '1. Menaik taraf dan ubah suai ruang kerja di Klinik Pergigian Bota Kiri.                                                                                         \n2. Kerja-kerja membina struktur bumbung.                                                                                   \n3. Kerja-kerja memasang siling dalam luar.                                                                                  \n4. Kerja-kerja membina dinding bata dengan kemasan plaster.                                                                               \n5. Kerja-kerja lantai dengan kemasan mozek.                                                                                          \n6. Kerja-kerja perpaipan, mekanikal dan elektrik.                                                              \n7. Kerja-kerja mengecat bahagian dalam dan luar.                                                                                                        ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '360000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000139', '10000139', '42059901', 'PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Menaik Taraf Bilik Surgeri, Bilik Sterilisasi, Bilik-bilik Pentadbiran dan Bilik Stor Di  Jabatan Pakar  Pergigian Pediatrik, Hospital Raja Permaisuri Bainun, Ipoh, Perak Serta Kerja-kerja Lain Yang Berkaitan', 'Pecahkan dinding sediada, membina dinding dan bilik baru, pendawaian elektrik, pemasangan soket, pemasangan talian telefon, pemasangan talian internet, pemasangan lampu, pemasangan penghawa dingin, dan lain-lain perkara yang berkaitan untuk ruangan seperti di bawah: \n1. Menaik taraf Bilik Sterilisasi\n2. Mewujudkan Bilik Pakar, Bilik Pegawai dan Bilik \nJuruterapi Pergigian / Pejabat\n3. Mewujudkan Bilik Recovery\n4. Mewujudkan Stor Bahan -Bahan Pergigian\n5. Mengubahsuai Pantry Anggota\n6. Menaik taraf tandas dan Bilik Penyusuan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '380000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000140', '10000140', '42059901', 'CSFB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Membaik Pulih Infrastruktur Pagar Dan Saliran Longkang Di Klinik Pergigian Pekan, Kuala Kangsar', '1. Membekal dan membina tembok 50 meter panjang x 300 mm tebal tembok bata\n2. Membekal dan menambak tanah import\n3. Kerja pemasangan longkang perimeter yang baru dengan binaan sump dan tampalan kemas spigot pada longkang sedia ada\n4. Pemasangan edge kerb pada longkang hadapan\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000141', '10000141', '42059901', 'EDGENTA', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Naik Taraf Bilik Sterilisasi,  Bilik X-Ray Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Pakar Pergigian Pediatrik, Hospital Taiping', '1. Menyediakan 1 bilik khas untuk sterilisasi peralatan pergigian yang berukuran 8x10 kaki di dalam ruang bilik rawatan.                                                                                                                                \n2. Menyediakan kabinet untuk penyimpanan peralatan pergigian di bilik sterilisasi.\n3. Menyediakan bilik x-ray dengan ketebalan dinding iaitu 18cm (termasuk batu bata dan barium plaster), bersamaan 1mm plumbum setara dan ketebalan pintu iaitu 4.1cm (termasuk 1mm lead sheet) bersamaan 1mm plumbum setara.\n4. Menyediakan rak kad rawatan yang berukuran 3\' x 8\' di kaunter\n5. Memasang lampu keluar kecemasan di bahagian atas pintu belakang klinik.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '97500.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000142', '10000142', '42059901', 'PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Pengubahsuaian Bilik Anggota Pergigian Kepada Bilik Pensterilan Dan Bilik Juruterapi Pergigian Di Klinik Pergigian Bagan Datuk dan Kerja-kerja Berkaitan', '1. Melibatkan kerja-kerja sivil, mengecat, elektrikal, pertukangan kayu dan perpaipan.\n1. Memecah dinding pembahagi Asal\n2. Mengecat bagi bahagian luar struktur konkrit / permukaan lepaan simen sediada 1 lapisan primer dan 2 lapisan cat wheathershield. \n3. Membekal dan memasang pintu gelangsar jenis kaca \n4. Membekal dan memasang tingkap casement jenis aluminium\n5. Membina table top binaan konkrit bertetulang dan dikemaskan dengan jubin jenis homogeneous serta memasang 1 Stainless Steel Deep Sink \n6. Membekal dan membina compressor room bersaiz 1000mm x 1000mm x 1000m\n7. Membekal dan memasang Copper Pipe 15mm  lengkap dengan joint, fittings mematuhi kaedah yang disyorkan \n8. Membekal dan memasang cabinet solid wood wall mounted\n9. Membekal dan memasang workstation L shaped, solid wood\n10. Membekal dan memasang sistem paip dari sinki, floor trap, gully trap atau tandas ke tangki septik\n11. Membuka, membekal, dan memasang 2 unit double LED fluorescent lamp\n12. Membuka, membekal, dan memasang 1 unit kipas dinding  berserta kerja-kerja pendawaian yang berkaitan (bilik pensterilan)\n13. Membekal, menghantar dan memasang satu unit exhaust fan\n14. Membekal dan memasang penghawa dingin split unit R32 1.0 H/P\n15. Membekal dan memasang mata lampu I/d suis kutub tunggal 13A', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '65000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000143', null, '42059901', 'Hospital Kampar', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Menukar Bumbung Asbestos Kepada Bumbung Yang Baru Di 2 Bangunan Unit Farmasi (Farmasi Pesakit Luar & Dalam Dan Bilik Galenikal) Hospital Kampar', '1. Membuka, meroboh dan membuang keluar kemasan bumbung sedia ada (asbestos) \n2. Mengganti struktur kerangka kayu yang telah rosak dan reput \n3. Membuka mana-mana siling asbestos (di bahagian dalam) yang telah kelihatan rosak dan reput \n4. Membekal dan memasang bumbung jenis \'metal deck with insulation\'', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '228600.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000144', '10000144', '42059901', 'Pejabat Kesihatan Daerah Larut, Matang & Selama', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Naik Taraf Unit Farmasi Logistik Kesihatan (UFLK) Pejabat Kesihatan Daerah Larut, Matang & Selama', 'Kerja membesarkan UFLK sedia ada.\n1. Kerja-kerja menyambung binaan baharu (stor ubat dan bukan ubat, membuka bumbung lama dan menganti bumbung baru, tandas staf, memasang siling gantung dan pelan yang diluluskan jurutera bertauliah\n2. Kerja-kerja memasang pendawaian di dalam bangunan, pendingin hawa, lampu, kipas, suis, soket outlet serta kerja-kerja berkaitan.\n3. Membekal dan memasang rak penyimpanan stok ubat', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000145', '10000145', '42059901', 'Bahagian Perkhidmatan Farmasi Perak', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Naik Taraf Bangunan Bahagian Perkhidmatan Farmasi Perak', 'A. Naik taraf bumbung di kawasan luar bilik mesyuarat utama\n1. Mengubah siling yang telah rosak \n2. Menukar awning kepada bumbung bagi mengekalkan struktur bangunan\n3. Menggantikan lampu baru bersekali plaster ceiling \n\nB. Naik taraf tandas (lelaki & perempuan)\n1. Merendahkan struktur tandas \n2. Membaiki saluran paip sedia ada (kebocoran) bagi tandas lelaki dan perempuan\n3. Memperbetulkan saluran paip yang berada di luar\n4. Mengubahsuai sinki tandas ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000146', '10000146', '42059901', 'Hospital Raja Permaisuri Bainun', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Mengubah Suai Ruangan Stor Tertutup Di Dalam Stor Farmasi Logistik Hospital Raja Permaisuri Bainun', 'Menyediakan ruangan yang tertutup di dalam Stor Penyimpanan Ubat. Projek ini amat diperlukan bagi penyimpanan ubat di bawah suhu kekal 25C 24 jam. Sementara naik taraf bumbung, pendawaian dan pendingin hawa berpusat masih dalam permohonan di bawah Projek RMK.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '37900.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000147', '10000147', '42059901', 'Pejabat Kesihatan Daerah Batang Padang', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Baik Pulih Kaunter Farmasi Klinik Kesihatan Sungkai', '1. Kerja-kerja membuka, membekal dan memasang cermin kaunter\n2. Kerja-kerja membekal dan memasang roller shutter\n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '19000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000148', '10000148', '42059901', 'Pejabat Kesihatan Daerah Kinta', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Naik Taraf Stor Ubat Klinik Kesihatan Jelapang', '1. Pemasangan heavy duty kabin berukuran 20\' x 10\'\n2. Pembinaan platform konkrit \n3. Pemasangan pendingin hawa 1.5HP x 2 unit dengan fungsi auto timer.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '42000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000149', '10000149', '42059901', 'Hospital Seri Manjung', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Naik Taraf Laluan Forklift Dan Memasang Awning Di Bangunan Stor PPE Farmasi Hospital Seri Manjung', 'A. Kerja-kerja membuat tapak slab konkrit laluan forklift berhadapan bangunan stor yang berukuran 20\' panjang x 25\' lebar dan 13\' panjang x 17\' lebar.\n- i) Mengorek tapak simen lama sedalam 8 inci di setiap permukaan size yang ditetapkan\n- ii) Membuang sisa tanah dan simen lama ke luar site untuk kebersihan\n- iii) Menghampar batu crush run B pada keseluruhan tapak sedalam 4 inci ketebalan\n- iv) Menghampar BRC spec size A8 di setiap permukaan tapak pada keseluruhan\n- v) Manghampar serta merenda tapak dengan menggunakan simen konkrit ready mix gred G25 pada keseluruhan tapak\n- vi) Membuat piping gutter baru yang ditanam di dalam konkrit slab\n\nB. Membekal dan memasang awning di hadapan roller shutter yang berukuran 12\' lebar x 7\' panjang\n- i) Memasang frame kekuda berserta tiang support di dinding menggunakan besi hollow 2\" x 3\" (1.6mm) ketebalan\n- ii) Kekuda depan size hollow 1\" x 2\" (penggulung)\n- iii) Memasang atap metal deck Gred G28', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '35000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000150', '10000150', '42059901', 'Pejabat Kesihatan Daerah Kampar', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Kerja-kerja Pembaikan Dan Naik Taraf Stor Unit Farmasi, Klinik Kesihatan Kampar,  Pejabat Kesihatan Daerah Kampar', '1. Membina dinding batu bata ukuran 12 \'x 32\'.\n2. Memasang I unit roller shutter bermotor berukuran 8\'x 8\'.\n3. Membekal dan memasang siling plaster gantung dengan keluasan 763 k/p.\n3. Menaikan paras lantai dengan kemasan lantai jubin homogenius anti slip yang berkeluasan 763 k/p.\n4. Menutup longkang sediada di tapak sepanjang 82 kaki.\n5. Memindah 8 unit alat penghawan dingin (outdoor) termasuk tambahan copper piping dan pengisian gas.\n6. Menggantikan i unit roller shutter dengan pintu kayu berukuran 34\'x 82\'dengan jenang pintu besi keluli.\n7. Menutup ruang tingkap casement dengan chemboard seluas 188 k/p.\n8. Mengecat keseluruhan bangunan yang dibina bahagian luan dan dalam.\n9. Membina laluan masuk dengan jalan konkrit, menebang 3 pokok palm dan mengalih road kerb.\n10. Memasang 2 unit kipas siling serta kerja-kerja pendawaian.\n11. Memasang 2 unit kipas dinding serta kerja-kerja pendawaian.\n12. Pemasangan dan pendawaian 2 unit berkembar soket 13A untuk keperluan alat penghawan dingin.\n13. Pemasangan 2 unit lampu LED (gantung siling) dengan pendawaian eletrik.\n14. Pendawaian 2 unit soket alur keluar kuasa.\n15. Pemasangan 2 ruang kerja (work station). ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '49900.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000151', '10000151', '42059901', 'JKN', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'PERAK', 'Reka Bentuk Tangga keselamatan Dan Bina Baharu Tandas Serta Lain-lain Kerja Berkaitan Di Bangunan Pejabat Pengarah Jabatan Kesihatan Negeri (JKN) Perak', 'Kerja-kerja meroboh tandas sediada \nkerja rekabentuk tangga keselamatan dan bina baharu tandas mengikut tatacara jabatan warisan negara (JWN)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '600000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000152', '10000152', '42270000', 'Cawangan Senggara Fasiliti Bangunan (JKWPKL&P)', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Menaik Taraf Klinik Infeksi (Fever Center) Klinik Kesihatan Putrajaya Presint 18, Putrajaya', '1. Memindahkan Pendaftaran dan Farmasi Infeksi ke kawasan yang berhampiran dengan ruang menunggu Klinik Infeksi yang baharu.\n2. Menjadikan lot parkir kereta yang berhampiran kepada ruang menunggu.\n3. Menambah 2 lagi bilik pemeriksaan menjadikan 4 bilik pemeriksaan di Klinik Infeksi.\n4. Melakukan pengubahsuaian 2 bilik rawatan sedia ada di Pesakit Luar menjadi 1 bilik rawatan yang lebih besar. \n5. Menjadikan lot parkir motorsikal yang berhampiran kepada tempat menunggu berbumbung bagi pesakit yang disyaki dijangkit penyakit wabak.\n6. Mengadakan susur gajah di sepanjang koridor dari lobi utama di mana saringan Covid dilakukan sehinggan ke pintu masuk ruang menunggu Klinik Infeksi yang baharu.\n7. Membina tandas awam yang berhampiran dengan Klinik Infeksi yang baharu.\n8. Perolehan peralatan perubatan, bukan perubatan dan ICT', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)\nDetail : Kos Kelulusan adalah sebanyak RM1,496,720.00\nKeperluan Tahun 2024 : RM24,800.00\nKeperluan Tahun 2025 : RM1,471,920.00', '24800.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:27');
INSERT INTO `tblprojek` VALUES ('10000153', '10000153', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Pembaikan Komponen Sivil Serta Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Ibu Dan Anak Taman Pantai Indah', '1. Kerja pembaikan waterproofing  keseluruhan bahagian bumbung  dan dinding tandas klinik\n2. Kerja menanggal blower ducted aircond yang lama dan pembaikan keseluruhan ceiling plaster di (Aras Bawah, Aras 1 dan 2)\n3. Kerja ubah suai bagi perluasan ruang konsultasi bilik jururawat di Aras 1 dan 2\n4. Kerja pendawaian elektrik dan naik taraf sistem mekanikal.\n5. Kerja penggantian awning luar klinik.\n6. Kerja mengecat semula keseluruhan ruang dalaman dan luaran klinik.\n7. Penggantian papan tanda yang telah usang (DBKL) kepada papan tanda yang baharu ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:04');
INSERT INTO `tblprojek` VALUES ('10000154', '10000154', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Tandas Klinik Kesihatan Ibu & Anak Setapak Di Aras 1, Ubah Suai Tandas Pesakit Metadon Di Aras 2, Wisma Rampai Serta Kerja-kerja Lain Yang Berkaitan ', '1. Ubah suai sebahagian tandas sedia ada di KKIA di aras 1 kepada tandas mesra OKU. \n2. Ubah suai tandas sedia ada di aras 2 untuk kegunaan pesakit metadon.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:05');
INSERT INTO `tblprojek` VALUES ('10000155', '10000155', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Pemasangan Jeriji Keselamatan Di Bahagian Tingkap Dan Pintu Masuk Utama Serta Kerja-kerja Lain Yang Berkaitan Di Klinik Pergigian Setapak', '1. Kerja-kerja memasang jeriji keselamatan di semua tingkap yang mempunyai akses ke dalam klinik\n2. Kerja-kerja menggantikan pintu masuk utama klinik yang usang.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:06');
INSERT INTO `tblprojek` VALUES ('10000156', '10000156', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Meroboh Dan Membina Semula Garaj/Parkir Berbumbung Serta Kerja-kerja Lain Yang Berkaitan Untuk Klinik Pergigian Bergerak Di Klinik Pergigian Jinjang ', '1. Kerja meroboh dan membina semula garaj/parkir berbumbung yang menempatkan Klinik Pergigian Bergerak di tempat parkir sedia ada (berhampiran kawasan parkir awam)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:07');
INSERT INTO `tblprojek` VALUES ('10000157', '10000157', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Fever Center, Ruang Kecemasan Klinik Kesihatan Batu Muda Dan Sebahagian Ruang Kerja Klinik Pergigian Batu Muda Serta Kerja-kerja Lain Yang Berkaitan', '1. Membina bangunan separa kekal bagi menempatkan perkhidmatan fever centre lengkap dengan keperluan sistem mekanikal & elektrik.\n2. Menambah ruang kecemasan yang lebih kondusif. Kerja termasuk pendawaian eletrik (lampu & soket), pemasangan penghawa dingin dan exhaust fan.\n3. Pembaikan dan naik taraf Bilik Rekod, Ruang Kaunter, Bilik Rawatan Unit Pakar Periodontik Dan Makmal Di KP Batu Muda', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:07');
INSERT INTO `tblprojek` VALUES ('10000158', '10000158', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Tandas Pondok Pengawal Tempat Letak Kereta Serta Kerja-kerja Lain Yang Berkaitan Di Jabatan Kesihatan Wilayah Persekutuan Kuala Lumpur Dan Putrajaya', '1. Menaik taraf dan ubah suai ruang tandas di Pondok Pengawal tempat letak kereta\n2. Kerja-kerja mekanikal dan elektrik\n3. Pembaikan sistem perpaipan dan sistem sanitari', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:08');
INSERT INTO `tblprojek` VALUES ('10000159', '10000159', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Serta Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Ibu Dan Anak Taman Sri Sentosa ', '1. Naik taraf sistem bekalan elektrik utama\n2. Pendawaian semula untuk sistem M&E\n3. Penggantian distribution board\n4. Naik taraf sistem pengudaraan\n5. Naik taraf bilik-bilik rawatan dan ruang kerja klinik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:11');
INSERT INTO `tblprojek` VALUES ('10000160', '10000160', '42270000', 'HRC', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Menaik taraf Sistem Smoke Detector Di Sebahagian Kawasan Hospital Serta Kerja-kerja Lain Yang Berkaitan Di Hospital Rehabilitasi Cheras', '1. Kerja-Kerja Menaiktaraf Sistem Smoke Detector Yang Sedia Ada', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:12');
INSERT INTO `tblprojek` VALUES ('10000161', '10000161', '42270000', 'PK WP Putrajaya', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Pembaikan Sistem Kejuruteraan, Penggantian Bumbung, Penggantian Tempat Duduk Auditorium Serta Kerja-kerja Lain Yang Berkaitan Di Pejabat Kesihatan WP Putrajaya', '1. Kerja pembaikan sistem pencegah kebakaran termasuk penggantian smoke detector, modul, bateri dan memprogram fire alarm panel, pembaikan sistem exhaust fan, pembaikan sistem hose reel dan sprinkler.           \n2. Pembaikan sistem penghawa dingin berpusat termasuk kerja penggantian tranducer, flow switch penggantian 5 unit Chilled Water Fan Coil Unit, dan penggantian thermostat, pressure gauge dan glass thermometer pada chilled water pipe yang telah rosak.                                                  \n3. Penggantian 1 unit vertical pumpset untuk cold water system.                       \n4. Penggantian bateri , alternator dan servis set generator                     \n5. Pemasangan bumbung baru jenis metaldeck menggantikan bumbung kaca sedia ada dan kerja pendawaian  lampu di kawasan bumbung baru. \n6. Penggantian 20 unit tempat duduk yang rosak di auditorium', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:13');
INSERT INTO `tblprojek` VALUES ('10000162', '10000162', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Stor Vektor Blok E JKWPKL&P Dan Sistem Pendawaian Elektrik Serta Kerja-kerja Lain Yang Berkaitan Di Pejabat Kesihatan Lembah Pantai', '1. Kerja-kerja naik taraf dan pembaikan komponen sivil dan sistem M&E di stor vektor PKLP di Blok E JKWPKL.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:14');
INSERT INTO `tblprojek` VALUES ('10000163', '10000163', '42270000', 'Hospital Putrajaya', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Lantai Dan Kerja-kerja Lain Yang Berkaitan Di Dewan Bedah & Wad ICU Hospital Putrajaya', '\n1. Kerja mengaras semula permukaan lantai\n2. Kerja memasang lantai vinyl \n3. Kerja mengecat', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:14');
INSERT INTO `tblprojek` VALUES ('10000164', '10000164', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Kemasan Lantai Serta Kerja-kerja Lain Yang Berkaitan Di Cawangan Perkembangan Kesihatan Keluarga, JKWPKL&P', '1. Kerja penggantian kemasan lantai karpet sedia ada kepada kemasan lantai yang baharu.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:15');
INSERT INTO `tblprojek` VALUES ('10000165', '10000165', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Pembaikan, Ubah Suai Dan Naik Taraf Bangunan Suruhanjaya Perkhidmatan Awam (SPA) Untuk Dijadikan Ruang Pejabat Jabatan Kesihatan Wilayah Persekutuan Kuala Lumpur & Putrajaya', '1. Kerja-kerja naik taraf bangunan lama Suruhanjaya Perkhidmatan Awam (SPA) Untuk Dijadikan Ruang Pejabat Jabatan Kesihatan Wilayah Persekutuan Kuala Lumpur & Putrajaya', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '700000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:15');
INSERT INTO `tblprojek` VALUES ('10000166', '10000166', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Ubah Suai Dan Pembaikan Dapur Sihat Masyarakat, Jabatan Kesihatan WP Kuala Lumpur & Putrajaya Serta Kerja-kerja Lain Yang Berkaitan', '1. Penggantian kabinet dapur yang rosak dan reput.\n2. Penggantian jubin dinding dapur yang tercabut dan pecah\n3. Pemasangan pintu berkunci antara dapur dan stor\n4. Pembaikan paip dan sinki yang bocor.\n5. Penukaran karpet di bahagian dapur kepada lantai jenis \'vinyl\' atau yang setara', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:16');
INSERT INTO `tblprojek` VALUES ('10000167', '10000167', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Pembaikan Dan Naik Taraf Di Aras 1, 2 Dan 3 Blok C, Bahagian Kesihatan Pergigian JKWPKL Serta Kerja-kerja Lain Yang Berkaitan', '1. Membaik pulih dinding plywood yang rosak di semua aras Blok C.\n2. Kerja naik taraf bilik mesyuarat\n3. Kerja penggantian kemasan lantai permaidani sedia ada di bilik pegawai pergigian dan ruang kerja di aras 2  yang telah uzur dan berkulat.\n4. Kerja mengecat dinding dalaman di beberapa kawasan yang telah mendapat teguran daripada audit EKSA.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:17');
INSERT INTO `tblprojek` VALUES ('10000168', '10000168', '42270000', 'JKWPKL&P', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WPKL & PURAJAYA', 'Kerja-kerja Naik Taraf Makmal Vektor Negeri Di Aras 3 Blok A JKWPKL&P Serta Kerja-kerja Lain Yang Berkaitan', '1. Kerja ubahsuai ruang makmal sedia ada kepada ruang kerja\n2. Kerja pendawaian elektrik, LAN port dan naik taraf sistem mekanikal\n3. Penyusunan semula jaringan sistem perpaipan air dalaman', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-16 22:33:18');
