INSERT INTO `tblprojek` VALUES ('10000182', '10000182', '42069901', 'Kesihatan Awam', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Penggantian Keseluruhan Bumbung Jenis Asbestos Termasuk Kerangka Bumbung Di Blok Klinik Ibu Dan Anak Dan Bangunan Blok Klinik Pesakit Luar Yang Telah Rosak Dimakan Anai-Anai Dan Berisiko Kepada Kakitangan Dan Pesakit Di Klinik Kesihatan Jeram,', 'Kerja-kerja penggantian ini melibatkan skop kerja seperti berikut:                                                                 \n1. Penggantian bumbung jenis UPVC @ metal deck \n2. Penggantian keseluruhan kerangka siling dan siling (siling sedia ada jenis asbestos)\n3. Kerja-kerja pest control (anai-anai)\n4. Kerja-kerja mengecat bahagian yang rosak dimakan anai-anai\n5. Kerja-kerja pembaikan am\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '428080.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
