INSERT INTO `tblprojek` VALUES ('10000188', '10000188', '42069901', 'CKC, JKR', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Pembaikan Cerun Tanah Di Klinik Kesihatan Sungai Chua PKD Hulu Langat Serta Kerja-kerja Lain Yang Berkaitan\n', '1. Kerja-kerja pembaikan meliputi preliminary\n2. Pengukuhan cerun\n3. Naiktaraf sistem perparitan\n4. Kerja-kerja pemasangan pagar anticlimb', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000189', '10000189', '42069901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Pengubahsuaian Ruang Pejabat Bagi Penyewaan Pejabat Baru Pejabat Kesihatan Daerah Petaling Di Bangunan IDCC  Serta Kerja-kerja Lain Yang Berkaitan \n', '\n2. Kerja pendawaian baru/tambahan untuk soket\n3. Pendawaian aircond (kabel saiz  tidak kurang 6 mm & paip besi) Membekal & Pemasangan penghawa dingin\n4. Pendawaian IT (kabel saiz  tidak kurang 4 mm & Trungking), Pendawaian & Penyediaan port IT keseluruhan pejabat, membina Bilik Server underfloor cooling system dan Rack Relocation.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '120000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000190', '10000190', '42069901', 'PKPD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Pengubahsuaian Ruang Pejabat Bagi Penyewaan Pejabat Baru Pejabat Kesihatan Pergigian Daerah  Petaling Di Bangunan IDCC  Serta Kerja-kerja Lain Yang Berkaitan \n', 'Kerja-kerja pengubahsuaian asas seperti pemasangan internet 1gov termasuk server ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '30000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000191', '10000191', '42069901', 'HSIS', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Sistem Ventilasi Bagi Bilik Isolasi Dan Ruangan Airlock Unit ICU Hospital Sultan Idris Shah Serdang Serta Kerja-kerja Lain Yang Berkaitan', '1. Kerja-kerja memasang sistem ventilasi bagi Bilik Isolasi dan ruangan air-lock unit ICU\n2. Pemasangan HEPA Filter pada Air Handling Unit (AHU) sedia ada termasuk blower fan yang bersesuaian dan Ultraviolet (UV) Light.\n3. Kerja-kerja naik taraf sistem tekanan bilik baharu (Ante Room) khas untuk kawasan kotor setelah keluar dari Isolation Room.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000192', '10000192', '42069901', 'HBTG', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Penggantian Bumbung Dan Menaik Taraf Struktur Siling  di Wad 1, Hospital Banting Serta Kerja-kerja Lain Yang Berkaitan', '1. Pembekalan dan pemasangan UPVC Ridge Eco Roofing dengan ketebalan 2.00 mm (kelulusan JKR) \n2. Membaiki kerosakan bumbung timber batten \n3. Menanggal panel siling asbestos dan struktur penyokong sedia ada \n4. Pemasangan kerangka siling jenis gantung \n5. Pemasangan panel siling gantung jenis gypsum board \n6. Kerja-kerja elektrik  memasang semula conduit pendawaian elektrik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '498000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000193', '10000193', '42069901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Dan Baik Pulih di Klinik Kesihatan Hulu Kelang, Pejabat Kesihatan Daerah Gombak Serta Kerja-kerja Lain Yang Berkaitan', '1. Kerja-kerja pembinaan struktur bangunan merangkumi Unit Farmasi, Unit Makmal termasuk ruang menunggu\n2. Kerja-kerja elektrikal\n3. Kerja-kerja mekanikal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000194', '10000194', '42069901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Bangunan Klinik Kesihatan Dan Klinik Pergigian Kuala Selangor, Daerah Kuala Selangor Serta Kerja-kerja Lain Yang Berkaitan ', '1. Naiktaraf dan pembaikan sistem pendawaian elektrik. \n2. Naiktaraf laluan antara bangunan MCH dan Makmal (klinik kesihatan)\n3.Naiktaraf tandas pesakit termasuk perpaipan semula di klinik kesihatan dan klinik pergigian  \n4. Lain-lain pembaikan am di blok bangunan klinik dan blok bangunan pergigian\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000195', '10000195', '42069901', 'PKPD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Menaik Taraf  Bangunan Klinik Pergigian Telok Panglima Garang Bagi Menempatkan PKPD Kuala Langat Serta Kerja-kerja Berkaitan', '\n1. Kerja-kerja menaiktaraf bangunan untuk menempatkan Pejabat Kesihatan Pergigian Daerah Kuala Langat dan kerja-kerja yang berkaitan.   \n2. Kerja-kerja pengubahsuaian bilik di Klinik Pergigian\n3. Kerja-kerja elektrikal dan menaik taraf internet  \n4. Kerja-kerja perpaipan yang berkaitan.  \n                                                                                             ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '280000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000196', '10000196', '42069901', 'HSAS', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Bangunan Multi Disciplinary Ward Hospital Shah Alam Serta Kerja-kerja Lain Yang Berkaitan', '1. Naik taraf wad A1, wad A2, kaunter jururawat, bilik ketua jururawat dan wad B\n2. Kerja-kerja pemasangan exhaust fan\n3. Kerja-kerja elektrik termasuk pendawaian alat penghawa dingin, submain dan kerja-kerja berkaitan.\n4. Kerja-kerka pemasangan nurse call bell.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000197', '10000197', '42069901', 'HTAR', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Sistem Perparitan Di  HTAR Serta Kerja-kerja Lain Yang Berkaitan', '\n1. Reprofil Sistem Perparitan \n2. Pemasangan Flap Gate \n3. Pemasangan tambahan submersible pump \n4. Meningkatkan kapasiti OSD \n\n\n ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000198', '10000198', '42069901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja Naik Taraf Dan Pembaikan Sistem Perpaipan Dalaman Di Klinik Kesihatan Taman Medan PKD Petaling Serta Kerja-kerja Lain Yang Berkaitan', '1. Kerja membuka sistem perpaipan sedia ada termasuk tangki  \n2. Kerja penggantian sistem perpaipan dalaman baru termasuk tangki air \n3. Kerja penggantian pam penggalak \n4. Kerja penggantian panel pam \n5. Kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000199', '10000199', '42069901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Dan Penambahbaikan Infrastruktur Bangunan Di Klinik Kesihatan Rasa PKD Hulu Selangor Serta Kerja-kerja Lain Yang Berkaitan', '1. Kerja ubahsuai ruang bangunan untuk dijadikan ruang kerja bagi unit MCH, Unit JPL, Unit Rehabilitasi dan ruang menunggu pesakit  \n2. Kerja pendawaian semula sistem elektrik termasuk penggantian peti agihan  \n3. Kerja cat bangunan luar dan dalam \n4. Kerja pembaikan bumbung  \n5. Kerja pemasangan dan pembekalan penghawa dingin \n6. Kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '800000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000200', '10000200', '42069901', 'PKPD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja- kerja Naik Taraf Dan Pembaikan Bangunan Di Klinik Pergigian Taman Nirwana PKPD Hulu Langat Serta Kerja-kerja Lain Yang Berkaitan', '\n1. Pembaikan dan penggantian bumbung  termasuk  siling \n2. Pembaikan dan naiktaraf pendawaian elektrik\n3. Pembaikan sistem perpaipan\n4. Kerja-kerja mengecat dan pembaikan bangunan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000201', '10000201', '42069901', 'HSLYG', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja Menaik Taraf Jabatan Radiologi Hospital Selayang Serta Kerja-kerja Lain Yang Berkaitan', '1.Ubahsuai bilik ruangan kaunter yang sedia ada kepada kaunter yang bertutup (Enclose Kaunter) dan pejabat\n2. Menambah bilik persedian (prep room)\n3. Mengubahsuai bilik kualiti kepada bilik isolasi dengan mengantikan dengan tingkap lutsinar (kaca) sebagai dinding yang sedia ada dan mewujudkan negative pressure.\n4. Mengubah kedudukan ruang menunggu pesakit dalam kepada ruang menunggu pesakit CT\n5. Kerja-kerja mekanikal dan elektrikal\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '360000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000202', '10000202', '42069901', 'HSbG', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Discharge Lounge Hospital Sungai Buloh Serta Kerja-kerja Lain Yang Berkaitan', '1. Kerja-kerja pembersihan kawasan tapak dan penyiasatan tanah\n2. Kerja-kerja pembinaan bangunan  \n3. Kerja-kerja sistem kumbahan dan tandas\n4. Kerja-kerja mekanikal dan elektrikal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '402043.22', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000203', '10000203', '42069901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Stor Ubat  Farmasi Dan Klinik Pergigian  Di Klinik Kesihatan Ampang PKD Hulu Langat Serta Kerja-kerja Lain Yang Berkaitan', '1. Pembinaan struktur, kabin dan laluan berbumbung bagi tempat penyimpanan ubat\n2.Membuat pendawaian elektrikal bagi pemasangan lampu,plug point dan lain-lain \n3. Pemasangan  penyaman udara bagi ruangan terlibat \n4. Kerja kerja pembaikan bumbung Klinik Pergigian \n5. Lain lain kerja berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '110000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000204', '10000204', '42069901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-kerja Naik Taraf Dan Pembaikan Bangunan MCH Dan Rehabilitasi Di Klinik Kesihatan Kapar PKD Klang Serta Kerja-kerja Lain Yang Berkaitan', '\n\n1. Naiktaraf sistem elektrikal \n2. Membaiki kerosakan pada kemasan bangunan termasuk lain-lain kerja berkaitan\n3. Kerja-kerja mengecat  \n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000205', '10000205', '42069901', 'HTAJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Naik Taraf Bilik Unit Fisioterapi HTAJ  Sabak Bernam Serta Kerja-kerja Lain Yang Berkaitan', '1. Cadangan kerja-kerja melibatkan pembesaran ruang bangunan sedia ada ke kanan bangunan dengan tambahan kelusasan sebanyak 81.3 meter persegi.\n2. Kerja-kerja berkenaan melibatkan kerja menambak tanah bagi binaan lantai memandangkan keadaan tanah di HTAJ agak lembut.\n3. Kerja-kerja sambungan bumbung selari dengan bumbung sedia ada lengkap dengan kemasan siling gantung. \n4. Perluasan ruang akan mempunyai 3 ruang rawatan dengan binaan menggunakan material partiton gypsum board mampu memberi ruang selesa dan kondusif kepada pesakit dan petugas kesihatan.\n5. Kerja-kerja kemasan sesuai untuk ruang tambahan termasuk pemasangan 2 unit penghawa dingin dan pendawaian elektrik, menaik taraf kotak agihan, pemasangan lampu, kipas dan kerja-kerja lain yang berkaitan. ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000206', '10000206', '42069901', 'PKD ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja-Kerja Menaik Taraf Kuaters Kesihatan Jeram Kepada Klinik Pergigian Jeram Serta Kerja-kerja Lain Yang Berkaitan', '1. Kerja-kerja  baikpulih dan ubahsuai bangunan kuarters untuk ruang klinik pergigian (2 kerusi pergigian)\n2. Kerja-kerja extention untuk ruang menunggu, bilik sterilisasi, bilik x -ray, tandas\n3. Kerja-kerja elektrikal,mekanikal ,pempaipan dan pemasangan talian internet', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '358232.53', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000207', '10000207', '42069901', 'HKKB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SELANGOR', 'Kerja Penggantian Bumbung Di Kantin,Stor Farmasi,Makmal, Parkir Kenderaan Jabatan Di Hospital Kuala Kubu Bharu Serta Kerja-kerja Lain Yang Berkaitan', 'Kerja-kerja penggantian bumbung jenis asbestos dan zink yang berkarat kepada bumbung jenis metaldeckPUform', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
