INSERT INTO `tblprojek` VALUES ('10000209', '10000209', '42079901', 'JKN', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Pembaikan Bangunan Dan Sistem Elektrik Bagi Menyokong Pelaksanaan EMR Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Terachii', '1- Menanggal pendawaian dan kelengkapan elektrik sedia ada\n2- Kerja-kerja membekal, memasang pendawaian elektrik mengikut spesifikasi standard JKR secara pendawaian conduitpermukaan atau terbenam dengan menggunakan kabel PVK  l/d konduit / trunking keluli bergalvani (hot dipped) dan aksesori yang berkaitan termasuk kelengkapan elektrik.\n3- kerja-kerja membekal dan memasang Main Switch Board (MSB) dan Distribution Board (DB) mengikut spesifikasi standard JKR lengkap dengan surge protection device (SPD)\n4- Kerja-kerja pengujian termasuk pembumian elektrikal dan lain-lain.\n5- Bangunan - Naiktaraf dan pembaikan bangunan termasuk bumbung, siling, dinding, lantai dan intrastruktur\n6- Lain-lain kerja yang berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
