INSERT INTO `tblprojek` VALUES ('10000213', '10000213', '42079901', 'JKN', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Pendawaian Semula Elektrik Bagi Menyokong Pelaksanaan EMR Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Seri Menanti', '1- Menanggal pendawaian dan kelengkapan elektrik sedia ada\n2- Kerja-kerja membekal, memasang pendawaian elektrik mengikut spesifikasi standard JKR secara pendawaian conduit permukaan atau terbenam dengan menggunakan kabel PVK  l/d conduit / trunking keluli bergalvani (hot dipped) dan aksesori yang berkaitan termasuk kelengkapan elektrik.\n3- kerja-kerja membekal dan memasang Main Switch Board (MSB) dan Distribution Board (DB) mengikut spesifikasi standard JKR lengkap dengan surge protection device (SPD)\n4- Kerja-kerja pengujian termasuk pembumian elektrikal dan lain-lain.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '170000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000214', '10000214', '42079901', 'BPKj', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Pembaikan Bangunan Dan Sistem Elektrik Bagi Menyokong Pelaksanaan EMR Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Pertang', '1- Menanggal keseluruhan bumbung, kerangka bumbung dan siling.\n2- Kerja bekal dan pasang kerangka bumbung, penutup bumbung, siling dan lain-lain berkaitan.\n3- Kerja-kerja berkaitan paip air,  ICT, telefon dan penyaman udara.\n4-Menanggal pendawaian dan kelengkapan elektrik sedia ada\n5- Kerja-kerja membekal, memasang pendawaian elektrik mengikut spesifikasi standard JKR secara pendawaian conduit permukaan atau terbenam dengan menggunakan kabel PVK  l/d conduit / trunking keluli bergalvani (hot dipped) dan aksesori yang berkaitan termasuk kelengkapan elektrik.\n6- kerja-kerja membekal dan memasang Main Switch Board (MSB) dan Distribution Board (DB) mengikut spesifikasi standard JKR lengkap dengan surge protection device (SPD)\n7- Kerja-kerja pengujian termasuk pembumian elektrikal dan lain-lain. \n8. Lain-lain kerja berkaitan keperluan decanting.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '1500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000215', '10000215', '42079901', 'JKN', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Pembaikan Bangunan Dan Sistem Elektrik Bagi Menyokong Pelaksanaan EMR Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan LBJ', '1-  Bangunan - Naiktaraf dan pembaikan bangunan termasuk bumbung, siling, dinding, lantai dan intrastruktur\n2- Penggantian paip yang usang, rawatan anai-anai dan mengecat\n3- Menanggal pendawaian dan kelengkapan elektrik sedia ada\n4- Kerja-kerja membekal, memasang pendawaian elektrik mengikut spesifikasi standard JKR secara pendawaian conduit permukaan atau terbenam dengan menggunakan kabel PVK  l/d conduit / trunking keluli bergalvani (hot dipped) dan aksesori yang berkaitan termasuk kelengkapan elektrik.\n5- kerja-kerja membekal dan memasang Main Switch Board (MSB) dan Distribution Board (DB) mengikut spesifikasi standard JKR lengkap dengan surge protection device (SPD)\n6- Kerja-kerja pengujian termasuk pembumian elektrikal dan lain-lain.\n7- Lain-lain kerja yang berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000216', '10000216', '42079901', 'BPKj', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Pembaikan Bangunan Dan Sistem Elektrik Bagi Menyokong Pelaksanaan EMR Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Simpang Durian', '1- Menanggal keseluruhan bumbung, kerangka bumbung dan siling.\n2- Kerja bekal dan pasang kerangka bumbung, penutup bumbung, siling dan lain-lain berkaitan.\n3- Kerja-kerja berkaitan paip air,  ICT, telefon, penyaman udara dan longkang perimeter.\n4-  Menanggal pendawaian dan kelengkapan elektrik sedia ada\n5- Permohonan naik taraf bekalan elektrik kepada TNB mengikut keperluan ESAH terkini.\n6-Kerja-kerja membekal, memasang pendawaian elektrik mengikut spesifikasi standard JKR secara pendawaian conduit permukaan atau terbenam dengan menggunakan kabel PVK  l/d conduit / trunking keluli bergalvani (hot dipped) dan aksesori yang berkaitan termasuk kelengkapan elektrik.\n7- kerja-kerja membekal dan memasang Main Switch Board (MSB) dan Distribution Board (DB) mengikut spesifikasi standard JKR lengkap dengan surge protection device (SPD)\n8- Kerja-kerja pengujian termasuk pembumian elektrikal dan lain-lain.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '1300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
