INSERT INTO `tblprojek` VALUES ('10000227', '10000227', '42079901', 'JKN', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Penyediaan Laluan Kecemasan Keseluruhan Bangunan Utama Hospital Tuanku Ampuan Najihah Serta Kerja-kerja Lain Yang Berkaitan', '1. Lantikan perunding bagi keperluan kelulusan bomba untuk rekabentuk laluan kecemasan di keseluruhan bangunan.\n2. Kerja-kerja membina tangga dan ramp kecemasan baharu menggunakan besi tahan karat serta kerja berkaitan mengikut kelulusan JBPM.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '748079.43', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000228', '10000228', '42079901', 'Pejabat Kesihatan Daerah Port Dickson', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Menaiktaraf Klinik Kesihatan Linggi (Kuarters Pegawai Perubatan & Pergigian) Dan Kerja-kerja Lain Yang Berkaitan', '1. Kerja-kerja membina laluan pejalan kaki berbumbung di keliling Kuarters Pegawai Perubatan & Pergigian KK Linggi (Bangunan sementara KK Linggi).\n2. Kerja-kerja membaikpulih bumbung, dinding, tingkap, mengecat, pendawaian elektrik, pintu,kipas dan grill pintu.\n3. Kerja-kerja memasang awning dan membina tandas pesakit.\n4. Kerj-kerja am yang berkaitan.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000229', '10000229', '42079901', 'Hospital Port Dickson', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja Menaik Taraf Zon Kuning Di Jabatan Kecemasan & Trauma, Hospital Port Dickson Serta Lain-lain Kerja Berkaitan ', 'Kerja bangunan                                                                                                                                                                                                                                                                     1. Membina dinding batu bata menggantikan dinding kaca sedia ada.\n2. Membekal dan memasang sistem gas perubatan (oksigen)\n3. Membina sliding door bagi menggantikan pintu kayu sedia ada.\n4. Membekal dan memasang railing untuk screen partition di setiap kubikel \n\n', null, '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000230', '10000230', '42079901', 'Pejabat Kesihatan Daerah Jelebu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Ubah Suai Bangunan Kuarters Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Pertang, Jelebu', 'Kerja-kerja menaiktaraf dan membaikpulih (3) unit kuarters bagi tujuan decanting melibatkan kerja-kerja seperti berikut: \n1. Kerja-kerja menaiktaraf dan ubah suai di ruang dalaman bangunan..\n2. Kerja-kerja menyediakan laluan pesakit dan OKU di pintu masuk utama.\n3. Kerja-kerja ubah suai bagi penyediaan kaunter dan ruang menunggu farmasi.\n4. Kerja-kerja pendawaian dan pemasangan peralatan elektrik serta mekanikal.\n5. Kerja am lain yang berkaitan.', null, '130000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000231', '10000231', '42079901', 'Pejabat Kesihatan Daerah Jelebu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Ubah Suai Bangunan Kuarters Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Kesihatan Simpang Durian, Jelebu', 'Kerja-kerja naik taraf dan ubah suai (2) unit kuarters bagi tujuan decanting melibatkan kerja-kerja seperti berikut::\n1. Kerja-kerja menaiktaraf dan ubah suai di ruang bahagian atas.\n2. Kerja-kerja menyediakan laluan pesakit dan OKU di pintu masuk utama.\n3. Kerja-kerja ubah suai bagi penyediaan kaunter dan ruang menunggu farmasi.\n4. Kerja-kerja pendawaian elektrik.\n5. Kerja am lain yang berkaitan.', null, '20000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000232', '10000232', '42079901', 'Hospital Tuanku Ampuan Najihah, Kuala Pilah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Menaik Taraf Sistem Pendawaian Elektrik, Oksigen, Air Outlet Dan Vacuum Outlet Serta Kerja-kerja Lain Yang Berkaitan DiUnit Rawatan Rapi Kanak-kanak, Hospital Tuanku Ampuan Najihah, Kuala Pilah', '1. Kerja-kerja naitaraf bedhead di Unit Rawatan Rapi Kanak-Kanak.\n2. Kerja-kerja naiktaraf sistem pendawaian elektrik.\n3. Kerja-kerja naiktaraf sistem oksigen, air outlet dan vacuum outlet.\n4. Kerja-kerja lain berkaitan di ruang kerja yang sama. ', null, '65000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000233', '10000233', '42079901', 'Pejabat Pergigian Daerah Kuala Pilah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Pembaikan Sistem Perpaipan Serta Kerja-kerja Lain Yang Berkaitan Di Klinik Pergigian Kuala Pilah', 'Membekal, menukar dan memasang keseluruhan paip lama jenis Gi dari tangki air ke klinik dengan paip baharu jenis PVC dan menukar tangki lama dengan tangki baharu_semua surgery dan lab melibatkan infection control', null, '153049.57', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000234', '10000234', '42079901', 'Pejabat Kesihatan Daerah Tampin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Dan Ubah Suai Serta Lain-lain Kerja Yang Berkaitan Di Unit Farmasi Klinik Kesihatan Jelai, Tampin', 'Kerja-kerja ubahsuai ruang kaunter, bilik kaunseling dan stor termasuk naiktaraf dinding serta pendawaian dan lain-lain kerja berkaitan', null, '60000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000235', '10000235', '42079901', 'Hospital Jelebu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Menaik Taraf Bangunan Sokongan Serta Kerja-kerja Lain Yang Berkaitan Di Hospital Jelebu', '- kerja-kerja pembinaan struktur asas termasuk rasuk dan tiang.\n- kerja-kerja pembinaan dinding dan lantai, siling termasuk kerja-kerja mengecat dan memasang tiles.\n- kerja-kerja pemasangan bumbung termasuk kerangkang dan awning.\n- kerja-kerja membina tandas termasuk segala kelengkapan perpaipan yang berkaitan.\n- kerja-kerja membina satu sub DB dan earthing.\n- kerja-kerja pembinaan laluan penjalan kaki.\n- kerja-kerja lain yang berkaitan.', null, '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000236', '10000236', '42079901', 'Hospital Tuanku Ja\'afar, Seremban', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Pembaikan Stor Klinik MOPD Serta Lain-lain Kerja Berkaitan Di Hospital Tuanku Ja\'afar, Seremban', '1. Kerja-kerja penggantian struktur bumbung dan siling \n- Membuka siling sedia ada dan memasang struktur bumbung baru menggunakan kayu beroti dan memasang bumbung jenis metal deck.\n- Memasang struktur siling daripada aluminium dan memasang siling gantung jenis gypsum yang baru\n\n2. Kerja-kerja pendawaian dan pemasangan peralatan eletrik.', null, '27000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000237', '10000237', '42079901', 'Pejabat Pergigian Daerah Rembau', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Naik Taraf Makmal Pergigian Basah Serta Kerja-kerja Lain Berkaitan Di Klinik Pergigian Rembau', '1. Kerja-kerja ubahsuai tabletop bagi menampung fumecupboard.\n2. Kerja-kerja susun atur laluan paip air dalaman dan paip buangan sinki.\n3. Kerja-kerja pembaikan ruang kerja yang berkaitan.\n4. Kerja-kerja pembaikan ruang kabinet di bawah tabletop sedia ada.', null, '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000238', '10000238', '42079901', 'Hospital Tuanku Ja\'afar, Seremban', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Menaik Taraf Pintu Utama Di Laluan Utama NICU Dan Kerja-kerja Lain Berkaitan Di Hospital Tuanku Ja\'afar, Seremban', '1. Kerja-kerja menaiktaraf pintu masuk utama melibatkan aktiviti berikut:\n- Kerja-kerja pendawaian elektrik di Distribution Board.\n- Kerja-kerja memasanag automatic drive system for swing doors.\n-Memasang door exit push button.\n\n2. Penyediaan emergency breakglass dan Interface Board.', null, '100100.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000239', '10000239', '42079901', 'Hospital Jempol', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Mengubah Suai Sistem Pembetungan Di Balai Pelawat Hospital Jempol', 'Mengubahsuai  perpaipan  bagi  sistem  pembetungan  pada  blok bangunan  balai  pelawat  yang  melibatkan  masalah  man  hole  dan floor trap yang kerap tersumbat berpunca daripada masalah defect sewaktu kerja-kerja pembinaan hospital.', null, '104000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000240', '10000240', '42079901', 'Hospital Port Dickson', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'NEGERI SEMBILAN', 'Kerja-kerja Menaik Taraf Tandas Pesakit Di Unit Rehabilitasi (Pemulihan Carakerja) Serta Lain-lain Kerja Yang Berkaitan di Hospital Port Dickson', '                                                                                                                                                                                            1. Kerja-kerja ubahsuai ruang dalaman tandas.\n2. Kerja-kerja penggantian sistem paip air dalaman.\n3. Kerja-kerja pembaikan sistem sanitari.\n4. Kerja-kerja penyediaan ruang pengguna OKU.\n5. Kerja-kerja pendawaian dan pemasangan peralatan elektrik.\n6. Kerja-kerja am lain yang berkaitan.', null, '41175.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000241', '10000241', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Melaka Tengah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Naik Taraf Dan Ubah Suai Ruang Serta Kerja-kerja Pembaikan Kerosakan Infrastruktur Di Klinik Kesihatan Ayer Keroh, Melaka', '\n 1. Kerja-Kerja Mengubahsuai Dan Menaiktaraf Ruang Kaunter Farmasi Walk-Thru Untuk Dijadikan Ruang Pengambilan Ubat Untuk Kegunaan Pesakit Berjangkit Di KK Ayer Keroh melibatkan skop kerja naiktaraf lantai dengan permukaan berkonkrit, kemasan jubin untuk dijadikan ruang menunggu, kerja-kerja mengalihkan/ divert longkang untuk binaan lantai baru serta membekal dan memasang sistem QMS\n 2. Kerja-Kerja Ubahsuai Dan Susun Atur Semula Kaunter Pendispens Ubat Farmasi melibatkan kerja-kerja memecah dan memotong tembok kaunter dan susunatur semula kaunter dengan menempatkan kaunter berdiri dan 1 kaunter untuk kemudahan OKU.\n 3. Kerja-kerja Naiktaraf Taman Permainan Kanak-Kanak Untuk Dijadikan Fever Centre dan lain-lain kerja Berkaitan di KK Ayer Keroh                                                                             4. Kerja-kerja lain yang berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '215000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000242', '10000242', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Melaka Tengah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Naik Taraf dan Ubah Suai Ruang Serta Lain-lain Kerja Berkaitan Di Klinik Kesihatan Ujong Pasir, Melaka', '1. Kerja ubahsuai bangunan untuk meluaskan unit Makmal 2. Ubahsuai ruang makmal sedi ada untuk membesarkan ruang farmasi.\n3. Menanggal pendawaian dan kelengkapan QMS dan dipasang semula ke kaunter baru termasuk konfigurasi semula sistem.\n 4. Menanggal kelengkapan sistem penghawa dingin dan dipasang semula ke tempat baru.\n5. Susunatur semula pendawaian dan lekapan kerja elektrik, telekomunikasi dan ICT.\n6. Baiki kerosakan ruang dengan menyediakan kemasan cat baru, siling baru, menyediakan kaunter pendaftaran lengkap dengan backdrop, keperluan ict, telefon, sistem penghawa dingin serta kerja pendawaian.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000243', '10000243', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Melaka Tengah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Membaiki Sistem Perpaipan Paip Pili Bomba Serta Lain-lain Kerja Berkaitan Di Klinik Kesihatan Batu Berendam, Melaka', '1. Pembaikan keseluruhan sistem perpaipan baru bagi paip air Bomba Kerja-kerja menyediakan laluan paip baru secara surface termasuk bracket bagi menggantikan paip sedia ada.\n 2. Paip yang diganti melibatkan paip jenis mils steel berukuran 150mm diameter termasuk mengecat serta memabaiki kerosakan sekeliling kepada yang asal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000244', '10000244', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Pembaikan Laluan Masuk Yang Mendap, Naik Taraf Kaunter Pendispenan Ubat Serta Pembaikan Lain-lain Kemudahan Bangunan Di Klinik Kesihatan Masjid Tanah, Alor Gajah, Melaka', '1.Kerja-kerja pembaikan bekalan essential bangunan termasuk kelengkapan dan pendawaian\n2. Pembaikan laluan parkir kenderaan yang mendap termasuk menggantikan dengan box culvert dan kerja-kerja menurap semula permukaan                                                                                                                        3.Kerja-kerja ubahsuai dan naiktaraf Kaunter Pendispenan Farmasi dengan pemecahan dinding di bahagian dalam dan memanjangkan kaunter sehingga ke pintu farmasi \n4. Penambahan 1 kaunter penyaringan farmasi\n5. Penambahan 1 unit penghawa dingin 1.0hp di ruang kaunter yang diubahsuai\n6. Pemasangan roller shutter bagi kaunter yang akan diubahsuai', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000245', '10000245', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Pembaikan Sistem Perpaipan Dalaman Dan Saluran Kumbahan Serta Lain-lain Kerja Yang Berkaitan Di Klinik Kesihatan Pengkalan Balak, Alor Gajah, Melaka', '\n1. Kerja-kerja penggantian sistem perpaiapan dalaman klinik kepada yang baharu.                                                                                               2. Kerja-kerja pembaikan saluran sistem paip kumbahan yang mendap dan tersumbat termasuk kerja-kerja lain yang berkaitan.                                                                                                 3. Kerja-kerja ubahsuai dan membaiki mana-mana salur air buangan keluar terus ke dalam manhole\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '110000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000246', '10000246', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Pendawaian Elektrik Dan Pembaikan Lantai Bangunan Serta Lain-lain Kerja Yang Berkaitan Di Bangunan Baru Unit Inspektorat PKD Alor Gajah, Melaka', '1. Kerja-kerja pendawaian lampu dan soket elektrik di kawasan yang terlibat.                                                                             2. Kerja-kerja pembaikan lantai yang rosak\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000247', '10000247', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Naik Taraf Pendawaian Serta Lain-lain Kemudahan Bangunan Di Klinik Kesihatan Rembia, Alor Gajah, Melaka', '\n1. Kerja-kerja pembaikan bekalan essential bangunan termasuk kelengkapan dan pendawaian                                                                          2. Kerja-kerja pendawaian kabel lampu kawasan dan kerja-kerja pembaikan kerosakan pendawaian di kotak Distribution Board (DB).                                                                      3. Kerja-kerja pembaikan kawasan permukaan yang terjejas', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000248', '10000248', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Jasin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menyedia dan Menaik Taraf Bangunan Separa Kekal Sebagai Stor Pukal Di Klinik Kesihatan Umbai, Jasin, Melaka ', '1. 3 Unit bangunan separa kekal bersaiz 20 X 10 kaki unit lengkap dengan 1 pintu lengkap dengan jeriji besi\n2. 4 Unit tingkap jenis \'top hang\' lengkap dengan jeriji besi\n3. Pemasangan penghawa dingin \n4. Lantai Concrete Slab lengkap dengan pemasangan tiles jenis heavy duty\n5. Pemasangan awning di bahagian pintu masuk\n6. Mengecat bahagian dalam dan luar serta kerja-kerja lain\n7. Dilengkapi dengan CCTV\n8. Kerja-kerja pendawaian elektrik dilengkapi  lampu kalimantang jenis LED\n9. Pemasangan 2 portable smoke detector', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000249', '10000249', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Jasin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Pembaikan Kemudahan Bangunan Serta Lain-lain Yang Berkaitan Di Klinik Kesihatan Kesang Tua, Jasin, Melaka', '1. Kerja-kerja pembaikan tandas dengan lapisan kalis lembap termasuk membaiki sofit lantai konkrit                                                                2. Kerja-kerja pembaikan semula kemasan tandas dan lantai kepada yang asal                                                                                                             3. Kerja-kerja kawalan serangga perosak', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000250', '10000250', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Kesihatan Daerah Jasin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Baik Pulih Klinik Serta Kuarters Dan Kerja Baik Pulih Sistem Perpaipan Di Klinik Desa Batu Gajah Pasir, Jasin, Melaka ', '1. Kerja-kerja baik pulih tembok pagar                                                                                       2. Kerja-kerja pembaikan tandas dengan lapisan kalis lembap termasuk membaiki sofit lantai konkrit                                                                3. Kerja-kerja pembaikan semula kemasan tandas dan lantai kepada yang asal                                                                                               4. Kerja-kerja penggantian sistem paip bekalan air dalaman klinik                                                                                                            5. Kerja-kerja penggantian tangki air                                                                                                    6. Kerja-kerja lain yang berkaitan ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '170000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000251', '10000251', '42089901', 'Hospital Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Pusat Hemodialisis Serta Kerja-kerja Lain Berkaitan di Hospital Melaka', '1. Membuka dan melupuskan kabinet lama dan partition di Ruangan Negative dan kerja-kerja kemasan untuk paip air RO\n2. Membuka kaunter lama dan memasang kaunter pendaftaran pesakit yang baru mengikut saiz yang bersesuaian jenis ACP serta penambahan 6 unit soket\n3. Memasang penghawa dingin serta kerja-kerja pendawaian. \n4. Membekal  kabinet / almari berkunci untuk penyimpanan rekod pesakit\n5. Kerja-Kerja memecah gypsum board, pengalihan dan pemasangan pintu masuk utama jenis 2 daun serta pemasangan frame besi di pintu utama sedia ada\n6. Kerja-kerja membuka dan melupuskan partition, memecah sinki dan melupuskan penghadang di Ruangan Hepatitis C serta kerja lain berkaitan\n7. Kerja-Kerja pengalihan penghawa dingin dan suiz lampu\n8. Kerja-kerja membina semula 1 unit tabletop sedia ada di bahagian reprocessor\n9. Kerja-kerja cat dan kemasan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000252', '10000252', '42089901', 'Hospital Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Sistem Kebakaran dan Keselamatan di Jabatan Dietetik Dan Sajian Yang bersambung Ke Panel Board Utama Serta Kerja-kerja Lain Berkaitan di Hospital Melaka', '1. Membekal dan memasang pendawaian dari sistem wet chemical di aras 2 ke panel board utama hospital\n2. Memasang break glass di aras 1 dan aras 2\n\n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '60000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000253', '10000253', '42089901', 'Hospital Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Bilik Mandi Dan Tandas Pesakit Wad C1 & Wad C2 Serta Kerja-kerja Lain Berkaitan di Unit Psikiatri Hospital Melaka', '1. Membuka dan melupuskan pintu dan jenang serta menyediakan permukaan dinding bagi penerimaan pintu yang baru\n2. Membekal dan memasang pintu acrylic termasuk kerja memasang bolt-bolt yang diperlukan.\n3. Membekal dan memasang jubin antislip pada lantai tandas san jenis ceramic berglip pada dinding\n4. Kerja-kerja mengecat dinding 2 lapisan menggunakan cat emulsi serta kemasan berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '60000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000254', '10000254', '42089901', 'Hospital Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Ubah Suai Dan Menaik Taraf Kafeteria Serta Kerja-kerja Lain Berkaitan Di Hospital Melaka', '1. Ruangan Dapur\n- Memecah dan menanggalkan tile dinding dan lantai\n- Pemasangan lantai homogenous antislip, dinding aluminium plate, floor & gress trap, plate besi bawah dapur, jaring besi dan kerja kemasan\n2. Ruangan Kafeteria\n- Kerja-kerja pemasanagan dinding sesekat                                                                                                            - Penggantian tile jenis anti-slip\n- Kerja-kerja mencabut dan melupuskan railing, bumbung, dan lampu termasuk pendawaian sedia ada                                                             ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000255', '10000255', '42089901', 'Hospital Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Di Unit Pemulihan Cara Kerja EG Serta Kerja-kerja lain Berkaitan Di Hospital Melaka', '1. Naik taraf bilik terapi kepada Sensory Integration Room.\n2. Naik taraf tandas kepada tandas mesra OKU.\n3. Pemasangan pintu sliding untuk ruang kerja kakitangan.\n4. Kaunter pegawai perhubungan awam (PRO).\n5. Naik taraf shutter door kepada pintu kaca.\n6. Naik taraf bumbung di Unit Pemulihan Cara Kerja Kanak-kanak.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000256', '10000256', '42089901', 'Hospital Jasin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Bilik Respiratory Lab Unit Rawatan Rapi (ICU) Serta Lain-lain Kerja Yang Berkaitan Di Hospital Jasin, Melaka ', '1. Kerja memecahkan dinding sediaada yang bersaiz 15\' x 10.\n2. Kerja membina dinding (batu merah) serta plaster dengan ukuran   (15\'x10x10\').\n3.  Kerja membekal dan pemasangan pintu 2 daun beserta jenang.\n4.  Kerja memecah magkuk tandas sedia ada\n5. Kerja memasang jubin lantai tandas yang pecah beserta kerja-kerja waterproofing.\n6. Kerja membekal dan memasang bedpan washer. \n7. Lain-lain kerja berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '65000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000257', '10000257', '42089901', 'Hospital Jasin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Unit Rawatan Harian (Daycare) Serta Lain-lain Kerja Yang Berkaitan Di Hospital Jasin, Melaka', 'Kerja-kerja naiktaraf Pusat Rawatan Harian berkeluasan [22 (L) x 25 (P)] dan lain-lain kerja berkaitan.\n1. Mempunyai dua ruang katil pemerhatian beserta railing partition\n2. Bilik Persalinan dan Loker pesakit\n3. Kaunter Pendaftaran\n4. Ruang menunggu yang boleh menempatkan 8 individu (waris / pesakit)\n5. Kipas \n6. Pintu kaca 2 daun\n7. Papan Tanda\n8. Membina dinding bata bersama tingkap\n9. Penghawa Dingin\n10. Perabot dan kerusi menunggu\n11. Rak Fail Pesakit berututp\n12.Lain-lain kerja berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000258', '10000258', '42089901', 'Hospital Jasin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Anjung Budi Untuk Dijadikan Discharge Lounge Serta Lain-lain Kerja Yang Berkaitan Di Hospital Jasin, Melaka ', 'Menaiktaraf ruangan Anjung Budi kepada Discharge lounge untuk dijadikan ruang menunggu khas untuk pesakit yang dibenarkan pulang  bagi mengatasi tempoh menunggu terlalu lama khususnya bagi pesakit untuk mendapatkan katil di wad. Kerja -kerja naiktaraf adalah seperti berikut:\n1. Kaunter \n2. Ruang menunggu pesakit lelaki dan perempuan \n3. Tandas lelaki dan perempuan \n4. Penghawa dingin.\n5. Perabot dan Television  \n6. Pemasangan soket, internet, dan telefon', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000259', '10000259', '42089901', 'Hospital Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Pembaikan Lapisan Kalis Lembap Di Hospital Alor Gajah, Melaka - FASA II', '1. Kerja-kerja pemasangan lapisan kalis lembap yang baru pada bahagian lantai dan dinding tandas termasuk kerja-kerja memecah lantai/dinding sediada serta kerja-kerja lain berkaitan termasuk kemasan.                                                                 2. Fasa 2 (2024) yang melibatkan Wad Kenanga 2B dan Dewan Bersalin / Kecemasan & Trauma', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000260', '10000260', '42089901', 'Hospital Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf Kemudahan Bangunan Bilik Isolasi Dan Kerja-kerja Pendawaian Kelengkapan Serta Lain-lain Kerja Yang Berkaitan Di Hospital Alor Gajah, Melaka', '1. Kerja-kerja membuka dan menanggalkan siling gantung sediada termasuk struktur bingkai dan aksesori sediada.\n2. Kerja-kerja memasang baru siling kapur (seamless ceiling) termasuk bingkai dan aksesori serta kerja-kerja lain berkaitan.                                                                                                3. Kerja-kerja pendawaian dan penggantian kipas di kawasan awam dan exhaust fan di tandas dan bilik-bilik di hospital alor gajah', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '172000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000261', '10000261', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Pergigian Melaka Tengah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Pembaikan, Ubahsuai Dan Menaik Taraf Ruang Bangunan Kuarters Bukit Peringgit Untuk Dijadikan Pejabat Pergigian, Daerah Melaka Tengah', '1. Kerja-kerja ubahsuai ruang untuk dijadikan Bilik mesyuarat, Bilik Pegawai & kakitangan.                                                            2. Kerja-kerja ubahsuai pintu laluan masuk dan kaunter khidmat pelanggan.                                                                             3. Kerja-kerja pemasangan cubicle work station                                               4. Pendawaian soket, internet dan penghawa dingin                                                       5. Kerja mekanikal bangunan                                                                           6. kerja-kerja lain pembaikan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '230000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000262', '10000262', '42089901', ' Jabatan Kesihatan Negeri Melaka / Pejabat Pergigian Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja -kerja Ubah Suai Ruang Untuk Dijadikan Bilik Rekod Serta Lain-lain Kemudahan Bangunan Di Klinik Pergigian Ayer Molek, Melaka', '                                                                                                                \n1. Kerja-kerja ubahsuai ruang sedia ada untuk dijadikan bilik rekod dan ruang kerja dengan pemasangan dinding sesekat.                                                                                                                         2. Kerja-kerja pemasangan kabinet pasang siap (built in cabinet) beserta kelengkapan laci dan kerja-kerja yang berkaitan di bilik rekod.                                                                                                                           3. Kerja-kerja pemasangan built in cabinet jenis gantung untuk penyimpanan rekod-rekod                                                                                                                                       \n4. kerja-kerja pendawaian dengan suis soket elektrik 13 amp di bilik CSSD dan bilik rekod                                                                                                 5.Kerja-kerja pemasangan penghawa dingin split unit serta kerja-kerja berkaitan di bilik CSSD                                                                                                                                                                        6. Kerja -kerja pendawaian point internet di bilik rekod dan bilik Juruterapi pergigian                                    \n7. Lain-lain kemudahan bangunan yang melibatkan kerja-kerja ubahsuai                                                                                                                                                             ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000263', '10000263', '42089901', 'Jabatan Kesihatan Negeri Melaka / Pejabat Pergigian Melaka Tengah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menaik Taraf, Ubah Suai Dan Pembaikan Di Klinik Pergigian Machap Baru, Alor Gajah, Melaka', 'Naik taraf dan ubah suai bilik CSSD Klinik Pergigian Machap Baru:-                                                                                                                                                                                 1. Penambahan bilik berukur 10 kaki x 10.5 kaki dengan syiling gantung, lantai bertiles, pintu sliding, kaunter table top berukuran 10 kaki x 2 kaki x 5 kaki bersama 1 unit sinki berukuran 75cm x 40cm , kabinet gantung size 10 kaki x 1.5 kaki x 3 kaki, 6 unit soket , 2 panel lampu , 1 unit kipas syiling dan 1 unit tingkap panel 2 dengan grill.\n2. Pemasangan kabinet table top kaunter berserta laci berkunci dan pemasangan tingkap kaca bergrill di ruang pendaftaran & pembayaran klinik.\n3. Penyelenggaraan & pemasangan kabinet table top berserta laci berkunci di ruang bilik rawatan berukuran 325cm x 62cm termasuk pembaikan rangka kabinet kepada jenis aluminium.\n4. Penyelenggaraan, pembekalan & pemasangan syiling gantung dan 4 panel lampu di kaunter pesakit, bilik rawatan dan ruang CSSD di Klinik Pergigian Machap Baru.\n5. Pemasangan suis soket baru sebanyak 4 di ruang pendaftaran dan bilik rawatan.\n6. Pembekalan & pemasangan pintu utama klinik jenis kayu dengan grill besi berukuran 82cm x 202cm di Klinik Pergigian Machap Baru.\n7. Pembekalan & Pemasangan label acrylic dengan tulisan \'Klinik Pergigian Machap Baru\' berukuran 1 kaki x 2 kaki.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '130000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000264', '10000264', '42089901', 'Hospital Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menyediakan Bangunan Farmasi Pandu Lalu Serta Kerja-kerja Lain Yang Berkaitan Di Tapak Kegunaan Hospital Melaka', '1. Kerja-kerja pembersihan kawasan sediada dan mengisi dan meratakan tanah menggunakan jentera serta kerja-kerja berkaitan\n2. Kerja-kerja konkrit asas tetulang dan footing ,ground beam work, memasang ground slab, memasang kerangka lightweight bagi pemasangan cement board, melepa simen plaster, membina kerangka bumbung menggunakan C channel untuk roof trusses serta kerja pemasangan bumbung jenis metaldeck, membekal dan memasang siling gantung, memasang pintu dan tingkap\n3. Membina ruang kaunter pandu lalu dan rak ubat, membekal dan memasang pintu, roller shutter di kaunter dan papan tanda\n4. Kerja-kerja membina pintu pagar utama besi wiremesh 2 daun dan membina pondok pengawal\n5. Kerja-kerja memasang dan membekal lampu panjang jenis kalimantan LED dan soket, membekal 2 unit compactor 8 bay, pendawaian internet line bersama 6 unit desktop, membekal loker ubat jenis kayu custom made dan membekal dan memasang aircond ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000265', '10000265', '42089901', 'Pejabat Kesihatan Daerah Alor Gajah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Naik Taraf Kaunter Pendispensan Unit Farmasi Klinik Kesihatan Lubok Cina, Alor Gajah ', '1.Pengubahsuaian kaunter pendispensan sedia ada kepada kaunter yang baru.\n 2.Penambahan kabinet di ruang pendispensan untuk mengisi ubat- ubatan.\n 3.Penambahan awning di stor ubat.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '12000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000266', '10000266', '42089901', 'Pejabat Kesihatan Daerah Melaka Tengah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Cadangan Penukaran Jeriji Besi Kepada Roller Shutter Aluminium Bermotor Di Kaunter Farmasi Klinik Kesihatan Peringgit, Melaka', '1.Penanggalan jeriji besi yang lama di kaunter farmasi.\n2. Pemasangan roller shutter aluminium bertutup bersaiz 17 kaki panjang dan 9 kaki tinggi di kaunter farmasi.\n3. Pemasangan motor dan suis untuk pengawalan pembukaan dan penutupan roller shutter.\n4. Pendawaian motor ke roller shutter aluminium.\n5. Pembersihan dan cat semula pada kawasan yang terlibat.\n6. Kerja-kerja lain yang terlibat untuk penanggalan jeriji besi lama dan pemasangan roller shutter aluminium bertutup ini.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '14000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000267', '10000267', '42089901', ' Pejabat Kesihatan Daerah Jasin', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Ubah Suai Tingkap Untuk Dijadikan Kaunter Walk-Thru / Park & Take Pengambilan Ubat Di Klinik Kesihatan Selandar, Jasin, Melaka', '1. Mengubahsuai tingkap sediaada (1 panel) jenis swing kepada jenis sliding: \"jenis boleh laras\" pada tetingkap (dibuka bila ada pelanggan dan boleh ditutup apabila tiada pelanggan berurusan.  \n2. Memotong sebahagian grill (saiz   20cm lebar x 15cm tinggi) untuk memudahkan serahan ubat dilakukan kepada pesakit.            \n3. Memasang sinage (nama kaunter & waktu operasi) \n4. Membekalkan 1 unit loceng jenis (wireless door bell) di setiap kaunter bagi memudahkan pesakit memanggil anggota farmasi apabila ingin mengambil bekalan ubat\n5. Pemasangan Kawasan berbumbung lengkap dengan kerusi berangkai untuk pesakit menunggu untuk mendapatkan bekalan ubat\n6. Pemasangan sistem panggilan ringkas', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '10000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000268', '10000268', '42089901', 'Jabatan Kesihatan Negeri Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Pembaikan Dan Ubah Suai Ruang Kerja Aras 5, Bangunan Guna Sama Wisma Persekutuan, Jabatan Kesihatan Negeri Melaka', '1. Kerja-kerja susun atur semula ruang kerja cubicle work station aras 5.                                                                                                2. Kerja-kerja pendawaian infra untuk soket dan internet.                                                      \n3. Kerja-kerja pemasangan cubicle work station                                         4. Lain-lain kerja arkitek yang melibatkan kemasan dalaman bangunan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000269', '10000269', '42089901', 'Jabatan Kesihatan Negeri Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Ubah Suai Bangunan Biotek MITC Melaka Untuk Dijadikan Pejabat Unit Kejuruteraan Jabatan Kesihatan Negeri Melaka', '1. Kerja-kerja pendawaian bagi ruang kerja\n2. Kerja-kerja membekal dan memasang ruang kerja kakitangan unit kejuruteraan\n3. Kerja-kerja pemasangan penghawa dingin jenis split unit\n4. Kerja-kerja pembaikan ruang bilik pegawai dan ruang bilik mesyuarat', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000270', '10000270', '42089901', 'Jabatan Kesihatan Negeri Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menyelenggara Dan Membaik Pulih Stor Bahagian Pengurusan Di Bangunan Lama Klinik Desa Bukit Beruang, Melaka', '                                                                                                                                1. Membaiki dan menyelenggara bumbung bangunan yang bocor dan saluran air (gutter) bangunan serta lain-lain berkaitan.                                                                                                               2. Menyelenggara sistem paip dalaman                                                                                                                     3. Melaksanakan kerja-kerja pendawaian elektrikal am bangunan.                                                                                           4. Menyelenggara penghawa dingin                                                                                                                                                                                                                                                                                                                                              5. Menyelenggara lanskap.                                                                                                                                             6. Melaksanakan kerja-kerja perkhidmatan kawalan anai-anai dan serangga perosak bangunan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000271', '10000271', '42089901', 'Jabatan Kesihatan Negeri Melaka', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'MELAKA', 'Kerja-kerja Menyediakan Parkir Berbumbung Untuk Jabatan Kesihatan Negeri Melaka Di Bangunan Wisma Persekutuan, Melaka', '1. Kerja-kerja penggalian bagi menyediakan pad footing                                                                             2. Kerja-kerja pemasangan rangka keluli untuk tiang dan bumbung parkir kenderaan                                                                          3. Kerja-kerja pemasangan penutup bumbung, gutter dan rain water down pipe (RWDP)                                                                             4. Kerja-kerja kemasan cat pada pemukaan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '32000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000272', '10000272', '42099901', 'JKN ', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Pembaikan Lantai, Dinding Bangunan Yang Terkesan Semasa Banjir Di Klinik Desa Liang Batu, Muar', '1.Pendawaian Elektrik.\n2.Partition board bilik-biilik\n3.Pemasangan tingkap dan pintu\n4.Mengecat bahagian dalam bangunan\n5.Kerja Pemasangan kabinet  bina,kabinet kaunter\n6.Peralatan tandas,sinki\n7.Pemasangan kelengkapan lampu,kipas,air-cond,suis,soket dll.\n8.Kerja primex,road line dan pembersihan kawasan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '211011.70', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
