INSERT INTO `tblprojek` VALUES ('10000275', '10000275', '42099901', 'JKN ', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Menaiktaraf Bangunan Lama ILKKM Kluang Untuk Menambah Ruang Operasi Pejabat Kesihatan Daerah Kluang', '(1)Pendawaian elektrik di bangunan Sri Permata & Sri Baiduri\n(2) Pemasangan dan fitting main suis Board & Kotak Elektrik \n(3) Pemasangan kelengkapan dan aksesori elektrik seperti lampu, kipas, soket, dan lain-lain keperluan \n(4) Pemasangan kabel servis -Urusan TNB', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '111935.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000276', '10000276', '42099901', 'JKN ', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Naik Taraf & Pembaikan Bumbung Dan Lain-lain Kerja Berkaitan Di Klinik Kesihatan Nitar 1, Mersing', '1. Kerja premix kawasan letak kenderaan \n2. Kerja-kerja penggantian pintu-pintu bilik pemeriksaan sedia ada\n3. Kerja-kerja kelengkapan tandas mesra OKU\n4. Kerja-kerja pemasangan bidai tingkap\n5. Kerja-kerja membekal meja kaunter pendaftaran\n6. Kerja-kerja pembersihan\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '76096.10', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000277', '10000277', '42099901', 'JKN ', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Penggantian Sistem Vakum Perubatan Serta Lain-lain Kerja Berkaitan Di HPSF, Muar', '1. Penggantian 3 unit vacuum pump termasuk bacterial filter dan control system\n2. Penggantian komponen bekalan elektrik dan sistem perpaipan kuprum di dalam loji \n3. Kerja-kerja paip ekzos', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '431214.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000278', '10000278', '42099901', 'JKNJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Menaiktaraf Kompleks Jurupulih Carakerja Permai Lama Untuk Dijadikan Pejabat Dan Stor Eksibit (Penyimpanan Barang Rampasan Kes) Cawangan Kawalan Amalan Perubatan Swasta (CKAPS) JKNJ Serta Lain- lain Pembaikan Yang Berkaitan', 'Menambah baik ruang stor penyimpanan barang rampasan, pejabat dan tandas termasuk pendawaian elektrik, PABX, mengecat, Internet, perpaipan dan penyediaan station bekerja', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000279', '10000279', '42099901', 'HSAJB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja Naik Taraf Makmal Kaji Kuman Kepada Farmasi Pesakit Dalam Dan Lain-lain kerja Berkaitan Di Hospital Sultanah Aminah Johor Bahru', 'Kerja-kerja menaik taraf yang terdiri daripada kerja-kerja menyediakan kaunter penyerahan ubat, memasang punca bekalan eletrik essential, memecah meja, memasang pintu, memasang alat penghawa dingin, kerja pendawaian soket essential, kerja pemasangan talian internet, kerja membina laluan konkrit, pemasangan anti-slip flooring dan kerja-kerja memindahkan data logger peti sejuk.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000280', '10000280', '42099901', 'PKD JB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja MenaikTaraf Ruang Klinik Dan Lain-lain Berkaitan Di Klinik Pergigian Lama TUTA Johor Bahru', '1.Kerja-kerja memecah lantai sediaada termasuk merender dan menghampar cat jenis epoxy\n2.Kerja-kerja membuka dinding kaca sediada termasuk membina semula sekatan dinding daripada jenis gymsumboard\n3.Kerja-kerja membina ruang rawatan yang baru\n4.Kerja-kerja membaikpulih tandas termasuk kerja-kerja waterprofing\n5.Kerja-kerja membaikpulih tingkap\n6.Kerja-kerja anai-anai\n7.Kerja-kerja membaikpulih pendawaian', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
