INSERT INTO `tblprojek` VALUES ('10000285', '10000285', '42099901', 'JKNJ', '1006', '42', '00600', '117', '4001', 'APRIL', '2024', 'JOHOR', 'TARIK BALIK PERUNTUKAN : Kerja Menaiktaraf Lantai  Serta Lain-lain Kerja Berkaitan Di Klinik Pergigian Pakar Orthodontik Jalan Abdul Samad, Johor Bahru', '1. Kerja kerja awalan dan am\n2. Kerja-kerja lantai\n3. Kerja-kerja dinding\n4. Kerja-kerja jubin\n5. Kerja-kerja longkang\n6. Kerja kerja bumbung\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '-85000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000286', '10000286', '42099901', 'PPD Kota Tinggi', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Menaiktaraf Bilik X-Ray Serta Kerja-kerja Berkaitan Di KP Di KK Bandar Tenggara', '1. kerja-kerja membuka serta membuang tingkap, memasang batu bata beserta lepaan simen                                                                                   2.kerja-kerja mengetuk dan memecah keseluruhan dinding, melepa dan sapu simen gum dikeseluruhan bilik                                                                                             3. kerja-kerja mengetuk dan memecah semua kota k suis untuk pemasangan kepingan plumbum dan kerja-kerja pendawaian                                                                                                   4. kerja-kerja membekal serta melepa dinding dengan barium plaster 20mm (1.0Pb)                                                                                                                 5. kerja-kerja membuka pintu sedia ada serta membekal pintu plumbum 900mm x 2100mm berlapit plumbum 1.0mm beserta cat                                                                                                   6. kerja-kerja mengecat 2 lapisan dalam dan luar bilik x-ray                                                                                                                                                     7. membekal serta memasang papan tanda amaran                                                                                                                                                           8. kerja-kerja ujian kesetaraan ketebalan plumbum oleh konsultan kelas lesen H beserta laporan ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '28000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000287', '10000287', '42099901', 'Farmasi JKNJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Menaik Taraf Sistem Perangkap Kilat Di Bahagian Perkhidmatan Farmasi, Jabatan Kesihatan Negeri Johor', '1. Kerja awalan\n2. Kerja-kerja pendawaian elektrik mata soket alur keluar l/d soket alur keluar 3 pin 13A berkembar menggunakan kabel 2x2.5mm l/d kabel perlindungan serta lain-lain kerja berkaitan.\n3. Kerja-kerja alat sistem perangkap kilat di Bangunan P1 dan Bangunan Ibnu Hayyan.\n4. Pengujian dan pentauliahan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '35000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000288', '10000288', '42099901', 'HSNI BP', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Cadangan Kerja Naik Taraf Ruang Sedia Ada CSSD Blok A Kepada Klinik Pakar Jabatan Psikiatri Dan Jabatan Rehabilitasi Serta Kerja Berkaitan Di HSNI, Batu Pahat', '1. Kerja-kerja sivil;\na) Pecah dinding untuk pemasangan pintu pendua bilik rawatan\nb) Tambahan ruang untuk kaunter dan ruang menunggu pesakit\nc) Pemasangan vinyl, siling dan kemasan dinding di ruang autoclave lama\nd) Tambahan sinki lengkap untuk 5 bilik rawatan\n2. Kerja-kerja mekanikal; tambahan centralise unit di ruang autoclave lama\n3. Kerja-kerja elektrikal & IT; tambahan soket elektrik dan soket internet\n4. Kerja-kerja tambahan lain seperti pemasangan kabinet, rak, ruang menyimpan data pesakit & sistem QMS', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '125000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000289', '10000289', '42099901', 'Farmasi JKNJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja-kerja Menaik Taraf Bumbung Bangunan Hayyan Dan Pembinaan Bumbung Pejalan Kaki Antara Bangunan Hayyan Dengan Bangunan Pentadbiran, Bahagian Perkhidmatan Farmasi Jabatan Kesihatan Negeri Johor Serta Lain-lain Kerja Pembaikan Berkaitan', '1. Kerja Awalan\n2. Kerja-kerja menanggal dan melupus bumbung jenis genting lama dan lain-lain berkaitan.\n3. Kerja-kerja membekal dan memasang bumbung jenis metaldeck termasuk perabong dan lain-lain kerja berkaitan termasuk tepi hayyan.\n4. Kerja-kerja memeriksa dan mengganti kayu (gegelung dan kekuda) yang rosak serta kerja-kerja berkaitan\n5.  Kerja-kerja pembinaan laluan pejalan kaki bersaiz 20 kaki x 40 kaki dengan ketinggian 20 kaki termasuk kerja pemasangan tiang konkrit dan bumbung jenis metaldeck yang kedap bunyi dan haba.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '185000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000290', '10000290', '42099901', ' HEBHK KLUANG', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Menaik Taraf Wad Special Care Nursery Di HEBHK, Kluang', 'Menaiktaraf bilik seminar NICU kepada SCN:\n\n1. Tambahan 9 ruangan katil\n2. Tambahan 1 oxygen port , 1 air port , 1 vacum port\n3. Tambahan 10 unit plug (1 unit, 4 plug)\n4. Tambahan 1 unit sinki bercermin di dalam bilik seminar\n5. Memasang water heater dengan pendawaian elektrik di\nkawasan sinki baru\n6. Penukaran pintu masuk bilik seminar kepada pintu sliding\n7. Pemasangan cermin tinted\n8. Pengeluaran wall mounted cabinet di bilik seminar', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '360000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000291', '10000291', '42099901', 'HSAJB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Kerja Penambahbaikan Sistem Elektrik Di Wad Anggerik 3 Di HSAJB', 'Kerja-kerja pendawaian mata soket alur kuasa 3 pin 13A terlitup logam dan pendawaian mata lampu, kerja-kerja membekal dan memasang pemutus litar kecil, MCB 32A kutub tunggal dan kerja-kerja memasang phase bar link, neutral bar link, earth bar link dan pendawaian dalaman lengkap', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '67330.25', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000292', '10000292', '42099901', 'HPSF MUAR', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JOHOR', 'Menaik Taraf Sebahagian Wad 17 Ke PHDU (Paediatrik High Dependency Unit) Di HPSF Muar', 'Menaiktaraf  Medical gas oxygen outlet baru / upgrade serta kerja-kerja paiping\nMenaiktaraf kaunter jururawat serta kerja-kerja lain yang berkaitan\nkerja-kerja membina kabinet fail-fail\nMengubahsuai sinki sedia ada\nKerja pendawaian\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '70000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
