INSERT INTO `tblprojek` VALUES ('10000321', '10000321', '42109901', 'Jabatan Kesihatan Negeri Pahang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PAHANG', 'Kerja Naik Taraf Slab Lantai PU Foam Untuk Mengatasi Masalah Kondensasi Dan Kulat Serta Kerja-kerja Berkaitan Di Unit Dietetik  Hospital Sultan Haji Ahmad Shah Temerloh Pahang', 'Semburan lapisan penebat PU Foam di lantai yang mengalami masalah kondensasi dan kerja-kerja berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000322', '10000322', '42109901', 'Jabatan Kesihatan Negeri Pahang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PAHANG', 'Kerja-kerja Naik Taraf  Bangunan Pentadbiran Lama PKD Untuk Dijadikan Unit Farmasi Logistik Daerah, Di Bawah Penyeliaan  Pejabat Kesihatan Daerah  Jerantut  Serta Lain-lain Kerja Berkaitan', '1. Menaiktaraf sistem elektrikal dan mekanikal mengikut keperluan semasa\n2. Membina ruang penerimaan stok ubat berbumbung di pintu masuk utama unit farmasi logistik termasuk kerja berkaitan\n3. Membina dinding sesekat mengikut keperluan penggunaan ruang\n4. Penggantian tingkap dan pintu mengikut keperluan penggunaan semasa termasuk pemasangan grill\n5. Membekal dan memasang Papan Tanda Farmasi Logistik di kawasan yang di tetapkan\n6. Kerja kerja mengecat dalaman dan luaran bangunan Farmasi\n7. Menyediakan satu unit tandas baru bagi kegunaan kakitangan farmasi\n8. Membekal dan memasang peralatan berkaitan aset tak alih mengikut keperluan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000323', '10000323', '42109901', 'Jabatan Kesihatan Negeri Pahang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PAHANG', 'Kerja-kerja Naik Taraf Laluan Dan Pembinaan Pintu Kecemasan Unit Farmasi Logistik Serta Lain-lain Kerja Berkaitan Di Klinik Kesihatan Padang Tengku, PKD Kuala Lipis', ' 1. Kerja-kerja pembaikan jalan di laluan pintu masuk Unit Farmasi.    \n                                                                   \n2. Kerja-kerja memecah, melepa dan kemasan dinding bilik Stor Farmasi.\n                                                                 \n3.Kerja-kerja membekal dan memasang gypsum board untuk pembahagian stor ubat, stor bukan ubat dan ruang kerja staff farmasi \n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
