INSERT INTO `tblprojek` VALUES ('10000325', '10000325', '42109901', 'Jabatan Kesihatan Negeri Pahang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PAHANG', 'Kerja-kerja Naik Taraf Alarm Panel dan Smoke Detector Serta Lain-lain Kerja Berkaitan Di Bangunan Ibu Pejabat, Jabatan Kesihatan Negeri Pahang', '1. Kerja-Kerja Naik taraf panel alarm di bangunan Ibu Pejabat, JKN Pahang\n2. Kerja-Kerja Naik Taraf Smoke Detector di bangunan Ibu Pejabat, JKN Pahang\n3. Lain-Lain kerja berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000326', '10000326', '42109901', 'Jabatan Kesihatan Negeri Pahang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PAHANG', 'Kerja-kerja Ubah Suai Dan Naik Taraf Bilik Mayat Serta Lain-lain Kerja Berkaitan Di Klinik Kesihatan Tekek, Pulau Tioman, Rompin, Pahang', 'Kerja-kerja membina bangunan  lengkap dengan bumbung, siling, kerja elektrikal, sistem perpaipan dan lain-lain kerja berkaitan seperti ramp. ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
