INSERT INTO `tblprojek` VALUES ('10000328', '10000328', '42109901', 'Jabatan Kesihatan Negeri Pahang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PAHANG', 'Kerja-kerja Pembaikan Awam Dan Pendawaian Elektrik Serta Lain-lain Kerja Berkaitan Di Klinik Desa Merchong, Pekan', '1. Kerja-kerja pembaikan siling rosak.\n2. Kerja pendawaian semula elektrik.\n3. Kerja pembaikan sistem kumbahan dan pembaikan saluran air tandas.\n4. Pembaikan sistem air bersih.\n5. Pembasmian anti kelawar (pest control)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '90000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000329', '10000329', '42109901', 'Jabatan Kesihatan Negeri Pahang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'PAHANG', 'Kerja-kerja Naik Taraf Dan Ubah Suai Di Unit Farmasi Pesakit Luar Hospital Muadzam Shah Bagi Menyediakan Perkhidmatan Nilai Tambah Park & Take Serta Lain-lain Kerja Berkaitan', '1. Kerja-kerja memecahkan bata dan membersihkan Kawasan landskap sediaada seterusnya membuat turapan jalan tar berbitumen yang baru untuk 2 lot parking kereta termasuk kerja mengecat road marking, perkataan Park & Take Only di atas tempat letak kereta serta kerja lain yang berkaitan.\n2. Kerja-kerja memecahkan dinding bata dan mengeluarkan cermin sediaada seterusnya membuat tabletop untuk kaunter Park & Take serta memasang tingkap gelongsor aluminium jenis sliding termasuk kaca jernih.\n3. Kerja-kerja pembinaan bumbung jenis metal deck lengkap dengan rain chain gutter dan aksesori lain.\n4.Kerja pemasangan lampu dan lain-lain yang berkaitan termasuk pendawaian.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '23250.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
