INSERT INTO `tblprojek` VALUES ('10000331', '10000331', '42139901', 'Hospital Sultan Ismail Petra', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Pembaikan Dewan Bedah 2 (OT2) Mutiara Yang Terbakar Serta Kerja -kerja Berkaitan Di Hospital Kuala Krai Lama', '1)    Kerja pembaikan sistem gas perubatan\n2)   Kerja pembaikan sistem elektrik\n3)   Kerja pembaikan siling Dewan Bedah\n4)   Kerja pembaikan insulation foam Dewan Bedah\n5)   Kerja pembaikan Medical Pendant', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
