INSERT INTO `tblprojek` VALUES ('10000333', '10000333', '42139901', 'Hospital Tanah Merah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Ubah Suai, Naik Taraf Dan Pembaikan Wad 1 (Perubatan- Lelaki) untuk Dijadikan Wad Tambahan Pediatrik Termasuk Kerja-kerja Elektrik, ICT, Mekanikal Serta Kerja-kerja Lain Berkaitan Di Hospital Tanah Merah', '1)    Kerja-kerja menaik taraf, ubah suai dan pembaikan Wad 1 (Lelaki) kepada Wad Tambahan Pediatrik \n2)    Kerja-kerja menukar tingkap\n3)    Kerja-kerja memasang jeriji keselamatan \n4)    Kerja-kerja menaik taraf tandas pesakit dan tandas kakitangan kerana tandas yang sedia ada sangat uzur \n5)    Kerja-kerja menaik taraf  ICT, elektrik dan mekanikal \n6)    Kerja-kerja menukar pintu yang sedia ada kepada pintu sliding door beserta pemasangan security door/ access door termasuk Wad NICU    \n7)    Kerja-kerja membekal dan memasang alat penghawa dingin dan kipas pelawas\n8)    Kerja-kerja menaik taraf, ubah suai dan pembaikan laluan antara Wad 1 dan Dewan Bersalin (Labour Room) kerana awning dan lantai sedia ada tidak sesuai untuk digunakan ketika hujan\n9)     Kerja-kerja ubah suai Bilik Isolasi 1 kepada Bilik Penyusuan dan menaiktaraf Bilik Isolasi 2 kepada Bilik Kaunseling     \n10)   Kerja-kerja menaiktaraf dan penggantian sistem gas perubatan\n11)   Kerja-kerja menaiktaraf bedhead panel termasuk kelengkapan \n12)   Kerja-kerja membekal dan memasang kaunter   \n13)   Kerja-kerja mengecat keseluruhan wad   \n14)   Kerja-kerja pemasangan perabot jenis lekapan dinding                                                                                                                                                         ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000334', '10000334', '42139901', 'Hospital Gua Musang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf Ruangan Wad Bayi Kepada Unit NICU  Serta Kerja-kerja Lain Berkaitan Di Hospital Gua Musang', '1)     Kerja-kerja naik taraf Sistem Gas Perubatan, Vacuum dan O2 \n2)     Kerja-kerja naik taraf sistem elektrik dan pendawaian mengikut standard Wad NICU\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000335', '10000335', '42139901', 'HRPZII', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf, Ubah Suai Dan Pembaikan di Zon Merah Jabatan Kecemasan Dan Trauma Hospital Raja Perempuan Zainab II Serta Lain-lain Kerja Berkaitan', '1)     Kerja-kerja meroboh dinding, dan siling serta menanggal pendawaian sedia ada.\n2)     Kerja-kerja membina kaunter jenis built-in\n3)     Kerja-kerja memasang railing dari jenis heavy dut\n4)     Kerja-kerja menaik taraf struktur bumbung bagi menampung beban\n5)     Kerja-kerja membina dinding baru termasuk pintu di lokasi yang terlibat\n6)     Kerja-kerja mengecat di kawasan terlibat\n7)     Kerja-kerja menaik taraf kaunter\n8)     Kerja-kerja pemasangan siling baru\n9)     Kerja-kerja membina bilik UPS dan bilik bateri UPS\n10)   Kerja-kerja naik taraf dan uba suai asthma bay dan stor pakai buang Zon Merah\n11)   Kerja-kerja elektrik di Zon Merah\n12)   Kerja-kerja mekanikal di Zon Merah\n13)   Kerja-kerja ICT dan ELV di Zon Merah', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '495000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
