INSERT INTO `tblprojek` VALUES ('10000337', '10000337', '42139901', 'JKN/PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Mengubahsuai Bilik Persampelan Dan Stor untuk Dijadikan Farmasi Serta Kerja-kerja Berkaitan Di Klinik Kesihatan Machang', 'Kerja-kerja membekal dan menambah ruang Farmasi yang terdiri dari kaunter farmasi,ruangan menunggu, bilik methadone, substor ubat dan bukan ubat', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000338', '10000338', '42139901', 'JKN/PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf Fasiliti Serta Kerja-kerja Berkaitan Di Klinik Kesihatan Chiku 3, Gua Musang, Kelantan', 'Kesihatan Awam\n\n1) Kerja-kerja membina ruang menunggu melibatkanbumbung, tiang, pelantaian dan pendawaian elektrik\n2) Kerja-kerja pembinaan fever center lengkap dengan pendawaian\n3) Kerja-kerja naik taraf longkang klinik sedia ada\n\nFarmasi\n1) Kerja-kerja pembaikian dan pemasangan kaunter farmasi\n2) Kerja-kerja pendawaian elektrik di unit farmasi\n3) Kerja-kerja pembinaan kabinet ubat jenis lekapan dinding di ruang kerja farmasi pesakit luar\n4) Kerja-kerja pemasangan dinding dan pintu bilik kaunseling\n5) Kerja-kerja meroboh kabinet konkrit sedia ada di dalam stor ubat supaya ruang lebih luas', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '225000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000339', '10000339', '42139901', 'JKNK', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf Dan Pembaikan Siling Dan Bumbung Pejabat Cawangan Pendidikan Kesihatan Negeri Serta Kerja-kerja Berkaitan Di Pengkalan Chepa, Kota Bharu, Kelantan', 'Kerja-kerja penggantian siling dan bumbung baharu oleh kontraktor dengan keluasan keseluruhan bangunan 3,650 kaki persegi\n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
