INSERT INTO `tblprojek` VALUES ('10000345', '10000345', '42139901', 'PKPD Kuala Krai', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf Bilik Rawatan Dan Infrastuktur Di Klinik Pergigian Kuala Krai Serta Kerja-kerja  Berkaitan', '1.     Kerja-kerja penggantian sebahagian sistem pendawaian elektrik kerana sebahagian sistem sedia ada tidak mampu menampung penggunaan pertambahan peralatan dan risiko kejadian litar pintas. \n2.     Kerja-kerja menaiktaraf bilik rawatan,kawasan parkir serta kerja kerja mengecat keseluruhan bangunan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
