INSERT INTO `tblprojek` VALUES ('10000350', '10000350', '42139901', 'PKD Kuala Krai', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Ubah Suai Bangunan Kuarters Lama Kepada Unit Farmasi Serta Kerja -kerja Lain Berkaitan Di Klinik Kesihatan Laloh', '1)     Kerja- kerja membaiki bumbung kuarters yang bocor.\n2)     Kerja - kerja memasang Chipboard untuk memisahkan antara ruang menunggu dan ruang dispensing.  \n3)     Kerja - kerja membekal dan memasang kaunter dispensing (bersama 3 kerusi kaunter) dan tingkap sliding untuk dijadikan kaunter terbuka.\n4)     Kerja - kerja menebuk dinding dan memasang pintu untuk dijadikan laluan masuk antara bilik kaunselling ke stor ubat. \n5)     Kerja-kerja pendawaian dan pemasangan aksesori berkaitan\n6)     Kerja - kerja membekal dan memasang penyaman udara di ruang menunggu, bilik kaunseling, kaunter pengisian dan ruang ektemporenous, stor ubat dan stor bukan ubat.  \n7)     Kerja - kerja membekal dan memasang kabinet untuk simpanan ubat di stor ubat dan di kaunter pengisian, dan juga memasang kabinet untuk simpanan bukan ubat di stor bukan ubat.\n8)     Kerja - kerja membekal dan memasang meja pengisian di ruang pengisian (bersama kerusi).\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '64000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
