INSERT INTO `tblprojek` VALUES ('10000365', '10000365', '42139901', 'PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf Ruang Kecemasan Dan Infrastruktur Serta Kerja-kerja Berkaitan Di Klinik Kesihatan Bunohan, Tumpat, Kelantan.', '1. Kerja mengubahsuai dinding bangunan sediada mengikut kesesuaian Ruang Kecemasan \n 2. Membaikpulih struktur bumbung yang rosak \n 3. Memasang tingkap dan pintu baru \n 4. Memasang unit penghawa dingin di ruang kecemasan \n 5. Mengecat bangunan klinik \n 6. Menyediakan pondok pengawal keselamatan\n7. Lain-lain pembaikan ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
