INSERT INTO `tblprojek` VALUES ('10000367', '10000367', '42139901', 'JKN/PKD', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf Laluan Masuk Unit Kecemasan Serta Kerja-kerja Berkaitan Di Klinik Kesihatan Kuala Balah, Jeli, Kelantan', '1. Kerja-kerta pembinaan awning dan ruang berbumbung bertetulang besi di laluan kecemasan serta kerja-kerja berkaitan \n2. Kerja -kerja pendawaian elektrik bagi lampu dan kerja-kerja berkaitan  ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '20000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000368', '10000368', '42139901', 'JKNK', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'KELANTAN', 'Kerja-kerja Menaik Taraf Bangunan Serta Kerja-kerja Berkaitan Di Pejabat Cawangan Kawalan Penyakit Kota Bharu, Kelantan', '1.     Kerja-kerja mengecat seluruh bangunan pejabat yang telah kusam dan lusuh \n2.     Mengecat seluruh pagar yang telah lusuh', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '60000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
