INSERT INTO `tblprojek` VALUES ('10000372', '10000372', '42129901', 'CSFB', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Naik Taraf Sistem Fire Hydrant Fasa 2 Di Hospital Sultanah Nur Zahirah Kuala Terengganu', 'Kerja-kerja penggantian perpaipan underground bagi System Fire Hydrant dengan menggunakan GI pipe class C saiz 6\' (above ground) sepanjang 727m bagi 11 nos hydrant', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000373', '10000373', '42129901', 'Pejabat Kesihatan Daerah Kuala Terengganu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Naik Taraf Bangunan Dan Infrastruktur Di Klinik Desa Pengadang Baru, Kuala Terengganu. ', '1. Bangunan - Pembaikan dan Naiktaraf Bangunan termasuk struktur, bumbung, sistem kejuruteraan, sistem bekalan air dan sistem kumbahan.\n2. Infrastruktur - Pembaikan sistem perparitan, jalan dan pagar', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000374', '10000374', '42129901', 'Pejabat Kesihatan Daerah Besut', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Membaikpulih Kerosakan Tandas Dan Saluran Kumbahan Tersumbat Di Kuarters Anggota Klinik Kesihatan Sri Medang,  Besut', '1. Kerja-kerja mengetuk jubin sedia ada yang pecah dan menggantikan yang baharu.\n2. Kerja-kerja membaiki dan menggantikan mangkuk tandas termasuk sistem perpaipan.\n3. Kerja-kerja membaikpulih saluran kumbahan dan mainhole\n4. Kerja-kerja membaikpulih dinding dan menampal semula diinding-dinding berlubang.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '106160.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000375', '10000375', '42129901', 'Pejabat Kesihatan  Pergigian Daerah Kuala Terengganu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-Kerja Naik Taraf Dan Ubah Suai Lot 4 Dan Lot 6 Di Klinik Pergigian Air Jernih, Kuala Terengganu', '1) Kerja-kerja awalan yang berkaitan\n2) Kerja menyediakan permukaan lantai untuk menerima jubin serta kerja membekal dan memasang jubin baru pada tapak slab ruang dalaman di lot 4 dan lot 6 serta kerja berkaitan. \n3) Mengadakan dinding baru bagi  bilik dengan memasang sesekat kepingan gypsum berkerangka/bingkai aluminium yang terdiri dari bahagian atas bawah, stiles dan belebas dari keluli tertekan tergalvani, di baluti kedua belah dengan 12mm kepingan gypsum, dipasang mengikut arahan pembuat di lot 4 dan lot 6.\n4) Mengadakan dinding baru bagi  bilik serbaguna dengan memasang sesekat kepingan \'Cement Board\' berkerangka/bingkai aluminium yang terdiri dari bahagian atas bawah, stiles dan belebas dari keluli tertekan tergalvani, di baluti kedua belah dengan 12mm kepingan gypsum, dipasang mengikut arahan pembuat .\n5) Kerja membekal dan memasang 12mm tebal kepingan siling akustik gentian mineral dipasang pada, termasuk tee terdedah aluminium beranod semulajadi dalam grid 600mmx1200mm, digantung dengan dan termasuk dawai penyangkut besi tergalvani tolok 14, digantung dari gulung-gulung bumbung, atau dengan eyelet pins dari sofit lantai konkrit di ruang dalaman bangunan yang terlibat serta kerja berkaitan di lot 4 dan lot 6.\n6) Membekal, kerja-kerja memplaster dinding bilik xray dengan plaster barium serta kerja-kerja berkaitan.\n7) Membekal, memasang pintu panel kayu berketam, kerangka termasuk aksessori sedia-ada ( kunci & Door Closer) dan kerja-kerja berkaitan.\n8) Memasang dan membekal jerejak (grille/1.2mm thk) dari besi pada pintu dan tingkap termasuk bolt dan semua kelengkapan yang perlu serta mengecat dan kerja berkaitan.\n9) Kerja-kerja penyediaan permukaan serta membekal dan menyapu satu lapisan cat alas (sealer) dan dua lapisan cat penyudah (kemasan) jenis imulsi pada permukaan berlepa, batu, konkrit bahagian dalam bangunan  serta kelengkapan dan lain-lain berkaitan\n10).Kerja membekal, membina dan memasang konkrit \'table top L-Shape \' mengikut spesifikasi yang ditetapkan di makmal basah  termasuk aksesory yang berkaitan \n11).Kerja membekal, membina dan memasang konkrit \'table top L-Shape \' mengikut spesifikasi yang ditetapkan di  ruang pantry termasuk aksesory yang berkaitan \n12)Kerja membekal, membina dan memasang kabinet  di bilk X-Ray termasuk aksesori yang berkaitan\n13) Kerja membekal, membina dan memasang kabinet kerja  di bilik rawatan yang mengandungi item kerja seperti di BQ\n14) Kerja mengadakan rumah kompresor dengan sistem bekalan seperti berikut ;\n- Air pipe (Copper - 15mm dia.)\n- Pintu Kabinet Jenis Aluminium bersisip angin\n15) Kerja menanggal unit Fume Cupboard sedia di bangunan KPAJ lama dan pemasangan semula unit yang sama di lokasi bangunan baru serta kerja kerja berkaitan.\n16.Kerja-kerja Mekanikal & Elektrikal sebagaimana BQ\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                                                                             \n\n\n\n\n\n\n\n\n\n\n\n\n\n\"', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '230000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000376', '10000376', '42129901', 'Pejabat Kesihatan Daerah Setiu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Mengubahsuai Bilik Methadone Kepada Stor Ubat Unit Farmasi Serta Kerja-Kerja Berkaitan Di Klinik Kesihatan Permaisuri, Setiu', 'Kerja-kerja pengubahsuaian bilik methadone kepada stor ubat farmasi.\n1. Kerja-kerja ikat bata dan melepa untuk pembahagian bilik antara stor dengan bilik methadone\n2. Kerja-kerja ikat bata dan melepa ruang pintu lama\n3. Kerja-kerja mengecat didalam stor termasuk dinding, pintu, dan bingkai tingkap\n4. Kerja-kerja pendawaian semula didalam stor termasuk pengalihan kedudukan \'aircond\', kedudukan \'point plug\'\n5. Kerja-kerja menukar \'DB Box Casing\' sedia ada kepada jenis patuh piawai Suruhanjaya Tenaga\n6. Kerja-kerja menukar tingkap nako kepada tingkap dedaun yang lebih sesuai untuk ruang berhawa dingin.\n7. Kerja-kerja memasang \'grill\' tingkap dan pintu stor.\n8. Kerja-kerja menukar pintu sedia ada kepada jenis \'solid wood\' yang telah diketam dan dicat\n9. Membekal dan memasang 2 unit penyaman udara 1.5HP dengan fungsi auto-penggiliran\n10. Membekal dan memasang rak \'heavy duty\' untuk penyimpanan stok ubat\n11. Kerja-kerja pemasangan \'awning\' dihadapan stor\n12. Kerja-kerja rawatan anai-anai dan serangga perosak\n13. Membekal palet haevy duty untuk penstoran stok ubat\n14. Membekalkan 1 unit troli heavy duty bersaiz medium untuk memunggah stok ubatan\n15. Kerja-kerja perpaipan untuk pengalihan sinki sedia ada \n\n    \n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '65000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000377', '10000377', '42129901', 'Hospital Sultanah Nur Zahirah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Ubah Suai Dan Naik Taraf Kaunter Pendaftaran Utama Jabatan Pesakit Luar, Hospital Sultanah Nur Zahirah Dan Kerja-kerja Berkaitan', 'a. Kerja Kerja Merobohkan kaunter sedia ada dan menanggalkan \"signage\" utama kaunter pendaftaran.\nb. Kerja kerja Melebarkan bahagian dalam sebanyak 6 kaki dari meja  Kaunter Pendaftaran\nc. Kerja kerja membekal dan Memasang  meja kaunter pendaftaran baru jenis Formika pada ketinggian 38 inci  dan lebar 42 inci serta panjang 355 inci .\nd. Kerja kerja Pembaikian dinding \"Semin Board\" yang rosak dan mengecatnya semula dalam kaunter pendaftaran\ne. Kerja Kerja membekal dan  Memasang kipas dinding baru sebanyak  3 buah\nf. Kerja Kerja Memasang dan membekalkan kabinet bawah kaunter pendaftaran \ng. Kerja Kerja Membekalkan dan memasang  cermin kaca pada kaunter pendaftaran tersebut\nh. Kerja Kerja membekal dan memasang Mozek baru bahagian dalam Kaunter Pendaftaran.\nI. Membekal dan memasang sinage berkaitan pada Ruangan Kaunter.\nj. Kerja Kerja membekal dan memasang Penghawa dingin 2.5 hp termasuk aksesori dan Kelengkapan Berkaitan\nK. Kerja Kerja Pendawaian Hawa dingin 2.5hp dengan punca kuasa dan Dol Starter dengan menggunakan kabel berkaitan dari DB berdekatan\nl. Kerja kerja membekal dan memasang kabel dan point  internet dan elektrik pada kaunter pendaftaran\nm. Membekalkan Kerusi Kaunter untuk petugas Kaunter sebanyak 5 Buah\nn. Membekalkan Meja  \" Medikal Check up\" berketinggian 3 kaki untuk kegunaan Pelanggan \no. Membekal dan memasang  Pintu masuk kaunter lama kepada yang baru\np. Membekal dan memasang telefon baru di Kaunter\nq. kerja Kerja Membekal dan memasang Lampu LED  untuk pencahayan yang baik di Kaunter', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '40000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000378', '10000378', '42129901', 'Pejabat Kesihatan Daerah Kuala Terengganu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Membina Ruang Tambahan Di Unit Rehabilitasi, Klinik Kesihatan Manir Lama, Kuala Terengganu ', '1. Kerja-kerja naiktaraf bumbung serta membina ruang tambahan dengan binaan batu bata \n2. Kerja-kerja membina fix partition menggunakan cement board\n3. kerja-kerja pendawaian elektrik\n4. kerja-kerja membekal dan memasang aircond\n5. Kerja-kerja mengecat dan membaikpulih dinding sediaada\n6. Kerja-kerja naiktaraf sistem bekalan air dan pembentungan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '265000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000379', '10000379', '42129901', 'Pejabat Kesihatan Daerah Besut', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Menaik Taraf Unit Makmal Serta Kerja-kerja Berkaitan Di Klinik Kesihatan Jabi, Besut', '1. Kerja-kerja menaiktaraf ruang menunggu kepada ruang makmal  \n2. Kerja-kerja membina table top makmal\n3. kerja-kerja pendawaian elektrik\n4. kerja-kerja membekal dan memasang aircond\n5. Kerja-kerja mengecat dan membaikpulih dinding\n6. Membina susur gajah.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000380', '10000380', '42129901', 'Jabatan Kesihatan Negeri Terengganu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Naik Taraf Dan Ubah Suai Ruang Tingkat 4 Wisma Persekutuan Kepada Stor Ekshibit Penguatkuasaan Pergigian, Stor Promosipergigian, Stor Alat Tulis Dan Stor Transit Pelupusa, Jabatan Kesihatan Negeri Terengganu', '1. Kerja membina stor ekshibit penguatkuasaan pergigian mengikut spesifikasi yang ditetapkan merangkumi dinding dan pintu jenis teguh dan tidak mudah terbakar, pemasangan grill serta kerja-kerja yang berkaitan. \n2. Kerja-kerja membina tambahan bilik untuk dijadikan stor alat tulis dan stor transit pelupusan merangkumi dinding daripada material Gypsum beserta pintu, grill dan kerja-kerja yang berkaitan\n3. Kerja-kerja menaiktaraf, membaiki dan menyelenggara dinding sedia, siling dan lantai \n4. Kerja-kerja pendawaian elektrik, internet dan telefon di ruang-ruang yang ditetapkan\n5. kerja-kerja mengalihkan pintu dan membina semula dinding baru\n6. Kerja-kerja perapian seperti mengecat dan lain-lain\n7. kerja-kerja membina, membekal dan memasang kabinet berpintu dan kabinet terbuka bagi tempat penyimpanan di tempat yag ditetapkan\n8.Kerja-kerja membekal rak besi heavy duty 4 tingkat bagi penyimpanan stok\n9. Kerja-kerja memasang langsir / tirai serta \'rollerblade\' berukuran termasuk kerja-kerja berkaitan. \n10.Kerja-kerja kebersihan  selepas kerja-kerja dijalankan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000381', '10000381', '42129901', 'Pejabat Kesihatan Daerah Kemaman', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Mengubahsuai Kuarters Klinik Kesihatan Chukai Untuk Dijadikan Unit Farmasi Logistik, Pejabat Kesihatan Daerah Kemaman', '1. Pembaikan lantai \n2. Pembaikan dinding yang rosak\n3. Penggantian siling asbestos kepada plasters siling\n4. Kerja mengecat dinding luar dan dalam\n5. Penggantian atap asbestos kepada atap dek logam\n6. Kerja membekal dan memasang kaunter penerimaan serta kerja - kerja yang berkaitan dengannya.\n7. Kerja membekal w/station termasuk kerusi.\n8.Kerja-kerja membekal dan memasang rak besi bertingkat \n9. Kerja baikpulih tandas sedia-ada.\n10. Kerja pendawaian elektrik\n11. Kerja-kerja mekanikal (Pemasangan aircond,exhaust fan,cctv)\n12.Kerja-kerja pembasmian anai-anai', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000382', '10000382', '42129901', 'Hospital Sultanah Nur Zahirah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Naik Taraf Dan Ubah Suai Ruang Lobi Priba (Depan Hasil) Untuk Dijadikan Bilik Unit Laktasi Di Hospital Sultanah Nur Zahirah', 'Skop kerja terlibat :\n1. Pemasangan wall partition bagi mewujudkan ruang bilik kaunseling dan ruang kerja MO\n2. Pemasangan kabinet untuk fail dan simpanan peralatan. \n3. Pemasangan sink basuh tangan dan sistem perpaipan yang berkaitan.\n4. Kerja-kerja bekalan peralatan mengikut kontrak yang telah dipersetujui.\n5. Kerja-kerja pemasangan sistem penghawa dingin.\n6. Membekal dan memasang 2 unit komputer dan 2 unit printer \n7. Pemasangan telefon\n8. Signage', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '30000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000383', '10000383', '42129901', 'Pejabat Kesihatan Daerah Hulu Terengganu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Naik Taraf Kecemasan Di Klinik Kesihatan Kuala Telemong, Hulu Terengganu', '1. Kerja-kerja menambah rail langsir\n2. Kerja-kerja pembaikan ruang sedia ada\n3. Kerja-kerja laluan susur gajah daripada kecemasan kepada UPL\n4. Kerja-kerja pembinaan garaj ambulan\n5. Kerja-kerja elektrik\n6. Kerja-kerja pembaikan semula tandas', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '160000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000384', '10000384', '42129901', 'Pejabat Kesihatan Daerah Besut', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Membaiki Sistem Perpaipan Di Klinik Kesihatan Padang Luas, Besut Serta Kerja-kerja Yang Berkaitan.', '1. Membekal dan memasang water pump inverter for agriculture system bagi rumah pump kuarters\n2. Kerja-kerja membaikpulih panel water pump system termasuk menggantikan fius, soket, kawalan automatik, relay, starters dan sistem pemula di kuarters dan klinik\n3. Kerja-kerja pengujian dan pentauliahan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '20000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000385', '10000385', '42129901', 'Pejabat Kesihatan  Pergigian Daerah Hulu Terengganu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Naik Taraf Klinik Pergigian Kuala Telemong, Hulu Terengganu Fasa 2', '1. Kerja-kerja mekanikal dan elektrikal  iaitu kerja-kerja membekal, memasang dan mentauliah penghawa dingin dan QMS sistem \n2. Kerja-kerja merekabentuk, membekal, memasang built-in kabinet dan kabinet gantung di bilik rawatan , bilik sucihama dan makmal pergigian\n3. membekal alat-alat bagi melengkapkan fungsi ruang ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '140500.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000386', '10000386', '42129901', 'Hospital Sultanah Nur Zahirah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Naik Taraf Ruang Koridor Pusat Rawatan Harian (Acc) Dan Kerja-kerja Lain Berkaitan  Di Hospital Sultanah Nur Zahirah Kuala Terengganu', 'Penyediaan ruang koridor tambahan yang melibatkan kerja-kerja:\n1. pembinaan bumbung, siling, tiang &dinding\n2. pemasangan sliding door\n3. pemasangan sistem penghawa dingin\n4. pemasangan gutter\n5. pembinaan longkang\n6. Membekal kerusi pelawat \n7. Anggaran keluasan30 meter x 63 meter', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '120000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000387', '10000387', '42129901', 'Pejabat Kesihatan Daerah Setiu ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Pendawaian Semula Dan Penggantian Lampu Kawasan Compound Di Klinik Kesihatan Sri Langkap, Setiu', 'Pembaikian lampu compound/kawasan di keseluruhan dalam bangunan klinik kesihatan. Kerja pemeriksaan dan naik taraf pendawaian, penggantian mentol serta kerja berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
