INSERT INTO `tblprojek` VALUES ('10000389', '10000389', '42129901', 'Hospital Kemaman', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Menaik Taraf Ruang Menunggu Dan Kerja-kerja Lain Berkaitan  Di Jabatan Kecemasan Dan Trauma, Hospital Kemaman', 'Pembinaan ruang tambahan di bahagian hadapan Jabatan Kecemasan (primary triage) dengan keluasan 160 m persegi  untuk dijadikan ruang menunggu baru, kaunter triage dan farmasi pandu lalu.\n\nskop pembinaan struktur baru dan kerja-kerja mekanikal, elektrikal, reka bentuk semula bumbung sedia ada dan kerja-kerja berkaitan.\n\nmeroboh farmasi pandu lalu sedia ada (untuk laluan ambulan)\n\npembelian peralatan perubatan\n\npembelian perabot dan peralatan pejabat\n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
