INSERT INTO `tblprojek` VALUES ('10000391', '10000391', '42129901', 'Pejabat Kesihatan Daerah Dungun', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-Kerja Naik Taraf CAC/Fever Centre Klinik Kesihatan Di Klinik Kesihatan Jerangau, Dungun', 'Kerja-kerja membekal dan memasang awning dengan kerangka besi mengikut arahan penguasa dan pengilang', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '40000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000392', '10000392', '42129901', 'Cawangan Senggara Fasiliti Bangunan (JKNT)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Menaiktaraf Ruang Kerja Di Unit Farmasi Dan Makmal Klinik Kesihatan Bukit Besi, Dungun', '1. Kerja-kerja membina bangunan tambahan (anggaran keluasan = 2100ft2)\n 2. Kerja-kerja mekanikal dan elektrikal\n 3. Kerja-kerja menaik taraf unit farmasi dan logistik (cadangan digabungkan dengan menaik taraf Unit Makmal)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '423340.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000393', '10000393', '42129901', 'Cawangan Senggara Fasiliti Bangunan (JKNT)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Kerja-kerja Mengubah Suaian Kuaters KK Telemong Kepada Klinik Pergigian Kuala Telemong, PKPD Hulu Terengganu', '1. Kerja-kerja ubah suai bangunan asal kuarters bagi menempatkan \n  a) 2 bilik rawatan baru\n  b) 1 makmal basah dan kering\n  c) 1 bilik rawatan integrasi bilik xray\n  d) 1 bilik pegawai pergigian dan juruterapi pergigian\n  e) 1 bilik sucihama\n  f) 1 stor bahan pergigian\n 2. Kerja-kerja membina bangunan tambahan bagi menempatkan\n  a) ruang menunggu\n  b) 2 tandas\n  c) 2 bilik rekod\n  d) 1 bilik pegawai pergigian Yang Menjaga\n  e) 1 bilik juruterapi kanan\n 3. Kerja-kerja eletrikal dan mekanikal berkaitan di ruang tambahan yang dimohon.\n 4. Kerja-kerja membina saluran paip air dan sink di bilik-bilik berkaitan.\n 5. Kerja-kerja membina kabinet lantai (table top) dan kabinet gantung berpintu di makmal, bilik sucihama dan bilik rawatan.\n 6. Kerja-kerja mengecat keseluruhan ruang luar dan dalam bangunan sedia ada dan bangunan tambahan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000394', '10000394', '42129901', 'Cawangan Senggara Fasiliti Bangunan (JKNT)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'TERENGGANU', 'Naik Taraf Sistem Bumbung Bangunan Klinik Pakar Dan Kerja-kerja Berkaitan Di Hospital Besut, Terengganu', 'a) Membuka dan membuang bumbung serta kekuda bumbung anggaran 2008m2 termasuk sistem kejuruteraan pada kerangka\nb) Menanggalkan lapisan waterproofing sedia ada dan re-waterprofing bumbung rata teramasuk pembaikan\nc) Merekabentuk semula struktur kekuda bumbung dan pemasangan jenis atap yang bersesuaian.\nd) Merekabentuk semula sistem saliran air hujan\ne) Pendawaian semula sistem kejuruteraan yang terlibat serta kerja-kerja pertauliahan dan pengujian', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '1500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000395', '10000395', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan / Pejabat Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Membina Bangunan Tambahan Bagi Perkhidmatan Unit Pesakit Luar,Unit Farmasi,Unit Makmal , Unit Klinik Kesihatan Ibu Dan Anak, Unit Pergigian Dan Kerja-kerja Berkaitan Di Klinik Kesihatan Padas Damit', '1.Kerja -kerja struktur\n2.Kerja -kerja pintu dan jendela\n3.Kerja-kerja kekuda dan bumbung\n4.Kerja-kerja kemasan\n5.Kerja-kerja perpaipan dan saluran\n6.Kerja -kerja elektrik dan tambahan aksesori', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '750000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000396', '10000396', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Menaik Taraf Ruang Bangunan Bagi Unit Farmasi, Unit Makmal, Unit Pesakit Luar Dan Unit Kecemasan Bagi Persediaan Decanting Klinik Kesihatan Membakut Di Klinik Desa Pimping                                           ', '1.Kerja -kerja struktur\n2.Kerja -kerja pintu dan jendela\n3.Kerja-kerja kekuda dan bumbung\n4.Kerja-kerja kemasan\n5.Kerja-kerja perpaipan dan saluran\n6.Kerja -kerja elektrik dan tambahan aksesori', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '600000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000397', '10000397', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Ubah Suai Ruang Klinik Di Bangunan Tambahan Klinik Kesihatan Putatan Dan Lain-lain Kerja Yang Berkaitan', '1. Kerja-kerja awam seperti pemasangan dinding gypsum dan siling.                                                              2. Kerja-kerja mekanikal seperti pemasangan paip air dan penghawa dingin                                                                                                           3. Kerja-kerja elektrik seperti pendawaian elektrik bagi lampu dan soket elektrik.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '390000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000398', '10000398', '42149901', 'Jabatan Kesihatan Negeri Sabah/ Pejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Membina Bangunan Tambahan Blok Pesakit Luar Dan Lain-lain Kerja Berkaitan Di Klinik Kesihatan Ibu Dan Anak Beaufort', '1.Kerja -kerja awalan dan struktur\n2.Kerja -kerja pintu dan jendela\n3.Kerja-kerja kekuda dan bumbung\n4.Kerja-kerja kemasan\n5.Kerja-kerja perpaipan dan saluran\n6.Kerja -kerja elektrik dan tambahan aksesori', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '674000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000399', '10000399', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Projek Naik Taraf & Ubah Suai Unit Farmasi Logistik Pejabat Kesihatan Kawasan Sandakan', '1. Membina ruang penyimpanan tetap untuk stok PPE.\n2. Membina ruang berasing untuk stor gas osigen dan bahan mudah terbakar.\n3. Menambah ruang pejabat pengurusan Unit Farmasi Logistik.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000400', '10000400', '42149901', 'Sedafiat Sdn Bhd', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Lantai Dan Dinding Makmal Virologi 1 Di Seksyen Penyakit Berjangkit Dan Menaik Taraf Stor Bahan Pakai Buang Unit Virologi Di Makmal Kesihatan Awam Kota Kinabalu Dan Lain-lain Kerja Yang Berkaitan', 'Melibatkan kerja-kerja naiktaraf lantai dan dinding yang mengalami kerosakan.Melibatkan kerja-kerja pemasangan lantai vinyl yang baru, kerja-kerja mengecat serta kerja-kerja elektrikal dan mekanikal.\nMelibatkan kerja-kerja menaiktaraf satu stor yang baru untuk unit Virologi. Melibatkan kerja-kerja struktur awam, elektrikal dan mekanikal.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000401', '10000401', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Mengubahsuai Keluasan Bangunan Dan Kerja-kerja Yang Berkaitan Bagi Klnik Kesihatan Mesej Pangi, Kunak Sabah', 'Kejuruteraan awam:                                                                                                                         \n1. Kerja-kerja perubahan struktur bangunan.\n                                                         \n Kejuruteraan mekanikal:                                                                                                                                                                                            1. Kerja-kerja perubahan struktur bumbung bagi sistem kerangka atap.\n              \nKejuruteraan elektrik:                                                                                                                                                                   1. Kerja-kerja pendawaian semula bagi sistem elektrik                        ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '160000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000402', '10000402', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Pembaikan Kecil Dan Sistem Perparitan Di Klinik Kesihatan Rosok, Kota Belud Dan Lain-lain Kerja Berkaitan', 'Kerja-kerja pembaikan siling bangunan kliinik dan kuarters yang reput , pembaikan dan penyelenggeraan sistem perpaipan dan kerja-kerja pembaikan laluan masuk termasuk pintu pagar klinik.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '85000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000403', '10000403', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Menaik Taraf Ruang Menunggu Dan Bangunan Klinik Desa Mengkabong, Tuaran Dan Lain-lain Kerja Yang Berkaitan', 'Kerja-kerja menaiktaraf ruang menunggu, pembaikan atap, tandas, naiktaraf pendawaian termasuk lampu, kipas dan lain-lain kerja yang berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '180000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000404', '10000404', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Bangunan Termasuk Membina Tandas Khas Makmal Untuk Pengambilan Sample Di Makmal Klinik Kesihatan Kinarut, Papar', 'Bina baru tandas khas pesakit di unit makmal.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000405', '10000405', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Pembinaan Stor Minyak Klinik Kesihatan Pegalungan', 'Kerja-kerja Pembinaan Stor Minyak Klinik Kesihatan Pegalungan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000406', '10000406', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja -kerja Menaik Taraf Bilik Kecemasan Dan Kaunter Farmasi Serta Lain-lain Kerja Berkaitan Klinik Kesihatan Batu Putih, Kinabatangan', 'Membekal dan memasang awning 12 kaki X 30 kaki.                                                                                  Membina tiang besi dan siling.                                                                                        Memasang dinding cement board 12kaki X 30 kaki.                                                              Pecah dinding konkrit bilik kecemasan dan bina pintu yang baru.                                                                  Membekal dan memasang tiles 12kaki X 30 kaki.                                                              Pendawaian lampu kalimantang, kipas dan soket.                                                           Membekal dan menukar  bumbung stor dan  kaunter Farmasi.                                                                               Pendawaian emergency light LED dan emergency exit LED surface type.  ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '42500.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000407', '10000407', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf  Ruang Menunggu, Bangunan Dan Ubah Suai  Makmal Klinik Kesihatan Likas', '1. Menggantikan bumbung, menggantikan siling, mengecat semula bangunan dalam dan luar, membina awning untuk ruang menunggu dan ubahsuai makmal                                                                                                    2. Kerja-kerja elektrikal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000408', '10000408', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Di Bangunan Pesakit Luar, Makmal, Bilik Rekod Pesakit, Unit Farmasi Pesakit Luar Dan Bangunan Pusat Maklumat Pemakanan Di Klinik Kesihatan Penampang Dan Lain-lain Kerja Yang Berkaitan', '1. Kerja-kerja awam seperti pembinaan dinding dan siling                                                           \n2. Kerja-kerja pendawaian elektrik termasuk penambahan lampu dan soket elektrik                                                                                                              3. Penambahan sinki termasuk kerja-kerja perpaipan                                             4. Kerja-kerja mekanikal seperti penambahan penghawa dingin\n5. Kerja-kerja awam seperti penggantian jubin termasuk kerja-kerja mengecat.                                                                                                       ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '345000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000409', '10000409', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Klinik Kesihatan Ibu Dan Anak Kota Marudu Dan Pejabat Kesihatan Daerah Kota Marudu Dan Lain-lain Kerja Yang Berkaitan', 'Melibatkan kerja-kerja naiktaraf ruang bangunan MCH dan pejabat kesihatan daerah. Termasuk membina ruang farmasi dan makmal yang baru.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '213000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000410', '10000410', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Menaik Taraf Makmal Keselamatan & Kualiti Makanan Dan Lain-lain Kerja Yang Berkaitan Di Bahagian Kualiti Dan Keselamatan Makanan, Sandakan', '1. Menaik taraf bilik pegawai dan ruang kerja Unit Keselamatan & Kualiti Makanan.  \n2. Membina bilik stor penyimpanan barang-barang.\n3. Membina bilik penyimpanan kebinet fail-fail, peralatan promosi dan barang persempelan makanan.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000411', '10000411', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Kesihatan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Menaik Taraf Ruang Kerja Unit Farmasi Di Klinik Kesihatan Felda Sahabat', '1. Kerja-kerja membina dinding menggunakan gypsum board double walling.\n2. Kerja-kerja membina tabletop ruang kerja.\n3. Kerja-kerja elektrik dan mekanikal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '125000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000412', '10000412', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja - kerja Pembaikan Bangunan Klinik Pergigian Kudat', '1. Kerja-kerja pembaikan bumbung bocor dan penggantian siling yang telah rosak pada ruang kerja kaunter pergigian dan makmal pergigian.                                                                                        \n2. Penggantian 4 unit tiang kayu bangunan klinik yang telah reput.                                                                            \n3. Penggantian keseluruhan rain gutter yang telah reput dan rosak di sekeliling bangunan Klinik Pergigian Kudat.                                              \n4. Kerja - kerja penggantian sistem perpaipan di sinki makmal pergigian yang telah rosak.\n5. Kerja - kerja ubah suai ruang sedia ada di bilik Pasukan Pergigian Bergerak bagi menyediakan ruang bilik perbincangan serta bilik untuk pemandu kenderaan pasukan. \n6. Kerja - kerja pendawaian elektrik dan kerja - kerja perpaipan yang perlu bagi ruang kerja baru yang diwujudkan.\n7. Kerja - kerja pemasangan lapisan tinted dan jeriji keselamatan pada 4 unit bilik rawatan dan 1 bilik ruang pejabat sahaja.\n8. Kerja - kerja menanggalkan cat lama dan mengecat semula dinding ruang dalam serta luar bangunan klinik. ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '125000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000413', '10000413', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Ubah Suai Dan Pembaikan Klinik Pergigian Pitas ', '1. Kerja-kerja pengubahsuaian ruang sedia ada bersebelahan bilik rawatan bagi mewujudkan bilik utiliti/CSSD dan ruang kerja yang berkaitan untuk perluasan ruang kerja di bilik rawatan. Klinik Pergigian Pitas tidak mempunyai bilik utiliti sedia ada.\n2. Kerja - kerja pendawaian elektrik dan kerja - kerja perpaipan bagi ruang utiliti/CSSD yang diwujudkan.\n3. Kerja - kerja pembaikan paip bocor pada lantai sinki di ruang Bilik Rawatan 1.\n4. Kerja - kerja pembaikan dan pengubahsuaian keseluruhan kabinet yang rosak pada Bilik Rawatan 1 dan Bilik Rawatan 2.\n5. Kerja - kerja pembaikan atap bocor, siling rosak dan rain gutter yang rosak.\n6. Kerja - kerja menanggalkan cat lama dan mengecat semula dinding ruang yang telah diubahsuai.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000414', '10000414', '42149901', 'Jabatan Kesihatan Negeri Sabah/\nPejabat Pergigian', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Bilik X-ray Dan Kerja-kerja Lain Yang Berkaitan Di Klinik Pergigian Rosok', '1. Membekal, memasang bata dua lapisan di bilik bersaiz 10kaki x 7kaki.\n2. Membekal, memasang dan mentauliah pintu berplumbum.\n3. Membekal,memasang dan mentauliah lampu amaran di luar pintu bilik X-ray.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000415', '10000415', '42149901', 'Hospital Beaufort', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf High Depency Ward (HDW) Dan Kerja-kerja Lain Berkaitan Di Hospital Beaufort', '1. Membekal peralatan DI Isolation Room Ground floor\n2. Pemasangan Pipeline Reticulation system\n3. Membekal dan memasang alarm panel\n4. Membekal dan Memasang GTU\n5. Kerja-kerja Elektrikal\n6. Kerja-kerja gas room Medical Gas\n7. Kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '485000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000416', '10000416', '42149901', 'Hospital Wanita dan Kanak-kanak (HWKKS)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Menaik Taraf Ruang Rawatan (Yellow Zone) Di Jabatan Kecemasan Dan Trauma (ETD), Hospital Wanita & Kanak-Kanak Sabah (HWKKS)', '1. Kerja-kerja awalan\n2. Kerja-kerja membekal dan memasang papan tanda keselamatan, ite hoarding termasuk penghadang keselamatan\n3. Kerja-kerja Struktur\n4. Kerja-kerja Bumbung\n5. Kerja-kerja lantai, siling dan dinding\n6. Kerja perpaipan dan sanitari tandas\n7. Kerja-kerja mengecat\n8. Kerja-kerja Elektrik\n9 Kerja-kerja mekanikal\n10. kerja-kerja pemasangan rangkaian talian telefon & internet\n11. Kerja-kerja lain berkaitan\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '800000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000417', '10000417', '42149901', 'Hospital Kinabatangan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Pembinaan Bangunan Unit Hemodialisis Baru Hospital Kinabatangan', '1. Kerja-kerja awalan\n2. Kerja-kerja membina bangunan hemodialisis (termasuk tapak, struktur, kekuda dan bumbung)\n3. Kemasan dalaman HDU\n4. Kerja-kerja paip\n5. Kerja-kerja mengecat\n6. Kerja-kerja pendawaian elektrik dan mekanikal\n7. Kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '800000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000418', '10000418', '42149901', 'Hospital Tuaran', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Wad Pediatrik High Dependancy Ward (HDW) Dan Lain-lain Kerja Berkaitan Di Hospital Tuaran', '1. Kerja-kerja awalan\n2. Kerja-kerja awam (termasuk membekal dan memasang dinding dan pintu gelongsor jenis aluminium, kerja membekal dan memasang drying cabinet lengkap dengan aksesori)\n3. Kerja-kerja elektrik (termasuk membekal dan memasanag soket \"essential\" dari DB\n4. Kerja-kerja mekanikal (membekal dan memasanag poin gas MA4, O2 dan vacum), (membekal dan memasanag sistem washer, kipas ekzos dan kerja-kerja lain berkaitan)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '440000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000419', '10000419', '42149901', 'Hospital Queen Elizabeth (HQE)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Pembaikan Bilik Ujian Pendengaran Klinik Audiologi Di Jabatan ORL Hospital Queen Elizabeth (HQE)', '1. Kerja-kerja awalan\n2. Kerja-kerja awam (termasuk dinding, siling, lantai, pintu, kabinet dan sinki)\n3. Kerja-kerja Elektrik\n4. Kerja-kerja lain (membekal dan memasang Audiometric Booth)\n5. Kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000420', '10000420', '42149901', 'Hospital Queen Elizabeth II (HQE2)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Cath LAB-2 (Pembedahan Vaskular) Serta Kerja-kerja Lain Yang Berkaitan Di Hospital Queen Elizabeth II', '1. Kerja-kerja awalan\n2. Kerja-kerja naiktaraf equipment pendant\n3. kerja-kerja membekal dan memasang wiring elektrikal \n4. Kerja-kerja membekal dan memasang Medical gas piping', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '375700.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000421', '10000421', '42149901', 'Hospital Semporna', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Menaik Taraf Wad Pediatrik Ke Pediatric High Dependency Unit (PHDU) Di Hospital Semporna', '1. Kerja-kerja awalan\n2. Kerja-kerja struktur (termasuk pad roofing, stump, rasuk & antai bawah, tiang, rasuk bumbung\n3. Kerja-kerja bumbung (membekal dan memasang kekuda bumbung jenis C, membekal gascia board, rain guter jenic UPVC dan menyediakan lukisan skematik)\n4. Kerja-kerja lantai, siling dan dinding\n5. Kerja-kerja mengecat\n6. Kerja-kerja mekanikal (termasuk membekal dan memasang medical gas pipe line, terminal unit, alarm system, T&C, Bed panel nurse call system)\n7. Kerja-kerja elektrikal\n8. Kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '345900.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000422', '10000422', '42149901', 'Hospital Semporna', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Unit Forensik Dan Kerja-kerja Lain Yang Berkaitan Di Hospital Semporna', '1. Kerja-kerja awalan\n2. Kerja-kerja dinding dan lantai\n3. Kerja-kerja pintu (Membekal dan memasang pintu rintangan, Membekal dan memasang \"doubie leaf\")\n4. Kerja-kerja sanitari dan tandas (Kerja penyambung paip, membekal dan memasang mangkuk tandas duduk jenis porcelain)\n5. Kerja-kerja elektrikal dan mekanikal (membekal dan memasanag sistem mata kipas lawas concealed, mata lampu kecemasan/tanda keluar, penyaman udara)\n6. Kerja-kerja penghadang kebakaran \n7. Kerja-kerja lain berkaitan\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000423', '10000423', '42149901', 'Hospital Duchess of Kent, Sandakan (HDOK)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Penambahbaikan Jabatan Kecemasan Dan Trauma Hospital Duchess of Kent Sandakan', '1. Kerja-kerja awalan\n2. Kerja-kerja awam (membekal dan memasang swing door with electromagnetic lock, curtain rail, sinki, signage, pembaikan lantai dan mengecat) di zon hijau, kuning dan merah\n3. Kerja elektrikal (membekal dan memasang switch soket outlet, kipas dinding, lampu, beacon light)\n4. Kerja-kerja mekanikal - penambahan ventilation system di resus dan isolation room (negative pressure system)\n5. Kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '85000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000424', '10000424', '42149901', 'Hospital Duchess of Kent, Sandakan (HDOK)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Wad Perubatan Rehabilitas Dan Lain-lain Kerja Berkaitan Di Hospital Duchess of Kent, Sandakan (HDOK)', '1. Kerja-kerja awalan\n2. Kerja-kerja awam (termasuk siling, bumbung, dinding, pintu, tingkap, lantai, mengecat, sistem perpaipan, mekanikal, ala penghawa dingin, bed head, medical gas, fire protection system, pemindahan fire hydrant)\n3. Kerja-kerja elektrikal (Distribution borad, essential DB, Soket, Lampu, nursing call system)\n4. Kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '475000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000425', '10000425', '42149901', 'Hospital Queen Elizabeth II (HQE2)', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Pembaikan Ruang Kompleks Farmasi Di Hospital Queen Elizabeth II, Kota Kinabalu', '1. Kerja-kerja awalan (mengosongkan tapak kawasan kerja, termasuk membuang sampah\n2. Membaiki susun atur kerja di ground floor\n3. kerja-kerja (termasuk meroboh, mengeluarkan semua struktur sedia ada yang tidak di ingini)\n4. kerja-kerja awam (termasuk fire roller shutter, partition di kaunter hasil, workstation di unit hasil, membekal dan memasang pintu di kaunter unit hasil)\n5. kerja-kerja elektrik (termasuk kerja pendawaian structured cat 6 dan soket, membekal serta memasang server, wifi)\n6. membekal dan memasang card access system\n7. membekal dan memasang sistem furniture (termasuk workstation, high filing cabinet, kerusi pejabat, LAN, QMS untuk 5 kaunter dan 1 ticketing)\n8. kerja-kerja membaiki nursing unit di tingkat 1 untuk dinaiktaraf kepada Jabatan Farmasi (membekal dan memasang  partition di bilik mesyuarat unit nursing, membekal dan memasang workstation di kaunter hadapan, membaiki dan memindahkan outlet soket sedia ada)\n9. Kerja-kerja structured cabling (kerja-kerja membekal dan memasang data cabling untuk telekomunikasi, pemansangan CAT 6, server)\n10. membekal dan memasang sistem furniture (termasuk workstation, high filing cabinet, kerusi pejabat)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000426', '10000426', '42149901', 'Hospital Pitas', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Pembaikan Dan Lain-lain Kerja Yang Berkaitan Di Farmasi Logistik Hospital Pitas ', '1) Memasang \"GI-Platform\" lengkan dengan lantai, tangga, railing serta komponen dan kelengkapan lain.\n2) Kerja-kerja eletrik seperti memasang soket, memasang lampu,  lampu kecemasan dan exhaust fan \n3)  Mengganti pintu sedia ada kepada jenis pintu aluminium jenis sliding) ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '65000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000427', '10000427', '42149901', 'Hospital Mesra Bukit Padang', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf, Ubah Suai  Serta Lain-lain Kerja Yang Berkaitan Di Ruang Menunggu  Farmasi Pesakit Luar, Hospital Mesra Bukit Padang', '1. Menaiktaraf dan mengubahsuai  ruang menunggu di luar bangunan Farmasi Pesakit Luar.                                                         \n2.  Menaik taraf bumbung  awning sedia ada kepada bumbung gunasama.                                                    \n3.   Menaik taraf lantai sedia ada kepada lantai konkrit.                                                                                                                                                           ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000428', '10000428', '42149901', 'Hospital Kota Marudu', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Pembaikan Ruang Pejabat Unit Farmasi Logistik, Hospital Kota Marudu', '1. Kerja-kerja menanggalkan/pemasangan pintu dan tingkap serta dinding sedia ada\n2. Membekal dan memasang dinding bata campuran simen dan pasir (1:3) dengan sempurna di bilik pegawai, bilik server dan ruang pejabat\n3. Kerja-kerja Elektrikal dan Mekanikal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
