INSERT INTO `tblprojek` VALUES ('10000431', '10000431', '42149901', 'Pejabat Kesihatan Pergigian Kawasan Beaufort', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SABAH', 'Kerja-kerja Naik Taraf Klinik Pergigian Sipitang', '1. Kerja memasang lapisan barium pada dinding, membekal dan memasang lapisan plumbum pada bilik X-ray.\n2. Kerja-kerja menaik taraf ruang menunggu dengan memasang tempered glass di sekeliling ruang menunggu, silling, alat penghawa dingin dan pendawaian elektrik yang berkenaan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000432', '10000432', '42159901', 'JKN Sarawak / PTJ', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Mengatasi Masalah Kulat dan Pendawaian semula Sistem Elektrikal di Lobi Utama dan Unit Hasil Serta Kerja-kerja lain berkaitan di Hospital Bintulu', '1. Kerja-kerja preliminar termasuk membuang insulation rock wool asal dan membersihkan ruang sofit.\n2. Kerja-kerja semberuan PU seperti berikut:\nJENIS: Rigid Polyurethane (PU) foam insulation (HCFC) free c/w fore retardant Class B2 according standard D/N 4102.\nKetumpatan : 30-25 kg/m3, +-%\nKetebalan : 50mm\nAnggaran luas Kawasan : 400m2\n3. Kerja-kerja pendawaian semula dan pengantian siling', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '347780.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000433', '10000433', '42159901', 'JKN Sarawak / PTJ', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja Menaik Taraf Wad Perubatan Lelaki Dan Wanita Di Hospital Bintulu, Sarawak', 'Kerja-kerja mengubah suai ruangan lobi belakang wad perempuan yang melinbatkan komponen arkitektur seperti memasang dinding,pintu, cat serta yang kerja-kerja lain berkaitan. Selain dari pada itu, kerja-kerja pendawaian untuk soket, lampu, kipas dan kelengkapan mekanikal dan elektrikal yang lain.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '87000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000434', '10000434', '42159901', 'JKN Sarawak / PTJ', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Menaik Taraf Perpaipan Gas Perubatan Dan Kerja Berkaitan Di Burn Unit, Hospital Bintulu, Sarawak.', 'Pemasangan medical gas piping untuk kegunaan medical pendant di ICU Bay 3 dan ICU Bay 4, Burn Unit.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000435', '10000435', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Pembaikan Dan Naik Taraf Ibu Pejabat Jabatan Kesihatan Negeri Sarawak', '1. Pembaikan 16 unit kubikal tandas di Ibu Pejabat Jabatan Kesihatan Negeri Sarawak.                                                                                                                                                                                                                                                          2.Pembaikan 10 kepala paip (outdoor) termasuk saluran paip bagi pencucian dan pembersihan luaran di Ibu Pejabat Jabatan Kesihatan Negeri Sarawak  \n3. Pemasangan Lampu Solar di Blok Kesihatan Awam                                                                          4. Naiktaraf serta penggantian kabin rekod IPJKNS - 3 unit                                                                                                      5. Naik taraf kaunter utama IPJKNS (outdoor)                               \n6. Naik taraf kaunter Cawangan Pengurusan Am dan Komunikasi Korporat                                                                              7. Pembaikan pagar luar (mesh) di tepi lokasi parking staf                                                                                                8. Menaik taraf pagar di pintu pagar utama termasuk grill parit IPJKNS                                                                                          9. Menaik dan penggantian pintu kecemasan Aras Bawah Blok Pengurusan                                                                                    10. Naik taraf awning atau bumbung di sepanjang laluan jalan Blok Kesihatan Awam dan Blok Pengurusan                                                                                 11. Pembaikan dan naik taraf atap tempat letak Bas Jabatan                                                                                         12. Pembaikan dan penggantian atap/gutter di Kuarters Integrasi                                                                                                13.  Naik taraf  langsir / kalis cahaya (tinted) di :\na) Bilik Mesyuarat Mulu (tinted)\nb) Bilik Mesyuarat Niah (blind curtain)                                        \nc) Cawangan Pembangunan (tinted)                                              \n14. Pembaikan dan penggantian atap/gutter di Kuarters Integrasi', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
