INSERT INTO `tblprojek` VALUES ('10000438', '10000438', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Mengubahsuai Ruang Bangunan Kedai Bagi Penyewaan Ruang Pejabat Baharu PKB Kuching', '1)Kerja-Kerja Pendawaian Elektrikal Untuk Penambahan Soket, Lampu Dan Pengujian Integriti Pendawaian Sedia Ada Bangunan.\n2)Kerja-Kerja Meroboh Dinding Pembahagi Ruang Kerja Sedia Ada Dan Pembinaan Dinding Pembahagi Baharu.\n3)Kerja-Kerja Perpaipan.\n4)Kerja-Kerja Penambahan Soket Lan Dan Pendawaian Baharu Bagi Access Point Dan Network Switches.\n5)Kerja-Kerja Pembersihan Pasca Ubah Suai Bangunan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '120000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000439', '10000439', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Cadangan Kerja-kerja Ubahsuai Ruang Bangunan KK Samarindah, Bahagian Samarahan, Sarawak', '1.Kerja partition, dinding, pembekalan dan pemasangan pintu  dengan rangka dan aksesori yang berkaitan, mengecat ruang dalaman, kerja mekanikal dan elektrikal yang berkaitan.\n2.Kerja pembinaantabletop dan kaunter farmasi dengan aksesoriberkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000440', '10000440', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Pembaikan Dan Naik Taraf KK Ibu Dan Anak KK Balingian, Mukah', '1)Membekal Dan Mengganti Bumbung Bangunan Dan Gutter.\n2)Penggantian Siling Bangunan Yang Rosak.\n3)Membekal Dan Menggantian Lantai Yang Rosak.\n4)Membekal Dan Kerja Penggantian Dinding Luar Dan Dinding \'Partition\'\n5)Menanggal, Membekal Dan Kerja Pemasangan Tingkap Sliding Dan Pintu Baru,\n6)Pembaikan Tandas.\n7)Mengeluarkan Tahi Kelawar Termasuk Pembasmian&Rawatan.\n8)Kerja Pembaikan Pendawaian Dan Paip.\n9)Kerja-Kerja Cat Dan Kekemasan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '250000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:38', '2024-07-09 17:10:38');
