INSERT INTO `tblprojek` VALUES ('10000444', '10000444', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja Naik Taraf Pintu Laluan Keluar Atau Pintu Kecemasan  Serta Lain-lain Pembaikan Am Klinik Komuniti Sungai Bidut, Sibu', '1) Kerja Mewujudkan Laluan Keluar Kecemasan\n2) Lain-Lain Pembaikan Am', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '50000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000445', '10000445', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Meroboh 3 Bangunan Kuarters (Telah Dilulus Pelupusan) Di KK Singai,Kuching', '1)Kerja-Kerja Meroboh 3 Unit Kuarters Serta Kerja Pembersihan Tapak ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '30000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000446', '10000446', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Pembaikan Dan Penyelenggaraan KK Engkelili', '1)Kerja-Kerja Pembaikan Dan Naik Taraf Termasuk Pendawaian Semula Bangunan Klinik Di KK Engkilili Serta Lain-Lain Kerja Berkaitan:-\n i.Menukar Sistem Pendawaian Termasuk Menukar Distribution Board Di Klinik Kerana Terlalu Kerap Berlakunya Tripping (Overload)\n ii.Pembaikan Atap, Siling, Dinding, Dan Kerja Berkaitan Yang Lain.\n iii.Membekal Dan Memasang Awning Di Makmal Dan Pintu Depan Klinik Berukuran 457 Ft2.\n iv.Meratakan Jalan Konkrit, Membuat Semula Parit Dan Membuat Safety Rail Di Laluan Masuk Klinik \n v.Menukar Siling Depan Pantri Berukuran 50Ft2, Menukar Pintu 2 Daun Dan Tiang Bendera Kerana Tiang Bendera Yang Sudah Rosak Dan Tidak Boleh Dipakai.\n vi.Jendela Dan Pintu Makmal Perlu Dipasang Dengan Awning Kerana Air Hujan Akan Tempias Masuk Ke Dalam Ketika Hujan Lebat.\n vii.Membuat Tempat Parking Ambulans Yang Baru Dengan Menambah Lantai Konrit Bagi Memudahkan Laluan Ambulans Dan Pesakit. \n viii.Meratakan Ramp Menuju Ke Pintu Masuk Utama Klinik Kerana Agak Curam Dan Menyukarkan Pesakit Terutama Orang Tua Untuk Jalan Di Kawasan Tersebut. Ketika Hujan, Jalan Tersebut Juga Licin Dan Air Hujan Mengalir Masuk Ke Dalam Klinik Serta Membuat Parit Kecil Untuk Pengaliran Air Yang Lancar.                 \n                                                                                                                                                                                                                                                                                                                                                                              ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000447', '10000447', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Naik Taraf Sistem Tangki Air, Pembaikan Dinding Dan Lantai Bagi Klinik Serta Kerja-kerja Berkaitan Di KK Long Semadoh, Lawas', '1) Kerja-Kerja Menggantikan Tangki Air Yang Baru Untuk Klinik \n2) Kerja-Kerja Menggantikan Sistem Perpaipan Sedia Ada \n3)Kerja-Kerja Pembaikan Kecil\n4)Kerja-Kerja Pembaikan Dinding Klinik\n5)Kerja-Kerja Pembaikan Lantai Klinik', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000448', '10000448', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Pembaikan Dan Naik Taraf Bumbung Serta Lain-lain Kerja Berkaitan di KKIA Sekama, Kuching', 'Kerja pembaikan pada atap di bahagian physioterapy serta pembaikan siling dan lantai klinik serta kerja baikpulih sistem sanitasi dan tandas', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000449', '10000449', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Pendawaian Semula Dan Kerja-kerja Am Lain Di KK Bintulu', 'Membaikpulih Dan Melaksanakan Pendawaian Semula Bagi Mengelakkan Litar Pintas Berlaku Yang Akan Mengakibatkan Kerosakan Pada Mesin-Mesin Di Makmal Dan Department Lain DI Klinik.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000450', '10000450', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Naiktaraf Bangunan Klinik Di Klinik Kesihatan Balai Ringin, Serian', '1)Kerja- Kerja Menyelenggara Lantai Kayu, Dinding Dan Siling Klink Yang Rosak Dan Bocor. \n2)Naik Taraf Ruangan Menunggu Pesakit Yang Kini Terletak Di Luar Klinik \n3)Naik Taraf Struktur Atap Klinik Kesihatan Balai Ringin\n4)Naik Taraf Jalan Dan Pagar Utama Masuk Ke Klinik Dan Kawasan Tempat Letak Kenderaan\n5) Mengecat Keseluruhan Luar Dan Dalam Bangunan Klinik\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000451', '10000451', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Naiktaraf Pelantar Tangki & Menggantikan Tangki Air Di KK Taman Negara Mulu, Miri.', 'Kerja-kerja pembinaan konkrit bertetulang bagi komponen struktur asas, tiang dan lantai tangki. Kerja pemasangan perpaipan dan mengecat.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '99000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000452', '10000452', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Cadangan Pengubahsuaian High Cube Container Untuk Kegunaan sebagai Klinik Long Lama, Miri serta Kerja-kerja Berkaitan\n', 'Kerja-kerja membina, mengubahsuai cabin container, kerja-kerja pendawaian, pembekalan penghawa dingin, memasang bumbung metal desk, memasang awning, membina ruang kerja. ruang rawatan, ruang menunggu, ruang makmal, ruang fisio, ruang farmasi, ruang kecemasan dan sebagainya untuk pengoperasian sebagai klinik kesihatan jenis 7 secara sementara ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '951200.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000453', '10000453', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Ubah Suai Wad Perempuan menjadi Wad Psikiatri di Hospital Sri Aman (Blok Lama)', '\n1. Mengubahsuai tandas lelaki dan perempuan seperti memasang pintu (5unit), membina table singki (4 unit), menanam paip dan wayar kedalam dinding. \n2. Memasang high security tempered glass window. \n3. Membina acute room, dilengkapi padded wall (4 bilik)\n4. Mengubahsuai nurse counter dan treatment room\n5. Membina dinding diantara wad lelaki, nurse counter dan wad perempuan beserta panel vision. \n6. Membekal dan memasang CCTV (8 kamera dan 1 monitor) serta kerja berkaitan\n7. Membekal dan memasang AC jenis split unit\n8. Kerja-kerja lain yang berkaitan untuk melengkap kerja.\n9. Memasang access door system beserta dengan semua aksesori yang diperlukan untuk melengkap sistem ( 2 set)', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000454', '10000454', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Menaiktaraf Sistem Gas Perubatan di Hospital Bau', '1. Kerja-kerja ubahsuai dinding, siling, dan kemasan-kemasan lain. \n2. Kerja-kerja pemasangan sistem gas pada kubikel katil', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '426000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000455', '10000455', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Naik Taraf Gas Medikal dan Sistem Perpaipan Gas Hospital Kapit', 'Pemasangan sistem perpaipan gas, pemasangan sistem dan kelengkapan elektrikal serta kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '497750.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000456', '10000456', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Cadangan Naik Taraf Sistem Gas Perubatan Oksigen Termasuk Perpaipain Oksigen Serta Lain-lain Kerja Yang Berkaitan Di Wad Dan Jabatan Kecemasan Dan Trauma Hospital Limbang', '1. Pemasangan poin oksigen di setiap katil di Wad-wad dan Jabatan Kecemasan dan Trauma.\n2. Pemasangan paip gas daripada sistem sedia ada ke Wad-wad dan Jabatan Kecemasan dan Trauma.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000457', '10000457', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Penggantian Bumbung Hospital Saratok', '1. Kerja-kerja membuka atap sedia ada\n2. Kerja-kerja penggantian kerangka bumbung\n3. Kerja-kerja pemasangan bumbung baru serta kerja-kerja lain yang berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000458', '10000458', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Menaik Taraf Bangunan Perubatan Yang Merangkumi Wad-wad Pesakit Dalam Serta Kerja Yang Berkaitan, Hospital Mukah', '1.  Menukar bumbung lama jenis spandek ke metal roofing\n2. Menukar siling lama jenis softboard ke jenis gypsum board dan superflex ceiling\n3. Menukar kayu kekisi serta saluran air termasuk rdwp\n4. Menukar sistem pendingin hawa yang telah melebihi 15 tahun\n5. Menukar alat pemadam api yang lebih dari 12 tahun\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '488814.24', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000459', '10000459', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Naik Taraf dan Penggantian Sistem Chiller Di Bangunan CRC, Hospital Umum Sarawak', 'Naiktaraf dan mengganti Sistem Chiller No.2 termasuk penggantian compressor serta kerja-kerja lain berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000460', '10000460', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Pembaikan Sistem Penghawa Dingin Serta Kerja-kerja Yang Berkaitan DiJabatan CT Scan, Hospital Sarikei\n', '\n1. Naiktaraf Sistem Penghawa Dingin di Jabatan CT scan termasuk CT Scan Room, Control Room dan Patient waiting area\n2. Kerja-kerja berkaitan seperti penggantian sistem penghawa dingin dan lain-lain. ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '80000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000461', '10000461', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', '\nNaik Taraf Bilik-bilik Di ID Ward kepada Negative Pressure Room, Hospital Miri', '\nPemasangan Sistem Negative Pressure di 4 bilik pengasingan di ID ward Hospital Miri', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '486800.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000462', '10000462', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Membina Dan Menyiapkan Bangunan Satu Tingkat Untuk Stor Bahan Mudah Terbakar Dan Kerja-kerja Naiktaraf Dan Ubahsuai Blok Bangunan Satu (1) Tingkat Untuk Cawangan Penguatkuasa Farmasi  di Cawangan Farmasi Logistik Negeri', 'Kerja membina bangunan satu tingkat yang merangkumi:\na) Kerja-kerja awalan dan penyediaan tapak\nb) Kerja-kerja konkrit bertetulang\nc) Kerja-kerja membina struktur bangunan\nd) Kerja-kerja mekanikal dan elektrikal\nKerja naik taraf dan ubah suai bangunan sedia ada yang merangkumi:\na) Keterangan am & kehendak permulaan \nb) Kerja-kerja awalan seperti memecah, meroboh, mengalih, memindah, mengorek, menampal, memotong, menebuk, menanggal, membuka, mengemas, membersih tapak\nc) Kerja-kerja membina 125mm tebal dinding bata tanah liat (clay brick) dilepa pada dua belah bahagian\nd) Kerja-kerja membekal dan memasang pintu 1 daun jenis kayu keras\ne) Kerja-kerja membekal dan memasang jeriji keluli lembut pada pintu\nf) Membekal dan memasang kemasan lantai jubin\ng) Kerja-kerja membekal dan memasang tingkap termasuk jerejak besi \nh) Kerja-kerja membekal dan memasang siling jenis jeriji keluli lembut\ni) Kerja-kerja membina kabinet dinding dari kayu keras \nj) Kerja membekal dan memasang bumbung jenis logam\nk) Kerja-kerja membekal dan memasang keperluan Tandas (L&P)\nl) Kerja-kerja sistem kumbahan\nm) Kerja-kerja membekal dan memasang salur tegak air hujan\nn) Kerja-kerja elektrik &b mekanikal', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '490000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000463', '10000463', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja-kerja Pendawaian Semula Di Pejabat Farmasi Bahagian Kapit', '1. Pepasangan elektrik (lampu, kipas, pelawas, EL,KELUAR, street light)\n2. Pendawaian pepasangan elektrik sistem lampu, soket 13A, point kuasa AC,isolator.\n3. Papan suis utama, papan agihan\n4. Sub kable, underground cable\n5. Kerja-kerja awalan tapak\n6.Pengujian integriti sistem (papan agihan, pendawaian, sistem pembumian)\n7. Penyelenggaraan generator set sediada', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '320000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000464', '10000464', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Menaik Taraf Bilik Sejuk Ubat Dan Kerja Pembaikan Gutter, Downpipe Dan Louvre Di Pejabat Farmasi Bahagian Sibu', 'a) Membekal dan memasang sebuat bilik sejuk yang bertaraf 2\'C-8\'C untuk menyimpan ubat rangkaian sejuk\nb) Kerja-kerja mengubahsuai bangunan utama/platform/floor/coridor\nc) Kerja-kerja elektrik yang berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '185000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000465', '10000465', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Naiktaraf Ruang Bilik Klinikal Bagi Pakar Pergigian Forensik Di Unit Perubatan Forensik, Hospital Umum Sarawak', 'Kerja dinding, pintu, jeriji keselamatan, kerja mekanikal dan elektrikal dan kerja-kerja lain yang berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '18780.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000466', '10000466', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja Ubah Suai Bilik Rawatan, Bilik Pegawai Pergigian Yang Menjaga Dan Pejabat Klinik Pergigian Sarikei', '1. Mengubahsuai bilik Pegawai Pergigian Yang Menjaga kepada bilik surgeri yang ke-lima \n2. Mengubahsuai Bilik Pejabat untuk dijadikan bilik PPYM dan bilik Pejabat untuk kegunaan Pegawai Pergigian dan JP U32', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '30000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000467', '10000467', '42159901', 'JKN Sarawak / PTJ', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'SARAWAK', 'Kerja Menaik Taraf Bilik Rawatan Di Klinik Pakar Hospital Ke Klinik Pergigian Pakar/Bilik On-call Pergigian Di Hospital Bintulu', 'Kerja lantai, dinding dan termasuk pengujian dan pentauliahan bilik x-ray, pembinaan workbench, kabinet, pemasangan pintu, mengecat, kerja mekanikal dan elektrikal serta kerja-kerja lain yang berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '149000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
