INSERT INTO `tblprojek` VALUES ('10000470', '10000470', '42289901', 'JKR Labuan', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'WP LABUAN', 'Kerja-kerja Naik Taraf Bangunan Vektor Dan Stor Racun Serta Lain-lain Kerja Yang Berkaitan', '1. Kerja-kerja pembersihan tapak pembinaan\n2. Membina Bangunan Pejabat Vektor Dan Stor Racun,                                                      \n3. Kerja-kerja menyediakan sistem kumbahan untuk tandas, tempat mandi dan ruang bancuhan racun\n4.Kerja-Kerja Mekanikal Dan Elektrik.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '625000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
