INSERT INTO `tblprojek` VALUES ('10000476', '10000476', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Naik Taraf Tandas Pesakit Di NW18A, NW18B, NW23, NW24 Dan SW19 Di Bangunan Utama Serta Kerja-kerja Berkaitan Di Hospital Kuala Lumpur', '1. Kerja-kerja penggantian jubin lantai  dan dinding yang licin.\n2. Kerja-kerja penggantian kelengkapan tandas termasuk sistem perpaipan.\n3. Kerja-kerja penggantian dan penambahan peralatan mesra OKU.\n4. Kerja-kerja penggantian pintu tandas termasuk bingkai yang rosak dan tidak mesra OKU.\n5. Kerja-kerja penggantian siling tandas yang rosak.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000477', '10000477', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Penggantian Bumbung Sedia Ada Di Unit Rekod Ortopedik Jabatan Rekod Perubatan, Jabatan Kerja Sosial Perubatan (extand bulding) Dan Jabatan Kecemasan Serta  Kerja-kerja Berkaitan', '1. Penukaran zink lama kepada bumbung yang  baru.\n2. Penggunaan bahan bumbung yang tidak mudah berkarat, kurang menghasilkan haba panas, dilapisi dengan satu bahan penebat haba dan kurang bunyi bising semasa hari hujan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000478', '10000478', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Naik Taraf Kaunter Jururawat (custome made) Di 12 Wad Serta Kerja-kerja Lain Yang Berkaitan Di Hospital Kuala Lumpur', '1. Kerja-kerja membuka 12 kaunter jururawat yang lama dan membekal serta memasang kaunter yang baru dari jenis nyatoh ply. \n2. Lokasi menaiktaraf kaunter : N5B, NW16, NW18A, N4A, N6A, NICU, NW17, NW1, NW2, SW7, RT4A, RT4B\n3. Kerja-kerja membekal dan memasangan curtain railing partition jenis Hospital Heavy Duty serta penggantian railing sedia ada yang telah patah dan rosak di keseluruhan wad.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000479', '10000479', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Penggantian Sistem Lapisan Kalis Air Di Bangunan Radioterapi Dan Onkologi, Bumbung Jabatan Fisioterapi Dan Kawasan Sekitar Hospital Kuala Lumpur Serta Kerja-kerja Berkaitan', '1. Kerja-kerja menanggalkan membrane lama yang telah berusia lebih 25 tahun.\n2. Kerja-kerja pemasangan membrane baru ketebalan 4mm termasuk kerja-kerja meratakan semula permukaan bumbung konkrit.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '400000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000480', '10000480', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Menaik Taraf Lead Door Di Bilik Angio 9 Jabatan Radiologi, Blok Utama Dan Unit Radiologi, Jabatan Kecemasan Dan Trauma Serta Kerja-kerja Berkaitan Di Hospital Kuala Lumpur', 'Penggantian dan menaiktaraf lead door sediada bagi memenuhi keperluan dan mematuhi garis panduan Bilik Beradiasi.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000481', '10000481', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Menaik Taraf Laluan Pejalan Kaki Berbumbung (Cover Walkway) Sepanjang Laluan Wisma Kayu Ke Klinik Ortopedik Dan Institut Pediatrik', 'Membuka laluan pejalan kaki dari jenis polycarbonate kepada jenis metal deck dan heavy duty polycarbonate mengikut spesifikasi JKR dan kesesuaian lokasi.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000482', '10000482', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Naik Taraf Tandas Pesakit Di Wad N4A, N6A Dan N6B Di Bangunan Institut Kaji Saraf Tunku Abdul Rahman (IKTAR) Serta Kerja-kerja Berkaitan Di Hospital Kuala Lumpur', '1. Kerja-kerja penggantian jubin lantai  dan dinding yang licin.\n2. Kerja-kerja penggantian kelengkapan tandas termasuk sistem perpaipan.\n3. Kerja-kerja penggantian dan penambahan peralatan mesra OKU.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '300000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000483', '10000483', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Naik Taraf  Bilik-bilik Kelas Pertama Di N4A, N6A Dan N6B, Jabatan Pembedahan Neuro, HKL   ', '1. Pemasangan vinyl di keseluruhan lantai bilik.                                                         \n- Kerja-kerja memecah dan memasang sink serta cermin muka.\n- kerja-kerja memecah dan memasang semula tiles lantai dan dinding tandas.\n- Pemasangan mangkuk tandas baru.\n- Pemasangan sistem nurse call di bilik dan tandas                                                                  \n-  Grab-bar(pemegang) di tandas                                                            \n-  Mengecat seluruh bilik\n2. Kerja-kerja pendawaian bagi sistem pencahayaan (termasuk lampu KELUAR dan lampu kecemasan) dan soket                                                                                          ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000484', '10000484', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-Kerja Menaik Taraf Stor Pukal Farmasi Serta Kerja-kerja Berkaitan Di Hospital Kuala Lumpur', ' Melibatkan kerja-kerja:\n1. Menaiktaraf sistem penghawa dingin dengan menukar penghawa dingin jenis split aircond (10 unit sedia ada) kepada sistem penghawa dingin berpusat (AHU) dilengkapi dengan sistem timer bagi memastikan operasi operasi 24 jam \n2. Menyambung sistem elektrik sedia ada daripada substesen TNB terdekat bagi menampung keperluan sistem AHU.\n\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000485', '10000485', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Naik Taraf Farmasi Neurosains Serta Kerja-kerja Berkaitan Di Hospital Kuala Lumpur\n', '1) Memecahkan dinding dan pintu surau (gypsum board)\n2) Memecahkan tempat ambil wudhuk, menanggal kepala air serta menutup punca air di surau\n3) Memecahkan dinding dan pintu masuk kedua farmasi serta merobohkan kaunter farmasi pesakit dalam \n4) Menanggalkan dan memasang semula kabinet kayu atas kaunter di ruang kerja Farmakoterapi Wad\n5) Menanggal \'shutter\',menutup bukaan kaunter lama (asalnya kaunter pesakit luar) dengan dinding batu bata berserta kemasan\n6) Mengalihkan aircond sedia ada:\na) 1HP (sedia-ada): Ke dinding \"surau\"\nb) 1HP (sedia-ada): alih ke Farmasi Kecemasan\nc) 2HP (sedia-ada): pasang di Ruang Kerja Farmasi Pesakit Dalam ke dinding depan\n7) Memindahkan tempguard: \na) Ke dinding surau untuk Fridge A (Peti sejuk dialihkan)\nb) Ke dinding di Ruang Kerja Farmakoterapi Wad untuk Fridge B (peti sejuk dialihkan)\n8) Membekal dan memasang plug point \na) plug point \"E di dinding surau bagi Fridge A yang dialihkan\nb) plug point N and network point di dinding \"surau\" photocopy machine\n9) Memasang papan tanda \"Farmasi Neurosains dan Exit Light x 2\n10) Memecahkan pintu utama dan dinding serta menanggalkan roller shutter lama di pintu masuk utama Farmasi\n11) Memasang pintu utama Farmasi dengan pintu tempered glass sliding dua daun bersaiz  2 x 3\'x7.5\' dan shutter bersaiz 7 x 7.5\n12) Kerja-kerja mengalihkan panel kad akses dari pintu masuk kedua Farmasi ke pintu utama Farmasi\n13) Kerja-kerja kemasan termasuk mengecat keseluruhan Farmasi dan membaik pulih jubin apabila dinding dipecahkan.\n14) Mengalihkan sistem alarm (panel dan sensor) pintu masuk kedua ke pintu utama farmasi. \n15) Mengalihkan talian telefon dari bilik pegawai ke Farmasi pesakit dalam\n16) Memasang lampu kecemasan x 5 dan lama baru x 3. ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '150000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000486', '10000486', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Naik Taraf Cold Room Reagen  Di Unit Mikrobiologi, Jabatan Patologi Serta Kerja-kerja Berkaitan Di Hospital Kuala Lumpur', '1.  Menggantikan semua komponen Cold Room sedia ada kepada yang lebih baik dan sesuai.\n2.  Kerja-kerja pendawaian semula seperti yang diperlukan\n3.  Menambah rak besi dengan bilangan dan saiz yang bersesuaian ', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000487', '10000487', '42240201', 'Hospital Kuala Lumpur', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Naik Taraf Decay Tank Sedia Ada Serta Kerja-kerja Berkaitan Di Hospital Kuala Lumpur', '1. Melibatkan kerja-kerja pendawaian eletrikal dan mekanikal. \n2. Melibatkan pemasangan radioaktif meter di Decay Tank.\n3. Kerja-kerja pemasangan aksesori dan kelengkapan yang berkaitan.', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '200000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000488', '10000488', '42240201', 'Institut Perubatan Respiratori', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Menaik Taraf Fasiliti Bagi 3 Blok Wad Di Institut Perubatan Respiratori (IPR)', '1. Sivil & Struktur:\na. Perlu menjalankan ujian struktur sediada bagi tangga, dinding, railing dan keadaan persekitaran bagi memastikan pertambahan beban dapat ditampung bagi perlaksanaan pemasangan Lif Kerusi Roda ini.\nb. Tapak bagi pengambilan pesakit dan penurunan perlulah mempunyai ruang yang bersesuaian dengan melaksanakan kerja-kerja penambahan dan semakan di tapak dengan lebih terperinci bagi memastikan ruang sediada dapat menempatkan track end/parking bagi pemasangan Lif Kerusi Roda ini.\nc. Tapak bagi pengambilan dan penurunan perlu dilabel pada lantai bagi memastikan ruang tersebut tidak disalah guna dan bagi tujuan keselamatan kepada kakitangan dan orang awam.\nd. Ruang bagi sistem kawalan Lif Kerusi Roda perlu diwujudkan bagi memudahkan pemantauan dan kawalan oleh pihak operator.\ne. Perlu melaksanakan pengalihan kaunter/ruang kerja sediada di tingkat atas dan bawah bagi memastikan kelancaran pengoperasian serta memberi ruang pengambilan dan penurunan pesakit.\n\n2.  Elektrikal:\na. Memerlukan sistem soket kuasa (essential) yang berkapasiti 13 Ampere dan perlu menggunakan kabel bersaiz 4 mm jenis fire rated mineral insulation dan disalurkan dalam kondiut galvanised iron.\nb. Hasil semakan pada tapak, papan agihan sediada adalah mampu menampung kapasiti bagi penggunaan Lif Kerusi Roda memandangkan penggunaan kapasiti bagi bekalan elektrik yang digunakan adalah rendah.\nc. Perlu mengadakan lampu amaran bagi pengoperasian semasa penggunaan wheel chair lift yang dilengkapi dengan panel kawalan dan lampu (merah) di tempat penurunan dan pengambilan pesakit bagi memastikan tangga tersebut tidak digunakan semasa pengoperasian. \n\n3. Mekanikal: \na. Jenis Lif Kerusi Roda yang dicadangkan untuk dipasang dilokasi adalah dari jenis indoor (heavy duty) dan dilengkapi tapak dan landasan yang kukuh dan dipasang pada tangga konkrit sepanjang 9 meter (20 anak tangga). \nb. Saiz dan kapasiti Lif Kerusi Roda perlu memuatkan seorang pesakit dengan kekuatan yang dapat menampung berat sehingga 300kg pada satu-satu masa.\nc. Semua peranan keselamatan perlu diambil kira tidak terhad kepada menghubungkan sistem kepada sistem keselamatan kebakaran perlu mendapatkan kelulusan pengoperasian daripada pihak JKKP dan Jabatan Bomba.\n', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '350000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000489', '10000489', '42240201', 'Institut Perubatan Respiratori', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Menaik Taraf Stor IV Drip Farmasi, IPR', 'Melibatkan kerja-kerja:\n1. Pemasangan sistem penghawa dingin (AHU). \n2. Menggantikan tingkap sedia ada dengan jenis tertutup bagi memastikan pemasangan sistem penghawa dingin dapat dibuat. \n3. Pemasangan air curtain bagi memastikan suhu dapat dikekalkan. \n4.Kerja-kerja membaikpulih lantai simen sedia ada yang kerap pecah kepada lantai jenis heavy duty/jenis epoxy.\n5. Pemasangan kamera dan sistem CCTV, sistem kad akses dan sistem penggera keselamatan \n6. Pemasangan roller shutter jenis motorized dan pintu dengan saiz yang bersesuaian untuk kerja-kerja pemunggahan item \n7. Menggantikan pintu-pintu keselamatan \n8. Mengecat stor\n9. Pemasangan sistem thermguard untuk pemantauan suhu bilik stor.\n10.Pemasangan loading platform\n11. Penggantian bumbung yang lama yang telah berkarat dan bocor\n12. Penggantian DB dan wayar eletrik yang lama dan tidak menepati spesifikasi keselematan terkini', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '450000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000490', '10000490', '42240201', 'Hospital Tunku Azizah', '1006', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'HKL', 'Kerja-kerja Menaik Taraf Bagi Pendawaian Plug Point Untuk Kegunaan Portable Oxygen Concentrator Dan Alatan Elektrik Yang Lain Serta Kerja-kerja Lain Yang Berkaitan Di Jabatan Kecemasan Pediatrik                   ', '1. Kerja-kerja menaik taraf bagi pendawaian Plug Point untuk kegunaan Portable Oxygen Concentrator  \n2. Kerja-kerja membaik pulih atau making good works yang melibatkan cutting/ hacking works untuk kerja-kerja concealed wiring baru di lantai', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '100000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
INSERT INTO `tblprojek` VALUES ('10000491', '10000491', '42240201', 'Cawangan Mekanikal, JKR (WPKL&P)', '1002', '42', '00600', '117', '4001', 'JANUARI ', '2024', 'JKR MEKANIKAL', 'Projek Penggantian Dua (2) Buah Lif Penumpang Dan Lain-Lain Kerja Yang Berkaitan Di Blok A & B, JKWPKL&P', '1. Meroboh 2 Buah Lif Lama\n2. Pasang 2 Buah Lif Baharu\n3. Kerja-Kerja Struktur, Arkitek Dan Elektrik Berkaitan', 'KELULUSAN KSU DATO\' SERI IR DR ZAINI BIN UJANG BERTARIKH 28.12.2023. Rujukan Fail : KKM.400-4/2/31 JLD.8 (1)', '280000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-16 22:32:24');
