INSERT INTO `tblprojek` VALUES ('10000494', '10000494', '42010501', 'NPRA / PPF', '1006', '42', '00600', '117', '1001', 'JANUARI ', '2024', 'FARMASI', 'Kerja-Kerja Naik Taraf Penyaman Udara Berpusat (Centralized AC) Di Program Perkhidmatan Farmasi Tahun 2024', '1. Kerja-kerja membuka penyaman udara berasingan (split unit) yang sedia ada untuk pemasangan saluran ducting sistem penyaman udara berpusat (centralized) di kawasan ruang pejabat Program Perkhidmatan Farmasi (PPF) Zon Mutiara dan Zon Baiduri\n2. Kerja-kerja memasang saluran ducting untuk ruang pejabat Mutiara dan Baiduri dari bahan jenis kalis pengalihan suhu l/d bracket ke siling / slab l/d kerja-kerja kemasan berkaitan\n3. Kerja-kerja membina saluran air daripada chiller sistem Blok B ke ruang AHU baharu di aras siling pejabat PPF\n4. Kerja-kerja pemasangan Air Handling Unit (AHU) untuk sistem pendingin hawa berpusat (centralized AC) baharu di ruang pejabat Mutiara dan Baiduri\n5. Kerja-kerja penyediaan ruang untuk sistem pendingin hawa berpusat termasuk kerja2 pelupusan sistem mekanikal / elektrikal lama termasuk komponen berkaitan bagi menempatkan laluan chilled water dan AHU unit \n6. Pengujian dan pentauliahan', null, '500000.00', null, null, '0', '1', '0', '0', '2024-05-31 18:24:39', '2024-07-09 17:10:38');
